INSERT INTO `spree_pages` VALUES (1,'History','<div class=\'static_page history\'>\r\n\r\n<ul>\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1857.png\" alt=\'The story begins...\'><div><p class=\'period\'>1857</p><h2>The story begins...</h2>\r\n<p>Jean Neuhaus settles in Brussels and opens a pharmacy in the prestigious Galerie de la Reine. He covers his medicines in a layer of chocolate to make them more palatable./p></div></li>\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1912.png\" alt=\'Invention of the praline\'><div><p class=\'period\'>1912</p><h2>Invention of the \'praline\'</h2>\r\n<p>Jean Neuhaus Jr. expands his grandfather’s idea replacing the medicines with fresh cream, thus creating the first filled chocolate. He calls it ‘praline’, which becomes an immediate success!</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1915.png\" alt=\'The ballotin\'><div><p class=\'period\'>1915</p><h2>The \'ballotin\'</h2>\r\n<p>Louise Agostini, wide of Jean Neuhaus, designs an elegant gift box in which the chocolates are attractively presented. This box, called the ‘ballotin’, becomes the ‘must-have’ gift./p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1937.png\" alt=\'Timeless classics\'><div><p class=\'period\'>1937</p><h2>Timeless classics</h2>\r\n<p>The chocolates <a href=\'products/bonbon-13\'>“Bonbon 13”</a> and <a href=\'products/astrid\'>\'Astrid\'</a> are created and become true Neuhaus classics. Today, 75 years on, these chocolates are still made according to the original recipes.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1958.png\" alt=\'Stars of the World Expo\'><div><p class=\'period\'>1958</p><h2>Stars of the World Expo</h2>\r\n<p>Neuhaus introduces the <a href=\'products/caprice\'>\'Caprice\'</a> and <a href=\'products/tentation\'>\'Tentation\'</a> during the World Exhibition in Brussels. These refined filled chocolates reveal on the inside a nougatine biscuit, made according to a special Neuhaus recipe, and are filled by hand with fresh cream or ganache. These chocolates remain the Neuhaus icons today.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1960.png\" alt=\'Royal creations\'><div><p class=\'period\'>1960</p><h2>Royal creations</h2>\r\n<p>In 1959 and 1960, Belgium celebrated the weddings of Prince Albert to Paola and King Baudouin to Fabiola. To mark the occasion, Neuhaus created 4 new chocolates named after the royal family: <a href=\'products/baudouin\'>\'Baudouin\'</a>, <a href=\'products/fabiola\'>\'Fabiola\'</a>, <a href=\'products/albert\'>\'Albert\'</a> and \'Paola\'.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/2004.png\" alt=\'New style\'><div><p class=\'period\'>2004</p><h2>New style</h2>\r\n<p>Neuhaus undergoes a transformation. Its boutiques are given a splendid new look, with a distinctive colour palette that includes warm coral red and elegant chestnut brown./p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/today.png\" alt=\'The luxury Belgian chocolatier\'><div><p class=\'period\'>Today</p><h2>The luxury Belgian chocolatier</h2>\r\n<p>Neuhaus is the market leader in the luxury chocolate sector in Belgium. The company’s strategy is focused on international growth, and the chocolatier currently has over 1000 sales outlets in 50 countries. It is one of the few chocolate companies still manufacturing in Belgium. As supplier to the Belgian Royal Court, this year Neuhaus celebrates the 100th anniversary of the ‘praline’.</p></div></div></li></ul>','history','2013-05-17 22:02:04','2013-07-11 10:42:32',1,0,'',0,1,'neuhaus History','neuhaus History','',0,'neuhaus History',0,'Neuhausin Historiaa','<div class=\'static_page history\'>\r\n\r\n<ul>\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1857.png\" alt=\'Tarina alkaa...\'><div><p class=\'period\'>1857</p><h2>Tarina alkaa...</h2>\r\n<p>Jean Neuhaus asettuu asumaan Brysseliin ja avaa apteekin arvostetulle Galerie de la Reine’lle. Hän kuorruttaa lääkkeensä suklaalla, tehdäkseen niistä maukkaampia.</p></div></li>\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1912.png\" alt=\'Konvehdin keksiminen\'><div><p class=\'period\'>1912</p><h2>Konvehdin keksiminen</h2>\r\n<p>Jean Neuhaus Jr. kehittää isoisänsä ideaa ja korvaa lääkkeet tuoreella kermalla, täten keksien ensimmäisen täytesuklaan. Hän nimeää sen ”konvehdiksi” ja siitä tulee välittömästi suuri menestys!</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1915.png\" alt=\'Ballotin\'><div><p class=\'period\'>1915</p><h2>“Ballotin”</h2>\r\n<p>Louise Agostini, kaukana Jean Neuhausista, suunnittelee elegantin lahjarasian, jossa suklaat ovat kauniisti esillä. Tästä rasiasta, nimeltä “ballotin”, tulee lahja, jonka kaikki haluavat saada.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1937.png\" alt=\'Ajattomat klassikot\'><div><p class=\'period\'>1937</p><h2>Ajattomat klassikot</h2>\r\n<p>Suklaakonvehdit nimeltä <a href=\'products/bonbon-13\'>“Bonbon 13”</a> ja <a href=\'products/astrid\'>“Astrid”</a> kehitetään ja niistä tulee todellisia Neuhaus-klassikkoja. Nykyään, 75 vuotta myöhemmin, nämä konvehdit valmistetaan edelleen alkuperäisten reseptien mukaan.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1958.png\" alt=\'Maailmannäyttelyn tähdet\'><div><p class=\'period\'>1958</p><h2>Maailmannäyttelyn tähdet</h2>\r\n<p>Neuhaus esittelee konvehtinsa nimeltä <a href=\'products/caprice\'>“Caprice”</a> ja <a href=\'products/tentation\'>“Tentation”</a> Brysselin maailmannäyttelyssä. Nämä hienostuneet täytesuklaat pitävät sisällään nougat-krokanttia, joka on tehty Neuhausin erityisen reseptin mukaan ja ne on täytetty käsin tuoreella kermalla tai ganachella. Nämä täytesuklaat ovat pysyneet Neuhausin ikoneina tähän päivään saakka.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/1960.png\" alt=\'Kuninkaalliset luomukset\'><div><p class=\'period\'>1960</p><h2>Kuninkaalliset luomukset</h2>\r\n<p>Vuosina 1959 ja 1960, Belgia juhli Prinssi Albertin ja Paolan ja Kuningas Baudouin ja Fabiolan häitä. Tämän kunniaksi Neuhaus kehitti neljä uutta konvehtia, jotka hän nimesi kuninkaallisen perheen mukaan; <a href=\'products/baudouin\'>”Baudouin”</a>, <a href=\'products/fabiola\'>”Fabiola”</a>, <a href=\'products/albert\'>”Albert”</a> ja ”Paola”.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/2004.png\" alt=\'Uusi tyyli\'><div><p class=\'period\'>2004</p><h2>Uusi tyyli</h2>\r\n<p>Neuhaus käy läpi muodonmuutoksen. Suklaapuodit saavat uuden upean ilmeen, joka saadaan aikaan omalaatuisella väripaletilla, johon sisältyy lämmin korallinpunainen ja tyylikäs tummanruskea.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n<img src=\"../history/today.png\" alt=\'Belgialainen suklaamestari\'><div><p class=\'period\'>Today</p><h2>Belgialainen suklaamestari</h2>\r\n<p>Neuhaus on markkinajohtaja ylellisen suklaan sektorilla Belgiassa. Yhtiön strategia on keskittynyt kansainväliseen kasvuun ja suklaamestarilla on tällä hetkellä yli 1000 myyntipistettä 50 eri maassa. Se on yksi harvoista suklaatehtaista, joka valmistaa suklaan edelleen Belgiassa. Belgian kuninkaallisen hovin virallisena toimittajana, Neuhaus juhlii “praliinin” 100:nnetta vuosipäivää.</p></div></div></li></ul>','Neuhausin Historiaa','Neuhausin Historiaa','Neuhausin Historiaa','neuhaus'),(2,'From bean to chocolate','<div class=\'static_page history\'>\r\n\r\n    <ul>\r\n        <li class=\'clearfix\'>\r\n            <img src=\"../history/stage1.png\" alt=\'The origin\'><div><p class=\'period\'>Stage 1</p><h2>The origin</h2>\r\n            <p>The cocoa tree grows in tropical regions.There are 3 main varieties: Forastero, which is the most widespread variety and which yields a plain, slightly bitter cocoa. Criollo, which is the most delicate and which yields a particularly fine and sophisticated cocoa.  Trinitario, which yields a cocoa that is both plain and fine.</p></div></li>\r\n\r\n        <li class=\'clearfix\'>\r\n            <img src=\"../history/stage2.png\" alt=\'Harvest\'><div><p class=\'period\'>Stage 2</p><h2>Harvest</h2>\r\n            <p>The cocoa tree grows in tropical regions.There are 3 main varieties: Forastero, which is the most widespread variety and which yields a plain, slightly bitter cocoa. Criollo, which is the most delicate and which yields a particularly fine and sophisticated cocoa.  Trinitario, which yields a cocoa that is both plain and fine.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n    <img src=\"../history/stage3.png\" alt=\'Roasting\'><div><p class=\'period\'>Stage 3</p><h2>Roasting</h2>\r\n    <p>Like coffee, the flavour of cocoa beans develops only after roasting.  The beans areroasted, with the temperature and length of roasting determining the final flavour.  The beans are then milled to form a cocoa paste or mass.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n    <img src=\"../history/stage4.png\" alt=\'Conching\'><div><p class=\'period\'>Stage 4</p><h2>Conching</h2>\r\n    <p>Chocolate is made by adding sugar, cocoa butter and lastly milk to the cocoa mass.  This mixture is then milled again and mixed for a long time to produce a chocolate that is smooth and homogeneous.  This process is called conching.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n    <img src=\"../history/stage5.png\" alt=\'Cocoa powder & butter\'><div><p class=\'period\'>Stage 5</p><h2>Cocoa powder & butter</h2>\r\n    <p>Both cocoa butter and cocoa powder are derived from cocoa mass.  The mass is pressed and filtered to separate the liquid from the solids.  The liquid part becomes cocoa butter, and the solids are milled to yield cocoa powder.</p></div></li>\r\n</ul></div>','from-bean-to-chocolate','2013-06-12 11:40:26','2013-06-18 22:50:12',1,0,'',1,1,'From bean to chocolate','From bean to chocolate','',0,'From bean to chocolate',0,'Pavusta Suklaaksi','<div class=\'static_page history\'>\r\n\r\n    <ul>\r\n        <li class=\'clearfix\'>\r\n            <img src=\"../history/stage1.png\" alt=\'Alkuperä\'><div><p class=\'period\'>Vaihe 1</p><h2>Alkuperä</h2>\r\n            <p>Kaakaopuut kasvavat trooppisilla alueilla. On olemassa kolme päälajiketta: Forastero, joka on kaikista laajimmalle levinnyt lajike ja josta saadaan tavallista, hieman kitkerää kaakaota. Criollo, joka on kaikista herkullisin ja josta tuotetaan erittäin hienostunutta ja vaateliasta makua tyydyttävää kaakaota. Trinitario, on kahden edellisen lajikkeen risteytys, joten siitä saadaan kaakaota, joka on pelkistettyä, mutta hienoa ja korkealaatuista.</p></div></li>\r\n\r\n        <li class=\'clearfix\'>\r\n            <img src=\"../history/stage2.png\" alt=\'Sadonkorjuu\'><div><p class=\'period\'>Vaihe 2</p><h2>Sadonkorjuu</h2>\r\n            <p>Palkojen korjuu tapahtuu kahdesti vuodessa. Välittömästi palkojen keräämisen jälkeen, niiden siemenet poistetaan käsin menetelmällä nimeltä \"ecabossage\", jossa palko halkaistaan erityistä puista nuijaa apuna käyttäen. Tämän jälkeen siemenet käyvät läpi fermentoinnin ja sen jälkeen 1-2 viikkoa kestävän kuivauksen. Tästä eteenpäin siemeniä kutsutaan kaakaopavuiksi.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n    <img src=\"../history/stage3.png\" alt=\'Paahto\'><div><p class=\'period\'>Vaihe 3</p><h2>Paahto</h2>\r\n    <p>Kaakaopavut ovat kuin kahvipapuja, sillä niiden maku kehittyy vasta paahtamisen jälkeen. Papujen maun määrittelee se kuinka kauan ja missä lämpötilassa niitä paahdetaan. Tämän jälkeen pavut jauhetaan, jotta voidaan muodostaa kaakaotahnaa tai -massaa.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n    <img src=\"../history/stage4.png\" alt=\'Skonssaus\'><div><p class=\'period\'>Vaihe 4</p><h2>Skonssaus</h2>\r\n    <p>Suklaa valmistetaan lisäämällä kaakaomassaan sokeria, kaakaovoita ja lopuksi maitoa. Tämän jälkeen massa jauhetaan uudestaan ja sitä sekoitetaan pitkään, kunnes suklaa on pehmeää ja koostumukseltaan tasaista. Tämä menetelmä kulkee nimellä “skonssaus”.</p></div></li>\r\n\r\n<li class=\'clearfix\'>\r\n    <img src=\"../history/stage5.png\" alt=\'Kaakaojauhe ja kaakaovoi\'><div><p class=\'period\'>Vaihe 5</p><h2>Kaakaojauhe ja kaakaovoi</h2>\r\n    <p>Sekä kaakaojauhe että kaakaovoi saadaan kaakaomassasta. Massaa puristetaan ja suodatetaan nesteen erottamiseksi kiintoaineesta. Nestemäisestä osasta muodostuu kaakaovoita ja kiintoaineesta jauhetaan kaakaojauhetta.</p></div></li>\r\n</ul></div>','Pavusta Suklaaksi','Pavusta Suklaaksi','Pavusta Suklaaksi','neuhaus'),(3,'Chocolate Glossary','<div class=\'static_page glossary\'><h1>Neuhaus chocolates have a wide variety of fillings and flavours.</h1>\r\n<h2>Buttercream</h2>\r\n<p>A filling compromising a subtle blend of butter and natural flavourings mixed to give a fine, light mousse.</p>\r\n\r\n<h2>Caramel</h2>\r\n<p>Caramel is a mixture produced when granulated sugar is cooked until it melts and becomes a thick, clear liquid that can range in colour from golden to deep brown.</p>\r\n\r\n<h2>Fondant sugar</h2>\r\n<p>A blend of sugar and natural flavours, beaten together to give a really creamy texture, ready to be used in a praline.</p>\r\n\r\n<h2>Ganache</h2>\r\n<p>A filling created by mixing chocolate with milk or cream. It is characterized by a smooth texture with a strong cacao flavour (depending on the percentage of milk or cream). Natural flavours can be added such as caramel, liquor, coffee, fruit or any other taste that has inspired the chocolatier.</p>\r\n\r\n<h2>Gianduja</h2>\r\n<p>A smooth mixture made with hazelnuts and milk or dark chocolate. The difference between a praline filling and gianduja filling lies in the proportion of hazelnuts used in the recipe. Gianduja fillings are made with a minimum of 20% hazelnuts, while it could be less for a praline filling. The milk chocolate which is added to the mixture gives the blend a  pronounced refinement and an incomparably smooth character.</p>\r\n\r\n<h2>Marsipaani</h2>\r\n<p>A filling made out of a blend of finely-ground almonds and sugar, slowly ground together and can then be coated in chocolate. For its marzipan, Neuhaus uses a minimum of 50% almonds from Faro in Portugal, a region renowned for its high quality almonds.</p>\r\n\r\n<h2>Mousse</h2>\r\n<p>A blend of butter and real chocolate, whipped together to produce a light frothy filling.</p>\r\n\r\n<h2>Krokantti</h2>\r\n<p>A hard biscuit with irrestible flavour. This delicacy is made of sugar and hazelnuts, with a taste of caramel. This is the essential ingredient of the jewels of Neuhaus “Irrésistibles”: Tentation, Caprice, Désir, Plaisir and Séduction.</p>\r\n\r\n<h2>Praliini</h2>\r\n<p>Not to be confused with the French words “praline”, which means chocolate. Praliné is a filling made out of ground, roasted, caramelised hazelnuts and/or almonds with sugar. Chocolate may sometimes be added for the texture. The Neuhaus range includes 20 different pralinés.</p>\r\n\r\n<h2>Tryffeli</h2>\r\n<p>A smooth mixture of chocolate, butter and sugar, drenched in dark chocolate and sprinkled with cocoa, flakes of chocolate or almond shavings. Irregular in shape but generally round, these small temples of sensual pleasure come in a wide variety: coffee, cognac, speculoos, Marc de Champagne or other rich flavours.</p>\r\n</div>','glossary','2013-06-12 14:27:39','2013-06-18 22:50:40',1,0,'',2,1,'Chocolate Glossary','Chocolate Glossary','',0,'Chocolate Glossary',0,'Suklaasanasto','<div class=\'static_page glossary\'><h1>Neuhausin suklaissa on laaja valikoima täytteitä ja makuja.</h1>\r\n<h2>Kreemi</h2>\r\n<p>Täyte, jossa hienostuneesti yhdistyvät voi ja luonnolliset maut muodostaen hienon ja kevyen vaahdon (moussen).</p>\r\n\r\n<h2>Karamelli</h2>\r\n<p>Karamelli on sekoitus, joka syntyy kun kidesokeria keitetään, kunnes se sulaa ja muuttuu paksuksi kirkkaaksi nesteeksi, joka voi väriltään olla kultaisesta syvään ruskeaan.</p>\r\n\r\n<h2>Konvehtisokeri</h2>\r\n<p>Sokerin ja luonnollisten makujen sekoitus, joka vispataan kuohkeaksi ja käytetään sitten konvehtien täytteenä.</p>\r\n\r\n<h2>Ganache</h2>\r\n<p>Täyte, joka valmistetaan sekoittamalla suklaata maidon tai kerman kanssa. Se on koostumukseltaan pehmeää ja vahvasti suklaan makuista (riippuen maidon tai kerman prosentuaalisesta määrästä). Täytteeseen on voitu lisätä luonnollisia makuja, kuten karamellia, likööriä, kahvia, hedelmää tai jotain muuta makua, joka on inspiroinut suklaamestaria.</p>\r\n\r\n<h2>Gianduja</h2>\r\n<p>Sileä, paahdetuista hasselpähkinöistä ja maidosta tai suklaasta valmistettu tahna. Tavallisen konvehtitäytteen ja Giandujan ero on siinä kuinka paljon hasselpähkinää resepti sisältää. Giandujassa on vähintään 20% hasselpähkinää, kun taas konvehtitäytteessä voi olla vähemmänkin. Maitosuklaa, joka lisätään seokseen, antaa sille hienostuneen ja vertaansa vailla olevan pehmeän luonteen.</p>\r\n\r\n<h2>Marsipaani</h2>\r\n<p>Täyte, joka valmistetaan jauhamalla sokeria ja hienoksi jauhettuja manteleita sekaisin, jonka jälkeen sitä voidaan päällystää suklaalla. Neuhaus käyttää marsipaaniinsa vähintään 50% portugalilaisia manteleita, jotka tulevat Farosta; alueelta, joka on tunnettu korkealaatuisista manteleistaan.  </p>\r\n\r\n<h2>Mousse</h2>\r\n<p>Sekoitus voita ja suklaata, jotka vatkataan vaahdoksi, jolloin saadaan aikaan kevyt ja kuohkea täyte.</p>\r\n\r\n<h2>Krokantti</h2>\r\n<p>Kova keksi, jossa on vastustamaton maku. Tämä herkku on valmistettu sokerista ja hasselpähkinöistä ja se maistuu karamellille.  Krokantti on olennainen ainesosa Neuhausin helmissä “Irrésistibles”: Tentation, Caprice, Désir, Plaisir ja Séduction.</p>\r\n\r\n<h2>Praliini</h2>\r\n<p>Ei tule sekoittaa ranskalaiseen sanaan “praline”, joka tarkoittaa suklaata/konvehtia. Praliini on täyte, joka valmistetaan jauhetuista, paahdetuista ja karamellisoiduista hasselpähkinöistä ja/tai manteleista sokerin kanssa. Suklaata saatetaan joskus lisätä koostumukseen. Neuhausilla on valikoimissaan 20 erilaista praliinia.</p>\r\n\r\n<h2>Tryffeli</h2>\r\n<p>Pehmeä sekoitus suklaata, voita ja sokeria, uitettuna tummassa suklaassa ja pyöriteltynä kaakaojauheessa, kaakaohiutaleissa tai mantelilastuissa. Muoto vaihtelee, mutta yleensä ne ovat pyöreitä. Nämä pienet makunystyröiden innoittajat ovat saatavilla useissa eri mauissa: kahvi, konjakki, murokeksi, Marc de Champagne ja muissa täyteläisissä mauissa. </p>\r\n</div>','Suklaasanasto','Suklaasanasto','Suklaasanasto','neuhaus'),(4,'General Terms of Sale','<div class=\'static_page terms\'>\r\r<h2>1. The scope of current Terms and Conditions.</h2>\n<p>1.1. Current website www.neuhaus.fi is managed by Andieva Oy and established in Unioninkatu 32, 00810 Helsinki, Finland, named hereafter “Neuhaus” or “Seller”. </p>\r<p>1.2. The Terms and Conditions (“Terms”) contained herein shall apply to all orders placed via current Website. Acceptance of Buyer’s order by Neuhaus is conditioned upon Buyer’s acceptance of the current terms and conditions.</p>\r<p>1.3. At the end of the ordering process via current Website, the Buyer is required to consent to the present Terms.</p>\r<p>1.4. Neuhaus reserves the right to change or adapt the present Terms at any moment.  Changes will apply only to the future orders, which were placed by the Buyer after the respective changes were done.</p>\r<h2>2.  Buyer.</h2>\r<p>2.1. The Buyer confirms to be at least 18 (eighteen) years old at the moment of purchase order’s placement through current website. If this is not the case, the Buyer shall place an order solely under the supervision and with the approval of his parents or guardians.</p>\r<p>2.2. Neuhaus reserves the right (at its sole discretion) to terminate the purchase agreement unilaterally if it becomes obviously clear or this could be reasonably assumed by Neuhaus that the Buyer is under 18 (eighteen) years old.</p>\r<h2>3. Placing of the order, purchase agreement, payment.</h2>\r<p>3.1. The description of the products in online shop of current website constitutes an invitation for a Buyer to submit an offer, not a binding contractual offer whatsoever.</p>\r<p>3.2. The prices of Neuhaus Products are those which are indicated indicated in the online-shop of current website. The indicated prices of the Products do not include delivery costs. Upon the completion of the order, the respective delivery cost for the order in question will be stated for the Buyer. The delivery costs will be added to the total price of the order respectively.</p>\r<p>3.3. Neuhaus reserves the right to change the prices at any time, provided that the respective changes will be applicable solely for the orders which were yet not paid by the Buyer.</p>\r<p>3.4.   The Buyer might select products from the range available at online shop of current website and place them in a shopping basket using the respective option on the current website. During the placement of the order, the Buyer will be required to provide the data which is necessary for performance and processing of the order (such data might include but not limited to: Buyer’s name, delivery address, contact details, etc).  The information needed for performance and processing of the order must be indicated by the Buyer in a full and correct manner.</p>\r<p>3.5. As soon as the Buyer sends an order to Neuhaus via current website, the Buyer is automatically making a binding offer to purchase the goods included in the placed order.</p>\r<p>3.6. As soon as the order was completed, the Buyer is required to fulfill the payment for the order in question, using one of the payments methods available. In the circumstances where the Buyer uses his credit card for payment, Neuhaus shall not be a party in the relationship between the Buyer and credit card’s issuer.</p>\r<p>3.7. As soon as the payment for the completed order was received by Neuhaus, confirmatory e-mail will be sent to the Buyer (to the e-mail address indicated by the Buyer while placing the order). As soon as the confirmation of the purchased goods was sent to the Buyer, the purchase agreement shall be deemed to be concluded between Neuhaus and the Buyer.</p>\r<p>3.8. The Buyer has a right to cancel the order, providing that the cancelation takes place before the products’ shipping.</p>\r<p>3.9. As soon as shipping of the Products in question took place, the Buyer has no right to cancel the order. However, in the circumstances where the agreement of the order’s cancellation was reached between the parties after Products’ shipping, the cancellation of the order shall take place solely on the basis of the Buyer’s consent to indemnify the Seller with all losses incurred by the Seller as a result of such cancellation.</p>\n<p>3.10. In the circumstances where Neuhaus is unable to deliver the goods due to the fact that suppliers of Neuhaus fail to perform their contractual obligations, Neuhaus has a right to withdraw from the agreement with the Buyer. In this situation Neuhaus has an obligation to refund to the Buyer any payments already made by the latter;  the Buyer shall have no further claims to the Seller.</p>\r<p>3.11. Neuhaus\' total liability for breach shall not exceed the total value of the purchased goods.</p>\r<h2>4. Price.</h2>\r<p>4.1. The prices of the Products on the current website are indicated in Euros including VAT.</p>\r<p>4.2. Prices do not include shipping costs. Shipping costs will be indicated separately while placing the order via current website (see Art. 3.2 above).</p>\r<p>4.3. Once the payment for the Products was received to Neuhaus’ account, property right of the paid Products shall be considered as passed to the Buyer.</p>\r<h2>5.  Shipping and Delivery Times.</h2>\r<p>5.1. The products will be delivered as illustrated in the online shop on the current website; however the right to make minor changes in packaging is reserved by Neuhaus. </p>\r<p>5.2. Neuhaus provides delivery services solely within Finland.</p>\r<p>5.3. Neuhaus does everything possible to ensure shipping within 3 (three) business days counting from the date of the payment’s (for the order in question) receipt. Unless agreed upon otherwise, the maximum delivery time is 14 (fourteen) business days counting from the date of the order’s placement. Neuhaus shall contact the Buyer within 3 (three) business days by telephone or e-mail in order to inform the latter of any delays if such delays take place.</p>\r<p>5.4. In case of temporary absence of the Products, ordered by the Buyer, Neuhaus shall notify the Buyer regarding such absence respectively. In these circumstances the parties might agree to proceed in accordance with one of the following options:</p>\r<ol><li>Neuhas might suggest a distant shipping date for the ordered products (determination of shipping date depends on the dates of future availability of the required products in stock of Neuhaus);</li>\r<li>Neuhaus might offer similar products (with the same value as was paid by the Buyer for the ordered products which are out of stock) for shipping;</li>\r<li>In the circumstances where (I) neither of the options, stated in the Art. 5.4.1 & 5.4.2 above, suits the Buyer, or (II) suppliers of Neuhaus fail to perform their contractual obligations, what will generate major delays in products’ delivery, Neuhaus will provide a full refund to the Buyer which will cover the value of the paid ordered goods and paid shipping costs. The Buyer shall have no further claims.</li></ol>\r<p>5.5. Deliveries will be made to the address indicated by the Buyer in the order.</p>\r<p>5.6. Risk and liability over delivered goods is transferred to the Buyer at the moments of the goods’ delivery to the address provided by the Buyer.  For the purposes of this article, risk and liability means responsibility for damage which occurs to the product as a result of its storage.</p>\r<p>5.7. Delivery of the ordered goods will be done by the means of Finnish post.</p>\r<p>5.8. Neuhaus shall not have any responsibilities for failed deliveries in the situations where the Buyer provides an incorrect or outdated delivery address.</p>\r<p>5.9. If the post is forced to return a parcel with the ordered goods back to Neuhaus due to the reason indicated in the Art. 5.8 above, Neuhaus has a right to rescind the purchase agreement immediately  and suspend any future deliveries to the Buyer. In the circumstances of parcel’s return described in the current article, the goods’ price already paid will be refunded to the Buyer, provided that the goods were not manufactured according to Buyer\'s specifications, in which case no refund will be made. It should be noted that under the failed deliveries the Buyer shall be responsible for the payment of:</p>\r<ol><li>shipping costs (from Neuhaus to the Buyer and back to Neuhaus) which arose from failed deliveries;</li>\r<li>the return and cancellation fee in the amount of 25 Euros;</li></ol>\r<p>any further damages which Neuhaus could claim under failed deliveries.</p>\rNeuhaus might reship the goods to a new address at the Buyer’s request on the conditions that the Buyer agrees to pay the shipping costs arising under the second delivery and if he provided a corrected/new delivery address within 1 business day counting from the date of goods arrival to Nauhaus due to failed delivery.</p>\r<p>5.10. Neuhaus does not provide deliveries to PO Box addresses or military addresses.  If the Buyer has stated a military/PO address as the address for the order’s delivery, Neuhaus has a right to rescind the purchase agreement with the Buyer immediately and suspend any future deliveries. The goods’ price and shipping costs already paid will be refunded to the Buyer.</p>\r<p>5.11. Neuhaus does its best to ensure appropriate and safe delivery of the ordered Products; however it can give no absolute guarantee on the transport quality.</p>\r<p>5.12. The Buyer shall inspect all goods immediately upon delivery. Any complaints concerning defects to the goods or delivery shortcomings shall be notified by the Buyer (per e-mail) to Neuhaus no later than within 36 (thirty six) hours after delivery.</p>\r<p>5.13. In the circumstances where Neuhaus  delivered  the products, different from the Products ordered by the Buyer (wrong delivery), or delivery did not contain all ordered Products (incomplete delivery), the Buyer  shall notify Neuhaus immediately. The parties shall agree that Neuhaus:</p>\r<ol><li>will send the remaining ordered products in case of incomplete delivery, provided that Neuhaus bears the costs for the second delivery;</li>\r<li>will send the respective ordered products to the Buyer in case of wrong delivery, provided that the Buyer will send the wrong delivered products back to Neuhaus. All additional shipping costs which arose from wrong delivery will be borne by Neuhaus.</li></ol>\r<p>Neuhaus\' total liability for breach shall not exceed the total value of the purchased goods.</p>\n<h2>6. Intellectual Property.</h2>\r<p>6.1. The Buyer acknowledges and accepts that all intellectual property rights on published information, statements or other communication regarding the goods and/or the Website are and remain property of Neuhaus and its suppliers or third-party right holders.</p>\r<p>6.2. Intellectual property rights include amongst others patents, copyrights, trademark, drawings and models and/or any other (intellectual property) rights, including technical and/or commercial know-how, methods and concepts, even if these are not subject to patent protection.</p>\r<p>6.3. The Buyer shall not use and/or change any of the intellectual property rights as described in the present article, including reproduction without prior authorization by Neuhaus, its suppliers or third-party right holders, other than for private use of the goods themselves.</p>\r\r<h2>7. Force majeure.</h2>\r<p>7.1. Neuhaus shall not be liable for any breach of its obligations, or for delay in shipping / failure to give notice of delay for the duration of the state of Force Majeure. The state of Force Majeure includes, however not limited to the following events: acts of God, act of civil or military authority, war, riots, strikes, weather conditions, disruption of energy supplies/website or any other causes beyond the reasonable control of Neuhaus.</p>\r<h2>8. Governing Law.</h2>\r<p>8.1. Any dispute arising under or in connection with current Terms shall be governed by and construed in all respects in accordance with Finnish law and the parties hereby submit to jurisdiction of Finish courts.\rThe application of the international sale of Goods treaty (Vienna Convention) is explicitly excluded.</p>\r<h2>9. Means of communication between the parties.</h2>\r<p>9.1. The parties have agreed that communication between them will be realized in written by the means of electronic systems. The contact e-mail of the Buyer shall be considered the one which was indicated at the moment of Buyer’s registration on the current web-site/placement of the order.</p>\r<p>9.2. The contact address of Neuhaus which shall be used by the Buyer for all notifications is the following: neuhaus@neuhaus.fi</p>\r\r\n<h2>10. Maksuturva service</h2>\n<p>The payment processes between vendors and consumers are managed by Suomen Maksuturva Ltd (Company registration number 2121703-0). The company cooperates with banks and credit institutions. You as a consumer are not required to register or pay extra costs for using the payment service. The vendor will be informed instantly after a successful payment, and you will receive a confirmation email from Maksuturva. This email includes a link to Buyer’s Service webpage, where you can use the functions of the Satisfaction Guarantee: if necessary, you can return products, make a reclamation or give feedback 24/7 through this service.<br />\n<br />\nThe operations of Suomen Maksuturva Ltd are controlled by the Financial supervisory Authority (FIN-FSA ).  All data transfer and money transactions are SSL secured meaning that no external party can see your personal information. Your payment will not be transferred to the vendor before you have received and had a chance to inspect the order. You will be informed of the order-specific inspection time by email.<br />\n<strong><a href=\"https://www.maksuturva.fi/en/for-consumers/\">Read more about using the Maksuturva Service »</a></strong></p>\n<h3>Payment methods</h3>\n<p><strong>Online bank payment method of the following banks:</strong><br />\nNordea Bank<br />\nCooperative bank (osuuspankki)<br />\nDanske Bank<br />\nAktia<br />\nSavings Bank<br />\nPOP Bank<br />\nHandelsbanken<br />\nÅlandsbanken<br />\nTapiola Bank<br />\nS-Bank</p>\n<p><strong>Payment by Invoice</strong><br />\nSveaWebPay (hereinafter Svea) offers you a chance to buy purchases against invoice with 14 days to pay. Please note the following points:</p>\n<p>The internet dealer is responsible for any invoicing charge.<br />\nWhen you choice invoice as the choice for payment, we will check your credit rating with your social security number.<br />\nDeliveries of purchases are made to the address in the Population Register. In the event that TUPAS recognition was possible at the time of payment, and recognition was successful, a purchase may be delivered to an address other than the one in the Population Register. Terms of payment are 14 days. Interest on arrears is 7% + reference interest as per the Interest Act. We charge 5 euros for a reminder.<br />\nThe buyer must be at least 18 years of age.</p>\n<p><strong>Payment by Partial payment/Installment</strong><br />\nSveaWebPay (hereinafter Svea) offers you an opportunity to pay for purchases in installments. This will be possible when you have accepted the terms of credit and filled in your social security number on the payment page. If you sign the installment contract electronically with TUPAS recognition, you can save or print out the contract for yourself immediately. In the event that you do not sign the installment contract electronically, you will receive an installment/account credit agreement with terms at your home address, which you should sign and send back to Svea within 8 days. In the event that the contract is not sent back to us within that time, the entire purchase will fall due for payment in one installment during the following month. Svea will invoice you for interest and any other charges between the delivery date and the invoicing period according to the terms of contract.</p>\n<p>As an installment/account credit customer, you can make purchases from Svea’s contractual customers on your account. You can make purchases whenever you are within your credit limit and you can pay for purchases in installments in accordance with the terms of the credit agreement. The credit limit is the sum specified in the installment/account credit agreement. You can select the credit period which suits you best. Credit must be dealt with during the credit period. This requires that you pay at least the agreed amount monthly. Naturally you can also pay off the entire credit at one without extra charges.</p>\n<p>In the event that you wish to use your account also to make other purchases during the contractual period but the payment period for your credit has already been selected for maximum length, you should increase the amount of your monthly part payment. Similarly, if you wish to extend your payment period, you can reduce your monthly part payment. In the event that you buy from more than one webshop on your account, you will get a separate invoice for all your purchases. In spite of this, we will bill you only one account management fee per month.</p>\n<p>In the event that payments are not made and we have not been contacted to arrange for payment, we will pass our receivable to Svea Perintä Oy for collection.</p>\n<p>For more detailed terms see: <a href=\"http://www.sveawebpay.fi/kontovillkor/\">http://www.sveawebpay.fi/kontovillkor/</a></p>\n<p>You can also get more information in our account credit agreement, which you will find on our website <a href=\"http://www.sveawebpay.fi\">http://www.sveawebpay.fi</a>.</p>\n<p><strong>Contact information:</strong><br />\nSuomen Maksuturva Oy<br />\nBusiness ID: 2121703-0<br />\nRuoholahdenkatu 23<br />\n00180 HELSINKI<br />\nTel. (09) 42 41 7040, workdays between 8.30 a.m. and 5 p.m.<br />\nE-mail: asiakaspalvelu(a)maksuturva.fi<br />\n<a href=\"https://www.maksuturva.fi\">www.maksuturva.fi</a><br />\n\r\r\n</div>','terms-and-conditions','2013-06-17 21:55:13','2013-06-18 22:51:00',1,0,'',3,1,'General Terms of Sale','General Terms of Sale','',0,'General Terms of Sale',0,'Yleiset myyntiehdot','<div class=\'static_page terms\'>\r\r<h2>1. Katsaus nykyisiin toimintaehtoihin</h2>\n<p>1.1. Nykyistä verkkosivua www.neuhaus.fi hallinnoi yritys nimeltä Andieva Oy, joka sijaitsee osoitteessa Unioninkatu 32, 00810 Helsinki, Finland, ja jota kutsumme tästedes nimellä “Neuhaus” tai ”myyjä”.</p>\r<p>1.2. Tässä lueteltuja ehtoja tullaan soveltamaan kaikkiin verkkosivun kautta tehtyihin tilauksiin. Neuhausin ehtojen hyväksyminen on edellytys ostajan tilauksen hyväksymiselle.</p>\r<p>1.3. Verkkosivun kautta tehdyn tilauksen teon loppuvaiheessa ostajaa pyydetään hyväksymään nykyiset ehdot. </p>\r<p>1.4. Neuhaus pidättää oikeuden muuttaa näitä sopimusehtoja yksipuolisella päätöksellä ilman ennakkoilmoitusta. Muutokset pätevät tuleviin tilauksiin, jotka on tehty muutosten teon jälkeen.</p>\r\r<h2>2. Ostaja</h2>\r<p>2.1. Ostaja vahvistaa olevansa vähintään 18 (kahdeksantoista) vuotta vanha tilauksen tekohetkellä. Jos näin ei ole, ostajan tulee tehdä tilaus vanhempansa tai holhoojansa luvalla ja valvonnassa.</p>\r<p>2.2. Neuhaus pidättää itsellään oikeuden (oman harkintansa mukaan) purkaa ostosopimuksen yksipuolisesti jos on ilmeisen selvää tai voidaan olettaa, että ostaja on alle 18 (kahdeksantoista) vuotta vanha.</p>\r\r<h2>3. Tilauksen tekeminen, ostosopimus ja maksu</h2>\r<p>3.1. Verkkokaupan tuotekuvaukset kutsuvat ostajaa tekemään tilauksen, joka ei kuitenkaan ole vielä sitova ostotarjous.</p>\r<p>3.2. Neuhausin tuotteiden tämänhetkiset hinnat löytyvät verkkokaupasta neuhaus.fi. Tuotteiden ilmoitetut hinnat eivät sisällä toimituskuluja. Toimituskulut ilmoitetaan ostajalle kyseisen tilauksen teon loppuvaiheessa. Toimituskulut lisätään jokaisen tilauksen loppusummaan erikseen.</p>\r<p>3.3. Neuhaus pidättää itsellään oikeuden muuttaa tuotteiden hintoja milloin tahansa, edellyttäen, että kyseiset muutokset tulevat voimaan uusiin tilauksiin, joita ei ole vielä maksettu.</p>\r<p>3.4.   Ostaja voi valita tuotteita verkkokaupan nykyisestä valikoimasta ja lisätä niitä ostoskoriinsa käyttäen siihen tarkoitettua toimintoa. Tilausta tehdessä ostajan tulee antaa tilauksen käsittelyssä tarvittavat tiedot (tällaisia tietoja ovat mm: ostajan nimi, toimitusosoite, yhteystiedot, jne).  Tilauksen käsittelyä varten tarvittavat tiedot tulee ilmoittaa kokonaisuudessaan ja oikein.</p>\r<p>3.5. Kun ostaja lähettää tilauksensa Neuhausille verkkokaupan kautta, hän on automaattisesti tehnyt sitovan sopimuksen ostaa kyseiseen tilaukseen sisältyvät tuotteet.</p>\r<p>3.6. Kun tilaus on valmis, ostajaa pyydetään maksamaan kyseinen tilaus käyttämällä yhtä käytössä olevista maksuvaihtoehdoista. Tilanteessa, jossa ostaja maksaa tilauksen luottokortilla, Neuhaus ei ole osallisena ostajan ja luottokortin myöntäjän välillä. </p>\r<p>3.7. Kun Neuhaus vastaanottaa maksun valmiista tilauksesta, ostajalle lähetetään vahvistus sähköpostitse (sähköpostiosoitteeseen, jonka ostaja on ilmoittanut tilauksen yhteydessä). Sen jälkeen kun vahvistus maksetuista tuotteista on lähetetty ostajalle, katsotaan ostosopimuksen Neuhausin ja ostajan välillä päättyneen. \r<p>3.8. Ostajalla on oikeus perua tilauksensa edellyttäen, että tilauksen peruutus tapahtuu ennen kuin tuotteita on ehditty lähettämään ostajalle. </p>\r<p>3.9. Kun kyseiset tuotteet on toimitettu, ostajalla ei ole enää oikeutta perua tilausta. Tilanteessa, jossa tilauksen peruutus on tehty tuotteiden toimituksen jälkeen, voidaan peruutus toteuttaa vain ostajan suostuessa korvaamaan myyjälle kaikki kulut, jotka kyseisestä peruutuksesta aiheutuu.  </p>\r<p>3.10. Tilanteessa, jossa Neuhaus ei pysty toimittamaan tuotteita johtuen siitä, ettei Neuhausin toimittajat täytä sopimusvelvoitteitaan, Neuhausilla on oikeus peruuttaa sopimus ostajan kanssa. Tällaisessa tilanteessa Neuhausilla on velvollisuus palauttaa ostajalle tuotteista maksettu summa, jonka jälkeen ostajalla ei ole enää mitään vaatimuksia myyjälle.</p>\n<p>3.11. Neuhausin kokonaisvastuu sopimusrikkomuksesta ei ylitä ostettujen tuotteiden kokonaisarvoa.</p>\r\r<h2>4.  Hinta</h2>\r<p>4.1. Nykyisellä verkkosivulla olevien tuotteiden hinnat on ilmoitettu euroissa ja ne sisältävät arvonlisäveron. </p>\r<p>4.2. Hinnat eivät sisällä lähetyskuluja. Lähetyskulut ilmoitetaan erikseen tilauksen teon yhteydessä (kts. kohta 3.2). </p>\r<p>4.3. Kun maksu tilauksesta on vastaanotettu Neuhausin tilille, katsotaan omistusoikeuden maksetuista tuotteista siirtyneen ostajalle. </p>\n\n<h2>5. Toimitusehdot</h2>\r<p>5.1. Tuotteet toimitetaan, kuten verkkokaupan sivulla on esitetty. Neuhaus pidättää kuitenkin oikeuden tehdä pieniä muutoksia pakkauksiin.</p>\r<p>5.2. Neuhaus tarjoaa postituspalvelun ainoastaan Suomeen.</p>\r<p>5.3. Neuhaus tekee kaikkensa varmistaakseen toimituksen 3 (kolmen) työpäivän sisällä, laskien päivästä jolloin tilauksen maksu on vastaanotettu. Ellei ole toisin sovittu, pisin mahdollinen toimitusaika on 14 (neljätoista) työpäivää, laskien päivästä jolloin tilaus on tehty. Neuhaus ottaa yhteyttä ostajaan 3 (kolmen) työpäivän sisällä joko puhelimitse tai sähköpostilla jos tilauksen toimituksessa on odotettavissa viivästyksiä. </p>\r<p>5.4. Jos ostajan tilaama tuote on päässyt tilapäisesti loppumaan, Neuhaus ilmoittaa asiasta ostajalle erikseen. Tämänkaltaisessa tilanteessa osapuolet voivat sopia jatkotoimenpiteistä:</p>\r<ul><li>Neuhaus voi ehdottaa myöhäisempää toimituspäivää puuttuville tuotteille (toimituspäivän määrittämiseen vaikuttaa se milloin tuote on taas saatavilla);</li>\r<li>Neuhaus voi tarjota puuttuvien tuotteiden tilalle samankaltaisia tuotteita (samanhintaisia kuin ostajan maksamat tuotteet);</li>\r<li>Tilanteessa, jossa (I) kumpikaan vaihtoehto (kohdassa 5.4.1 & 5.4.2) ei sovi ostajalle tai   (II) Neuhausin toimittajat  eivät täytä sopimusvelvoitteitaan, joka johtaa pitkiin viivästyksiin tuotteiden toimittamisessa, Neuhaus antaa täyden hyvityksen ostajalle tilatuista tuotteista ja toimituskuluista. Ostajalla ei ole muita saamisia.</li></ul>\r<p>5.5. Toimitukset tehdään osoitteeseen, jonka ostaja on tilauksen yhteydessä ilmoittanut. </p>\r<p>5.6. Vastuu toimitetuista tuotteista siirtyy ostajalle hetkellä, jolloin tuotteet on toimitettu ostajan ilmoittamaan osoitteeseen. Tämä sopimuksen osa viittaa vastuuseen tuotteisiin tulleista vaurioista, jotka ilmaantuvat tuotteeseen virheellisen säilytyksen/varastoinnin johdosta.</p>\r<p>5.7. Tilatut tuotteet toimitetaan Suomen postin kautta.</p>\r<p>5.8. Neuhaus ei ole vastuussa epäonnistuneista toimituksista, jotka johtuvat ostajan ilmoittamasta vanhasta tai virheellisestä osoitetiedosta.</p>\r<p>5.9. Jos posti joutuu palauttamaan paketin Neuhausille edellisessä kohdassa (5.8.) viitatun syyn takia, Neuhausilla on oikeus purkaa ostosopimus välittömästi ja kieltäytyä jatkossa ottamasta uusia tilauksia vastaan kyseiseltä ostajalta. Tilanteessa, jossa paketti palautuu Neuhausille, ostajalle palautetaan tuotteista maksettu summa, paitsi jos tuotteet on valmistettu ostajan erityistoiveiden mukaan, jolloin palautusta ei tehdä. On hyvä huomioida, että epäonnistuneissa lähetyksissä ostaja on velvollinen maksamaan: </p>\r<ul><li>toimituskulut (Neuhausilta ostajalle ja takaisin Neuhausille), jotka muodostuivat epäonnistuneesta toimituksesta;</li>\r<li>25 euron suuruisen palautus- ja peruutusmaksun;</li>\r<li>muut vahingot, jotka ovat aiheutuneet epäonnistuneen toimituksen johdosta.</li></ul>\r<p>Neuhaus voi lähettää tuotteet uudelleen uuteen osoitteeseen ostajan pyynnöstä jos ostaja suostuu maksamaan toimituskulut ja jos hän toimittaa korjatun/uuden toimitusosoitteen 1 (yhden) työpäivän sisällä tuotteiden palautumisesta Neuhausille.</p>\r<p>5.10. Neuhaus ei toimita tuotteita PL-osoitteisiin tai armeijan osoitteisiin. Jos ostaja on merkannut toimitusosoitteeksi armeijan tai PL-osoitteen,  Neuhausilla on oikeus  purkaa ostosopimus ostajan kanssa välittömästi ja kieltäytyä jatkossa ottamasta uusia tilauksia vastaan kyseiseltä ostajalta. Ostajan maksama tuotteiden yhteishinta ja toimituskulut tullaan palauttamaan ostajalle. </p>\r<p>5.11. Neuhaus tekee parhaansa varmistaakseen sopivan ja turvallisen toimituksen tilatuille tuotteille; kuitenkaan se ei voi antaa täyttä takuuta tuotteiden kuljetuksen laadusta. </p>\r<p>5.12. Ostaja voi tutkia vastaanottamansa tuotteet välittömästi toimituksen yhteydessä. Mahdolliset valitukset koskien tuotteissa tai toimituksessa ilmeneviä vikoja tulee ostajan ilmoittaa sähköpostitse Neuhausille 36 (kolmenkymmenenkuuden) tunnin sisällä toimituksen vastaanottamisesta. </p>\r<p>5.13. Tilanteessa, jossa Neuhaus on toimittanut tilauksesta poikkeavia tuotteita (virheellinen toimitus) tai paketissa ei ole kaikkia tilattuja tuotteita (vajaa toimitus), on ostajan ilmoitettava asiasta välittömästi Neuhausille. Osapuolet voivat sopia, että Neuhaus:</p>\r<ul><li>lähettää puuttuvat tuotteet (kun kyseessä on vajaa toimitus) ja maksaa toisen lähetyksen toimituskulut;</li>\r<li>lähettää oikeat tuotteet ostajalle (kun kyseessä on virheellinen toimitus) ja ostaja lähettää virheellisesti lähetetyt tuotteet takaisin Neuhausille. Neuhaus maksaa kaikki uudelleen lähetettävistä paketeista koituvat toimituskulut. Neuhausin kokonaisvastuu virheen korjauksesta ei tule ylittää ostettujen tuotteiden kokonaisarvoa.</li></ul>\r\r<h2>6. Immateriaalioikeudet</h2>\r<p>6.1. Ostaja ymmärtää ja hyväksyy, että kaikki immateriaalioikeudet julkaistuista tiedoista, lausunnoista ja muusta viestinnästä koskien tuotteita ja/tai sivustoa ovat ja pysyvät Neuhausin, sen toimittajien ja kolmannen osapuolen oikeuksien haltijoilla.</p>\r<p>6.2. Immateriaalioikeudet ovat mm. patentit, tekijänoikeudet, tuotemerkit, piirustukset ja mallit ja/tai muut immateriaalioikeudet, mukaan lukien tekninen ja/tai kaupallinen osaaminen, menetelmät ja käsitteet, vaikka nämä eivät patenttisuojaan kuulukaan.</p>\r<p>6.3. Ostaja ei käytä ja/tai muuta mitään edellä mainituista immateriaalioikeuksista, mukaan lukien kopiointi muuhun kuin henkilökohtaiseen käyttöön ilman Neuhausin, sen toimittajien tai kolmannen osapuolen oikeuksien haltijoiden lupaa.</p>\r\r<h2>7. Ylivoimainen este (Force Majeure)</h2>\r<p>7.1. Neuhaus ei ole vastuussa velvoitteidensa noudattamattomuudesta tai toimituksen myöhästymisestä/viivästyksen ilmoittamatta jättämisestä kun kyseessä on Neuhausin vaikutusmahdollisuuksien ulkopuolella oleva tilanne, ylivoimainen este. Ylivoimainen este voi johtua esimerkiksi: sodasta, luonnonmullistuksesta, vienti- tai tuontikiellosta, viranomaisen päätöksestä, yleisen liikenteen häiriintymisestä tai muusta vastaavasta.</p>\r<h2>8. Sovellettava laki</h2>\r<p>8.1. Tästä etäkauppasopimuksesta aiheutuviin riitoihin ja erimielisyyksiin sovelletaan Suomen lakia.\rKansainvälisen tavarakaupan sopimuksen (Wienin yleissopimus) soveltaminen on poissuljettu. </p>\r\r<h2>9. Osapuolten välinen viestintä</h2>\r<p>9.1. Osapuolet ovat sopineet, että yhteydenotot tapahtuvat kirjallisena elektronisten välineiden avulla. Ostajan sähköpostiosoitteeksi katsotaan rekisteröinnin yhteydessä ilmoitettu sähköpostiosoite.</p>\r<p>9.2. Ostajan tulee käyttää kaikkeen viestintään Neuhausin sähköpostiosoitetta, joka on: neuhaus@neuhaus.fi</p>\r\r\r\n<h2>10. Maksuturva-palvelu</h2>\n<p>Verkkokaupan maksujenvälityksen toteuttaa Suomen Maksuturva Oy (y-tunnus 2121703-0) yhteistyössä pankkien ja luottolaitosten kanssa. Palvelun käyttö ei vaadi rekisteröitymistä tai lisämaksujen suorittamista. Maksusi kirjautuu välittömästi suoritetuksi kauppiaalle ja sähköpostiisi lähetetään vahvistusviesti. Viesti sisältää linkin Ostajan Palvelut  sivulle, jossa voit hoitaa kauppiaan tyytyväisyystakuun avulla mm. tuotepalautukset, reklamaatiot ja palautteenannon ympäri vuorokauden.<br />\nSuomen Maksuturva Oy:n toiminta on Finanssivalvonnan (Fiva) alaista. Kaikki tiedonsiirto ja rahaliikenne on SSL-suojattu, eli kukaan ulkopuolinen voi nähdä tietojasi. Maksusi tilitetään myyjälle vasta, kun olet vastaanottanut tilauksesi ja saanut tarkistaa sen. Tarkastusajoista ilmoitetaan tilauskohtaisesti sähköpostilla.<br />\n<strong><a href=\"https://www.maksuturva.fi/fi/kuluttajille/mika-on-maksuturva/\">Lue lisää Maksuturva-palvelun käytöstä »</a></strong></p>\n<h2>Maksutavat</h2>\n<p><strong>Pankkien verkkomaksupainikkeet</strong></p>\n<p>Käytössäsi on kaikkien suomalaisten pankkien verkkomaksupalvelut.</p>\n<p><strong>Laskulla ostaminen</strong></p>\n<p>SveaWebPay (myöhemmin Svea) tarjoaa sinulle mahdollisuuden ostaa ostokset laskua vastaan 14 päivän maksuajalla. Huomioithan seuraavat asiat:</p>\n<li>Mahdollisesta laskutuslisästä vastaa verkkokauppias.</li>\n<li>Kun valitset maksuvaihtoehdoksi laskun, tarkistamme luottotietosi henkilötunnustasi vastaan. Ostoksien toimitus tapahtuu osoitteeseen, joka löytyy väestörekisteristä. Mikäli TUPAS-tunnistautuminen on ollut mahdollista maksamisen yhteydessä, ja tunnistautuminen on tehty onnistuneesti, ostos voidaan toimittaa väestörekisteristä poikkeavaan osoitteeseen. </li>\n<li>Maksuehto on 14 päivää. </li>\n<li>Viivästyskorko on 7 % + korkolain mukainen viitekorko. Maksuhuomautuksesta veloitamme 5 euroa.</li>\n<li>Ostajan tulee olla täyttänyt 18 vuotta.</li>\n<p><br/></p>\n<p><strong>Osamaksulla ostaminen</strong></p>\n<p>SveaWebPay (myöhemmin Svea) tarjoaa sinulle mahdollisuuden maksaa ostokset osissa. Tämä on mahdollista, kun olet hyväksynyt luottoehdot ja täyttänyt henkilötunnuksesi maksusivulla. Jos allekirjoitat osamaksusopimuksen sähköisesti TUPAS -tunnistautumalla, voit tallentaa tai tulostaa sopimuksen itsellesi välittömästi. Mikäli et allekirjoittanut osamaksusopimusta sähköisesti, saat kotiisi osamaksu- /tililuottosopimuksen ehtoineen, joka sinun tulee allekirjoittaa ja palauttaa Svealle 8 päivän sisällä.  Mikäli sopimusta ei palauteta meille tuon ajan sisällä, erääntyy koko ostos maksettavaksi kerralla seuraavan kuukauden aikana. Svea laskuttaa toimitus- ja laskutusajan välisestä ajasta sopimusehtojen mukaiset korko- ja muut mahdolliset kulut.</p>\n<p>Osamaksu- /tililuottoasiakkaana voit tehdä ostoksia tilillesi Svean sopimusasiakkailta. Voit tehdä ostoksia aina kun sinulla on luottorajaa jäljellä ja maksaa ostokset osissa luottosopimuksen ehtojen mukaisesti. Luottoraja on summa, joka on määritelty osamaksu- /tililuottosopimuksella. Luottoajan valitset sinulle parhaiten sopivaksi. Luotto tulee hoitaa sovitun luottoajan kuluessa. Se edellyttää, että maksat vähintään sovitun summan kuukausittain. Luonnollisesti voit maksaa myös koko luoton kerralla pois, ilman ylimääräisiä kuluja.</p>\n<p>Mikäli haluat hyödyntää tiliäsi sopimusaikana myös muihin ostoksiin, mutta luottosi maksuaika on jo valittu maksimipituiseksi, sinun tulee nostaa kuukausittaisen lyhennyseräsi määrää. Vastaavasti, mikäli haluat pidentää maksuaikaasi, voit pienentää kuukausittaista lyhennyserääsi. Mikäli ostat tilillesi useasta verkkokaupasta, tulet saamaan kaikista ostoksista oman laskun. Tästä huolimatta veloitamme sinulta vain yhden tilinhoitomaksun/kuukausi.</p>\n<p>Mikäli maksut jäävät maksamatta, emmekä ole saaneet yhteydenottoa maksun hoitamisesta, siirrämme saatavamme Svea Perintä Oy:n perittäviksi.</p>\n<p>Lue tarkemmat ehdot osoitteesta: <a href=\"http://www.sveawebpay.fi/kontovillkor/\">http://www.sveawebpay.fi/kontovillkor/</a><br />\nLisätietoja saat myös tililuottosopimukseltamme, jonka löydät sivuiltamme <a href=\"http://www.sveawebpay.fi\">http://www.sveawebpay.fi</a></p>\n<p>\n<strong>Yhteystiedot:</strong><br />\nSuomen Maksuturva Oy<br />\nY-tunnus: 2121703-0<br />\nRuoholahdenkatu 23<br />\n00180 HELSINKI<br />\nPuhelin: (09) 4241 7040, arkisin klo 9.00 – 17.00<br />\nSähköposti: asiakaspalvelu(a)maksuturva.fi<br />\n<a href=\"https://www.maksuturva.fi\">www.maksuturva.fi</a></p>\n<p>\r\r\n</div>','Yleiset myyntiehdot','Yleiset myyntiehdot','Yleiset myyntiehdot',NULL),(5,'Cafe Neuhaus','<div class=\'static_page cafe\'>\r\n\r\n<p>«Cafe Neuhaus»  is a small, cozy café  which offers delicious coffee drinks along with a high level of service.</p>\r\n<p>We are located in the heart of Helsinki, just a short way off Senaatintori. In our café you can always find appetizing fresh Belgian chocolate as well as a great choice of splendid hot chocolate or flavored coffee. </p>\r\n\r\n<p>Our address: <b>Cafe Neuhaus, Unioninkatu 32, 00810 Helsinki</b><br/>\n+358 44 7 622 022<br/>\n<a href=\'mailto:neuhaus@neuhas.fi\'>neuhaus@neuhaus.fi</a></p>\n\r\n<p>Working Hours: Mon-Fr 10.00-19.00, Sat-Sun 11.00-18.00</p>\n\n<img src=\"../history/cafe1.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe10.png\" alt=\'cafe Neuhuas Finland\'>\n\n\n<img src=\"../history/cafe3.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe4.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe5.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe6.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe7.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe8.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe9.png\" alt=\'cafe Neuhuas Finland\'>\n</div>','cafe','2013-07-01 12:30:55','2013-07-02 11:11:17',1,0,'',5,1,'Cafe Neuhaus','Cafe Neuhaus','',0,'Cafe Neuhaus',0,'Cafe Neuhaus','<div class=\'static_page cafe\'>\r\n\r\n<p>«Cafe Neuhaus» on pieni kodikas kahvila, joka tarjoaa herkullisia kahvijuomia ja korkeatasoista palvelua.</p>\r\n<p>Sijaitsemme Helsingin ytimessä, aivan Senaatintorin kupeessa. Valikoimastamme löydät aina maukasta tuoretta belgialaista suklaata kuin myös laajan valikoiman mainioita kaakaoita ja maustettuja kahveja.</p>\r\n\r\n<p>Osoitteemme: <b>Cafe Neuhaus, Unioninkatu 32, 00810 Helsinki</b><br/>\n+358 44 7 622 022<br/>\n<a href=\'mailto:neuhaus@neuhas.fi\'>neuhaus@neuhaus.fi</a></p>\n\r\n<p>Aukioloajat: ma-pe 10.00-19.00, la-su 11.00-18.00</p>\n\n<img src=\"../history/cafe1.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe10.png\" alt=\'cafe Neuhuas Finland\'>\n\n\n<img src=\"../history/cafe3.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe4.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe5.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe6.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe7.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe8.png\" alt=\'cafe Neuhuas Finland\'>\n<img src=\"../history/cafe9.png\" alt=\'cafe Neuhuas Finland\'>\n</div>','Cafe Neuhaus','Cafe Neuhaus','Cafe Neuhaus',NULL),(6,'Christmas 2013','<div class=\'static_page christmas\'>\r\n\r\n<p><img src=\"../christmas/smallballs.png\" style=\'float:right; top:-30px; position:relative\' alt=\'Neuhaus Christmas balls\' />Christmas is a magical season and the perfect time to give your family or friends something really special, a gift that will bring them pleasure and enjoyment. What better way to evoke the sensations of comfort and luxury while maintaining a Christmas feel than with a gourmet Christmas chocolate gift from Neuhaus Chocolates?</p>\r\n\r\n<h2>Handmade Belgian Christmas Chocolate Gifts</h2>\r\n\r\n<p><img src=\"../christmas/ballotin.png\" style=\'float:left; left:-10px;position:relative\' alt=\'Neuhaus Christmas ballotin\' />Our chocolates are handmade from the finest Belgian chocolate available and every bite of every praline, every truffle, every ganache and every gianduja is pure indulgence. When you give a Christmas chocolate gift from Neuhaus Chocolates you give not only the taste of creamy milk chocolate, the bittersweet sensation of dark chocolate and the enjoyment of soft creamy centers and the crunch of nut Christmas Baubles fillings, you also give the powerful experience of smell – of the familiar, mouth-watering scent of chocolate mingled with liqueur or butter cream centers.</p>\r\n\r\n<p>When biting into a piece of chocolate from a delicious Christmas chocolate gift, the powerful combination of the taste and smell of gourmet Belgian chocolate will surely evoke memories of childhood Christmas treats, of special family recipes, hot chocolate by the fire and the anticipation and pleasure of opening presents around the Christmas tree.</p>\r\n\r\n<h2>Chocolate Christmas Gift Choices for the Whole Family</h2>\r\n\r\n<p>Christmas Pyramid with a wide range of choices, you will find a Christmas chocolate gift for everyone. Buy our beautiful Christmas baubles stuffed with chocolates for the youngsters in your family. Give your friends a Christmas Ballotin or Christmas Chocolates Tin and let us choose our favorite chocolates or select the chocolates yourself. For a truly indulgent gift buy somebody special a box of Christmas Champagne Truffles or a Christmas Truffles Assortment. If you really want to spoil a loved one you can even buy our Christmas Chocolates Hamper which comes with a selection of our various Christmas chocolate gifts.</p>\r\n<div class=\'clearfix\'>\r\n<img style=\'float:left\' src=\"../christmas/luxury2.png\" alt=\'Neuhaus Christmas luxury box\' />\r\n<img style=\'float:right\' src=\"../christmas/tinbox.png\" alt=\'Neuhaus Christmas tinbox\' /></div>\r\n<p>Why not buy some tasty chocolate stocking stuffers as well? Both our limited edition Christmas Pyramid and our mini-ballotin are perfect, offering a little taste of the pleasure of Neuhaus Chocolates.</p>\r\n\r\n<p>We guarantee that you and your loved ones will fall in love with the taste that our range of chocolates has to offer. You will find that our Christmas gift chocolate is presented in an elegant ballotin, specially designed for Christmas and ready to be gifted.</p>\r\n\r\n<p style=\'font-weight:bold\'>Christmas collection will be available for purchase in our store or on the website from the end of November.</p>\r\n\r\n<img src=\"../christmas/cubes.png\" alt=\'Neuhaus Christmas cubes\' />\r\n</div>','christmas','2013-10-08 11:34:06','2014-01-29 11:55:59',0,0,'',4,0,'Christmas Chocolate Gift','Christmas Chocolate Gift','',0,'Christmas Chocolate Gift',0,'Joulu 2013','<div class=\'static_page christmas\'>\r\n\r\n<p><img src=\"../christmas/smallballs.png\" style=\'float:right; top:-30px; position:relative\' alt=\'Neuhaus Christmas balls\' />Joulu on taianomaista aikaa, jolloin on oivallinen tilaisuus antaa rakkaimmillesi lahjaksi jotain erityistä, joka tuo heille iloa ja nautintoa. Millä olisikaan parempi tapa herätellä mukavuuden ja luksuksen tunnetta samalla ylläpitäen joulun tunnelmaa kuin herkullisilla Neuhausin suklaajoululahjoilla?</p>\r\n\r\n<h2>Käsintehdyt belgialaiset suklaajoululahjat</h2>\r\n\r\n<p><img src=\"../christmas/ballotin.png\" style=\'float:left; left:-10px;position:relative\' alt=\'Neuhaus Christmas ballotin\' />Konvehtimme valmistetaan käsityönä hienoimmasta saatavilla olevasta belgialaisesta suklaasta ja jokainen suupala Neuhausin praliinia, tryffeliä ja ganachea on puhdasta nautintoa. Kun valitset jouluisen suklaalahjasi Neuhausin joulusuklaavalikoimasta, et anna vain makuelämystä kermaisesta maitosuklaasta, kitkeränmakeasta tummasta suklaasta, pehmeän kermaisista täytteistä ja pähkinän rapeudesta, vaan annat myös vaikuttavan tuoksukokemuksen – tutusta ja suussasulavan suklaan tuoksusta, joka sekoittuu herkullisiin täytteisiin.</p>\r\n\r\n<p>Maistaessa konvehtia herkullisesta suklaajoululahjarasiasta, ylellisen belgialaisen suklaan voimakas tuoksu ja maku palauttavat varmasti mieleesi lapsuuden muistoja joulukonvehdeista, perheen erityisistä resepteistä, kuumasta kaakaosta takan äärellä, odotuksen ja ilon tunnelmasta ja lahjojen avaamisesta joulukuusen äärellä.</p>\r\n\r\n<h2>Suklaisesta joululahjavalikoimasta vaihtoehdot koko perheelle</h2>\r\n\r\n<p>Joulupyramidissa on laaja valikoima konvehteja, josta jokainen löytää itselleen mieleisen. Osta Neuhausin kauniita suklaatäytteisiä joulukuusenkoristeita nuorempien perheenjäsenten iloksi. Anna ystävillesi lahjaksi jouluinen suklaakonvehtirasia tai –tinarasia ja anna meidän valita siihen suosikkikonvehtimme tai voit myös itse valita mieleisesi konvehdit. Erityisen herkullinen lahja erityiselle henkilölle on rasiallinen Joulun shampanjatryffeleitä tai Joulun tryffelilajitelma. Jos todella haluat hemmotella rakkaintasi, voit ostaa Neuhausin Jouluherkkukorin, joka sisältää valikoiman useita suklaajoululahjojamme.</p>\n<div class=\'clearfix\'>\r\n<img style=\'float:left\' src=\"../christmas/luxury2.png\" alt=\'Neuhaus Christmas luxury box\' />\r\n<img style=\'float:right\' src=\"../christmas/tinbox.png\" alt=\'Neuhaus Christmas tinbox\' /></div>\r\n<p>Miksipä et ostaisi myös maukkaita joulusukkien täytteitä? Neuhausin Joulupyramidi ja Mini Ballotin-konvehtirasia ovat molemmat täydellisiä pikkulahjoja, jotka tarjoavat pienen nautinnollisen maistiaisen Neuhausin suklaita.</p>\r\n\r\n<p>Voimme taata, että sinä ja rakkaimpasi tulette rakastumaan makunautintoihin, joita suklaavalikoimamme tarjoaa. Tulet huomaamaan, että meidän suklaajoululahjat ovat pakattu elegantteihin jouluisiin rasioihin, jotka voi antaa lahjaksi samantien.</p>\r\n\r\n<p>Jouluvalikoima tulee myyntiin kahvilassamme ja verkkokaupassa marraskuun lopulla.</p>\n\n<img src=\"../christmas/cubes.png\" alt=\'Neuhaus Christmas cubes\' />\n</div>','Joulu 2013 Neuhaus Suklaa Lahja','Joulu 2013 Neuhaus Suklaa','Joulu 2013 Neuhaus Suklaa',NULL),(7,'For corporate customers','<div class=\'static_page cafe\'>\r\n<p>Dear Corporate Customers</p>\r\n\r\n<p>Our company offers various options of splendid chocolate presents which can perfectly suit your colleagues, partners or clients.</p>\r\n\r\n<p>The services which we offer for you are: </p>\r\n\r\n<ul><li>organization of products’ delivery directly to your company;</li>\r\n\r\n<li>degustation of our chocolate in order to choose the best suitable gift together with you;</li>\r\n\r\n<li>discussion and calculation of prices on the individual basis;</li>\r\n\r\n<li>design development of the packaging and wrapping material for boxes. Personal exclusive design can contain your company’s name, logo or other features according to your wish.</li></ul>\r\n\r\n<p>Belgian handmade chocolate Neuhaus will help to express your care and attentiveness towards the people around you!</p>\r\n\r\n<p>For any additional information and for placing the orders please contact us via the following\r\ne-mail: <b>neuhaus@neuhaus.fi</b> or by phone: <b>+358 (0)447 022 022</b> </p>\r\n\r\n\r\n<p style=\'text-align:center; font-weight:bold\'>We are always ready to assist you!</p></div>\n\r\n<img src=\"../static/corporate.jpg\" alt=\'Neuhaus Corporate Customers\' />\n\r\n<img src=\"../christmas/christmas_main.png\" alt=\'Neuhaus Christmas\' />','corporate','2013-10-24 13:55:46','2013-10-24 13:55:46',1,0,'',6,1,'Corporate customers Neuhaus','Corporate customers Neuhaus','',0,'Corporate customers Neuhaus',0,'Yritysasiakkaille','<div class=\'static_page cafe\'>\r\n<p>Hyvät yritysasiakkaat</p>\r\n\r\n<p>Yrityksemme tarjoaa laajan valikoiman mainioita belgialaisesta suklaasta valmistettuja lahjoja, jotka sopivat täydellisesti yrityslahjoiksi henkilöstölle, yhteistyökumppaneille ja asiakkaille.</p>\r\n\r\n<p>Tarjoamme Teille seuraavia palveluita:</p>\r\n\r\n<ul><li>tilattujen tuotteiden toimitus suoraan yritykseenne;</li>\r\n\r\n<li>maistiaisia tuotteistamme, jotta voimme valita sopivimman lahjan yhdessä kanssanne;</li>\r\n\r\n<li>hintaneuvottelut ja tarjousehdotukset tapauskohtaisesti;</li>\r\n\r\n<li>tuotteiden paketointimateriaalit ja -palvelu.  Erityisesti yrityksellenne räätälöity paketointi voi sisältää esimerkiksi yrityksenne nimen, logon tai muita ominaisuuksia toiveidenne mukaan.</li></ul>\r\n\r\n<p>Neuhaus auttaa teitä osoittamaan huomaavaisuutenne ympärillänne olevia kohtaan käsin valmistetuilla suklaalahjoilla.</p>\r\n\r\n<p>Halutessanne tehdä tilauksen tai lisätietoja tuotteistamme, otattehan yhteyttä meihin \rsähköpostitse: <b>neuhaus@neuhaus.fi</b> tai puhelimitse: <b>+358 (0)447 022 022</b> </p>\r\n\r\n\r\n<p style=\'text-align:center; font-weight:bold\'>Olemme aina valmiita auttamaan teitä!</p></div>\n\r\n<img src=\"../static/corporate.jpg\" alt=\'Neuhaus Yritysasiakkaat\' />\n\r\n<img src=\"../christmas/christmas_main.png\" alt=\'Neuhaus Joulu\' />','Yritysasiakkaat Neuhaus','Yritysasiakkaat Neuhaus','Yritysasiakkaat Neuhaus',NULL);
