INSERT INTO `spree_product_translations` VALUES (1,1,'en','test1 eng','fdasfdsaf11111','','','test1','2013-04-06 13:16:27','2013-04-28 22:39:22'),(2,1,'fi','test1 fin','fassadfsdaf','','','test1','2013-04-06 13:17:17','2013-04-28 22:39:07'),(3,2,'en','Adelson','This praline is named after Adelson de Gavre, husband of Suzanne Neuhaus and son in law to Jean Neuhaus. It was Adelson de Gavre who created the star pralines \"Caprice\" and \"Tentation\" for the occasion of the World Exhibition held in Brussels in 1958.\r\nThe recipe of the Adelson is unique because the praliné filling is made according to the tradition of old style praliné, which means that it is made solely out of roasted hazelnuts and sugar, without any chocolate. The chocolate is used only in the coating and as such, superbly enhances the exquisite flavour of the Turkish hazelnuts.','adelson chocolate','adelson chocolate','adelson','2013-06-04 11:52:55','2013-06-04 11:56:03'),(4,2,'fi','Adelson','Tämä konvehti on nimetty Adelson de Gavren mukaan. Hän oli Suzanne Neuhausin aviomies ja Jean Neuhausin vävy. Adelson de Gavre kehitti suositut konvehdit \"Caprice\" ja \"Tentation\" Brysselin maailmannäyttelyyn vuonna 1958.\r\nAdelsonin resepti on ainutlaatuinen, sillä sen praliini (täyte) on valmistettu vanhalla perinteisellä tavalla, joka tarkoittaa sitä, että se on valmistettu ainoastaan paahdetuista hasselpähkinöistä ja sokerista, ilman suklaata. Suklaata on käytetty vain päällysteenä, joka korostaa erinomaisesti turkkilaisten hasselpähkinöiden makua.\r\n','adelson suklaa neuhaus','adelson suklaa neuhaus','adelson','2013-06-04 11:55:12','2013-06-04 11:55:37'),(5,3,'en','Albert','This royal praline was created to commemorate the marriage of Prince Albert and Princess Paola, the present sovereigns of Belgium, in 1959. Since last century, Neuhaus is an official supplier to the Belgian Royal Court.\r\nThe Albert chocolate is filled with a praliné made of hazelnuts all the way from the Black Sea coast region. This chocolate also hides a whole caramelized hazelnut in the centre, an exquisite and delicious surprise.','albert chocolate neuhaus','albert chocolate neuhaus','albert','2013-06-04 13:00:57','2013-06-04 13:02:26'),(6,3,'fi','Albert','Tämä ruhtinaallinen konvehti luotiin nykyisten Belgian hallitsijoiden, prinssi Albertin ja prinsessa Paolan, häiden kunniaksi vuonna 1959. Viime vuosisadalta lähtien, Neuhaus on ollut Belgian kuninkaallisen hovin virallinen toimittaja.\r\nAlbert konvehti on täytetty praliinilla, joka on valmistettu Mustanmeren rannikkoalueelta asti tulleista hasselpähkinöistä. Tämän konvehdin sisään on myös piilotettu erinomainen ja herkullinen yllätys, kokonainen karamellisoitu hasselpähkinä.','albert suklaa neuhaus','albert suklaa neuhaus','albert','2013-06-04 13:02:51','2013-06-04 14:56:54'),(7,4,'en','Art Deco','The strong, 72% cocoa mass dark chocolate in Art Déco is beautifully balanced with praliné from Californian almonds and nougat pieces.','art deco chocolate neuhaus','art deco chocolate neuhaus','art-deco','2013-06-04 13:07:21','2013-06-04 13:08:23'),(8,4,'fi','Art Deco','Vahvasta, 72% tumman suklaan kaakaomassasta valmistetun Art Décon maku on hienosti tasapainotettu kalifornialaisista manteleista ja nougatpaloista koostuvalla praliinilla.','art deco suklaa neuhaus','art deco suklaa neuhaus','art-deco','2013-06-04 13:08:48','2013-06-04 13:08:48'),(9,5,'en','Figaro','The strong, 72% cocoa mass dark chocolate in Art Déco is beautifully balanced with praliné from Californian almonds and nougat pieces.','figaro chocolate neuhaus','figaro chocolate neuhaus','figaro','2013-06-04 14:53:12','2013-06-04 14:53:51'),(10,5,'fi','Figaro','Figaro konvehti on ihana yhdistelmä tummaa suklaata ja pehmeää Mustanmeren rannikkoalueelta tulleista hasselpähkinöistä tehtyä praliinia. Hasselpähkinät paahdetaan suklaatyöpajassamme paahtomestarimme toimesta, jolloin praliini saavuttaa erinomaisen ja täydellisen tasaisen maun.','figaro suklaa neuhaus','figaro suklaa neuhaus','figaro','2013-06-04 14:54:38','2013-06-04 14:54:38'),(11,6,'en','Florentins','Sometimes just a few well chosen ingredients can be enough to create a widely loved product. The recipe for these Florentins is genial in its simplicity. Neuhaus Florentins carry slightly caramelized flaked almonds on a layer of dark chocolate.','florentins chocolate neuhaus','florentins chocolate neuhaus','florentins','2013-06-04 14:58:29','2013-06-04 14:59:16'),(12,6,'fi','Florentins','Joskus vain muutamalla tarkkaan valitulla aineosalla voidaan luoda tuote, joka saavuttaa laajan suosion. Näiden Florentins konvehtien resepti on nerokas yksinkertaisuudellaan. Neuhausin Florentins konvehdeissa on kevyesti karamellisoituja mantelilastuja tumman suklaan päällä.','florentins suklaa neuhaus','florentins suklaa neuhaus','florentins','2013-06-04 15:04:19','2013-06-04 15:04:19'),(13,7,'en','Madison','The Madison chocolate is enriched with \"feuilletine\", crispy French wafers, made according to the traditional recipe from Brittany.\r\nMadison is the perfect combination of strong, dark chocolate with an elegant praliné filling. The \"feuilletine\" inside the filling makes this chocolate a delicate and crunchy chocolate treat.','madison chocolate neuhaus','madison chocolate neuhaus','madison','2013-06-04 15:09:59','2013-06-04 15:11:13'),(14,7,'fi','Madison','Madison konvehteihin on lisätty täytettä nimeltä \"feuilletine\", joka on Brittanyn perinteisen reseptin mukaan valmistettua rapeaa ranskalaista vohvelia.\r\nMadison on täydellinen yhdistelmä vahvaa tummaa suklaata ja hienostunutta praliinia. Praliinin sisälle piilotettu \"feuilletine\" tekee tästä konvehdista herkullisen ja rapean suklaaelämyksen.','madison suklaa neuhaus','madison suklaa neuhaus','madison','2013-06-04 15:12:08','2013-06-04 15:12:08'),(15,8,'en','Mendiant Dark','A mendiant is a traditional French delicacy, composed of a chocolate base with inclusions of nuts and dried fruits. Originally, the inclusions represented the four mendicant or monastic orders of the Dominicans, Augustinians, Franciscans and Carmelites.\r\nThis simple yet delicious chocolate consists of plain dark Neuhaus chocolate with dried nuts.','mendiant dark chocolate neuhaus','mendiant dark chocolate neuhaus','mendiant-dark','2013-06-04 20:32:09','2013-06-04 20:33:03'),(16,8,'fi','Mendiant Dark','Mendiant on perinteinen ranskalainen herkku, joka koostuu pähkinöillä ja kuivatuilla hedelmillä päällystetystä suklaapohjasta. Alun perin, pähkinöiden ja hedelmien värit edustivat neljää eri kerjäläismunkkien veljeskuntaa; Dominicans, Augustinians, Franciscans ja Carmelites.\r\nTämä yksinkertainen, mutta herkullinen suklaa sisältää sileää Neuhausin tummaa suklaata ja kuivattuja hedelmiä.','mendiant dark suklaa neuhaus','mendiant dark suklaa neuhaus','mendiant-dark','2013-06-04 20:33:35','2013-06-04 20:33:35'),(17,9,'en','Noix','The Noix praline has a filling of hazelnut praliné with hints of gently roasted hazelnuts from the Black Sea coast region and almonds from California. The addition of caramelised hazelnut pieces bring a touch of real \"brésilienne\" and results in a wonderful mixture of flavours and textures.','noix chocolate neuhaus','noix chocolate neuhaus','noix','2013-06-04 20:42:09','2013-06-04 20:43:11'),(18,9,'fi','Noix','Noix konvehti on täytetty hasselpähkinäpraliinilla, joka sisältää Mustanmeren rannikkoalueelta tuotuja, kevyesti paahdettuja hasselpähkinäpaloja ja kalifornialaisia manteleita. Pienet karamellisoidut hasselpähkinäpalat tuovat konvehtiin vivahteen aitoa \"brésiliennea\" ja lopputulos on loistava sekoitus makuja ja tekstuureita.','noix chocolate neuhaus','noix chocolate neuhaus','noix','2013-06-04 20:43:24','2013-06-04 20:43:24'),(19,10,'en','Satan','Satan has an intense dark chocolate shell. The praliné filling made of freshly roasted and caramelised hazelnuts is enhanced by crunchy little pieces of hazelnut all the way from the Black Sea coast region.','satan chocolate neuhaus','satan chocolate neuhaus','satan','2013-06-04 20:47:15','2013-06-04 20:47:46'),(20,10,'fi','Satan','Satan konvehdissa on voimakkaan makuinen tumma suklaakuorrutus. Tuoreena paahdetuista ja karamellisoiduista hasselpähkinöistä valmistettu praliini on täydennetty rapealla, Mustanmeren rannikkoalueelta tuodulla hasselpähkinärouheella.','satan suklaa neuhaus','satan suklaa neuhaus','satan','2013-06-04 20:48:08','2013-06-04 20:48:08'),(21,11,'en','Summum','Behind the sturdy looks of the Summum praline, hides a filling of smooth gianduja and crunchy \"feuilletine\" or crispy French wafers. The filling is covered with a thin layer of intense dark chocolate.','summum chocolate neuhaus','summum chocolate neuhaus','summum','2013-06-04 20:52:02','2013-06-04 20:52:37'),(22,11,'fi','Summum','Jykevän näköisen Summum konvehdin sisällä piilee pehmeä gianduja-täyte ja rapsakka \"feuilletine\"-vohveli. Täyte on kuorrutettu ohuella kerroksella vahvaa tummaa suklaata.','summum suklaa neuhaus','summum suklaa neuhaus','summum','2013-06-04 20:53:26','2013-06-04 20:53:26'),(23,12,'en','Passion','This intense and slightly bitter chocolate ganache is an ode to the flavour and simplicity of dark chocolate.','passion chocolate neuhaus','passion chocolate neuhaus','passion','2013-06-04 20:57:57','2013-06-04 20:58:26'),(24,12,'fi','Passion','Tämä vahva ja hieman kitkerä tumma suklaaganache on oodi tumman suklaan maulle ja yksinkertaisuudelle.','passion suklaa neuhaus','passion suklaa neuhaus','passion','2013-06-04 20:58:47','2013-06-04 20:58:47'),(25,13,'en','Art Nouveau','The filling in Art Nouveau holds a dark and intense chocolate ganache, enriched with a hint of hazelnuts all the way from the Black Sea coast region.','art nouveau chocolate neuhaus','art nouveau chocolate neuhaus','art-nouveau','2013-06-04 21:01:55','2013-06-04 21:02:35'),(26,13,'fi','Art Nouveau','Art Nouveaun täytteenä on tummaa ja vahvaa suklaaganachea, jota on rikastettu hyppysellisellä Mustanmeren rannikkoalueelta asti tuotua hasselpähkinää.','art nouveau suklaa neuhaus','art nouveau suklaa neuhaus','art-nouveau','2013-06-04 21:02:57','2013-06-04 21:02:57'),(27,14,'en','Criollo','This chocolate is named after the Criollo cocoa bean. Out of the three main varieties in cocoa beans - Criollo, Forastero and Trinitario, Criollo is the most delicate one. It yields a particularly fine and sophisticated cocoa.\r\nThe Criollo chocolate is composed of an intense dark chocolate outer shell and a center of bitter chocolate and fresh butter. This unique recipe will appeal to any connoisseur of dark chocolates and gourmets looking for a distinctive taste experience.','criollo chocolate neuhaus','criollo chocolate neuhaus','criollo','2013-06-04 21:05:42','2013-06-04 21:06:10'),(28,14,'fi','Criollo','Tämä suklaa on saanut nimensä Criollo-kaakaopavun mukaan. Kolmen kaakaon päälajikkeen - Criollo, Forastero ja Trinitario, joukosta, Criollo on kaikista herkullisin. Siitä saadaan erityisen hienoa ja vaateliasta makua tyydyttävää kaakaota. \r\nCriollo konvehdin päällys on tehty vahvasta tummasta suklaasta ja sisus kitkerästä suklaasta ja voista. Tämä erityislaatuinen resepti vetoaa jokaiseen tumman suklaan ystävään ja herkkusuuhun, joka etsii ainutlaatuista makuelämystä.','criollo suklaa neuhaus','criollo suklaa neuhaus','criollo','2013-06-04 21:06:35','2013-06-04 21:06:35'),(29,15,'en','Désir','This exclusive chocolate with unique shape is part of the family of \"Irrésistibles\", the star pralines within the Neuhaus range.\r\nThis star chocolate is made of a handmade nougatine biscuit, handfilled with an intense chocolate ganache from Peru (64% cocoa) and covered in dark chocolate.','desir chocolate neuhaus','desir chocolate neuhaus','desir','2013-06-04 21:22:23','2013-06-04 21:22:59'),(30,15,'fi','Désir','Tämä eksklusiivinen suklaa ainutlaatuisella muodolla, kuuluu \"Irrésistibles\"-sarjaan, Neuhausin valikoiman suosikkikonvehteihin.\r\nTämä konvehti on valmistettu käsintehdystä krokantista, joka on käsin täytetty perulaisella suklaaganachella (64% kaakaosta) ja kuorrutettu tummalla suklaalla.','desir suklaa neuhaus','desir suklaa neuhaus','desir','2013-06-04 21:23:19','2013-06-04 21:23:19'),(31,16,'en','Grand Place','This praline is named after the Grand Place in Brussels, a square that lies just a few steps away from the Queen\'s Gallery, where the first praline was created in 1912 by Jean Neuhaus.\r\nThe Grand Place praline is a rich, dark chocolate ganache subtly spiced with nigella, a mild Indian spice also known as black cumin, covered a dark chocolate shell sparkled with sugar crystals.','grand place chocolate neuhaus','grand place chocolate neuhaus','grand-place','2013-06-04 21:29:28','2013-06-04 21:30:07'),(32,16,'fi','Grand Place','Tämä konvehti on nimetty Brysselissä olevan Grand Placen, aukio joka sijaitsee muutaman askeleen päässä “Kuningattaren galleriasta”, mukaan. Siellä Jean Neuhaus kehitti ensimmäisen konvehdin vuonna 1912.\r\nGrand Place konvehti on hienovaraisesti mustalla kuminalla maustettua täyteläistä tummaa suklaaganachea, joka on kuorrutettu tummalla suklaalla ja pyöritelty kidesokerissa.','grand place suklaa neuhaus','grand place suklaa neuhaus','grand-place','2013-06-04 21:30:42','2013-06-04 21:30:42'),(33,17,'en','Jean','This intense dark praline is named after Jean Neuhaus, grand son of the founder Neuhaus and inventor of the praline. Exactly 100 years ago, in 1912, Jean Neuhaus created the first filled chocolate bonbon and named it \"praline\".\r\nThe ganache filling in Jean is made from intense dark origin chocolate from Peru. The combination with a dark chocolate shell gives this praline a perfect balance of intense flavours.','jean chocolate neuhaus','jean chocolate neuhaus','jean','2013-06-04 21:32:45','2013-06-04 21:33:59'),(34,17,'fi','Jean','Tämä intensiivinen tumma konvehti on nimetty Jean Neuhausin, konvehdin keksijän, mukaan. Tarkalleen 100 vuotta sitten, vuonna 1912, Jean Neuhaus kehitti ensimmäisen täytetyn suklaamakeisen ja nimesi sen konvehdiksi.\r\nJean konvehdin ganachetäyte on tehty alkuperäisestä perulaisesta tummasta suklaasta. Täydellinen makujen yhteensulavuus saadaan aikaan tummasta suklaasta valmistetulla päällyksellä.','jean chocolate neuhaus','jean chocolate neuhaus','jean','2013-06-04 21:34:11','2013-06-04 21:34:11'),(35,18,'en','Manon Noir','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nThis Manon with its frothy, dark chocolate mousse filling and crispy intense chocolate coating is a delight for lovers of dark chocolate. The airy sensation of the light chocolate mousse and the intensity of the dark chocolate cover are keep each other in perfect balance.','manon noir chocolate neuhaus','manon noir chocolate neuhaus','manon-noir','2013-06-04 21:37:04','2013-06-04 21:37:37'),(36,18,'fi','Manon Noir',' \"Manon\"-konvehtisarjan uskotaan saaneen nimensä Jean Neuhausin tyttären, Suzannen, mukaan. Suzanne Neuhaus oli tunnettu oopperalaulaja. Vuonna 1942, hän tuli tunnetuksi \"Manon Lescautin\" roolissa, Jules Massenetin kirjoittamassa kuuluisassa oopperassa nimeltä \"Manon\".\r\nManon, jossa on täytteenä kuohkea tumma suklaamousse ja rapea suklaapäällys, on ilo jokaiselle tumman suklaan ystävälle. Ilmavan kevyt suklaamousse ja vahva tumma suklaa saavat aikaan täydellisen makujen tasapainon.','manon noir suklaa neuhaus','manon noir suklaa neuhaus','manon-noir','2013-06-04 21:37:37','2013-06-04 21:38:05'),(37,19,'en','Violetta','This elegant dark chocolate praline is a fruitful combination of chocolate and flowers. The mysterious appearance of Violetta covers a creamy ganache flavoured with violet and is covered in dark chocolate with a decoration of delectable crystallised violets from Toulouse.','violetta chocolate neuhaus','violetta chocolate neuhaus','violetta','2013-06-04 21:39:41','2013-06-04 21:40:15'),(38,19,'fi','Violetta','Tämä elegantti tumma suklaakonvehti on hedelmäinen suklaan ja kukkien yhdistelmä. Violettan salaperäinen ulkomuoto kätkee sisälleen kermaisen orvokeilla maustetun ganachen ja se on kuorrutettu tummalla suklaalla ja koristeltu viehättävillä kiteytetyillä Toulousen orvokeilla.','violetta suklaa neuhaus','violetta suklaa neuhaus','violetta','2013-06-04 21:40:26','2013-06-04 21:42:08'),(39,20,'en','Caprice','Caprice, along with Tentation, are the iconic pralines created for the occasion of the World Exhibition held in Brussels in 1958. Today, Caprice is still a star praline within the Neuhaus range. The names Caprice and Tentation refer to a quote by the French star actress Brigitte Bardot.\r\nThis legendary chocolate consists of a shell. The biscuit is hand filled with vanilla fresh cream and covered in an intense dark chocolate.','caprice chocolate neuhaus','caprice chocolate neuhaus','caprice','2013-06-04 21:49:03','2013-06-04 21:49:37'),(40,20,'fi','Caprice','Caprice ja Tentation ovat ikonin aseman saavuttaneet konvehdit, jotka luotiin Brysselin maailmannäyttelyä varten vuonna 1958. Tänä päivänä Caprice on edelleen suosittu Neuhausin konvehti. Nimet Caprice ja Tentation viittaavat tunnetun ranskalaisen näyttelijän, Brigitte Bardotin, sitaattiin.\r\nTässä legendaarisessa konvehdissa on keksikuori, joka on käsin täytetty tuoreella vaniljakermalla ja kuorrutettu tummalla suklaalla.','caprice suklaa neuhaus','caprice suklaa neuhaus','caprice','2013-06-04 21:50:09','2013-06-04 21:50:09'),(41,21,'en','Fabiola','This royal praline was created to commemorate the marriage of Prince Baudoin and Princess Fabiola, former King and Queen of Belgium, in 1960. As an official supplier to the Belgian Royal Court, Neuhaus maintains also today a close tie with the Belgian Royal Family.\r\nThe Fabiola chocolate is composed of a dark chocolate shell with a layered filling of vanilla fresh cream and a dark chocolate ganache. The contrast between the richness of the chocolate and the frothiness of the filling brings a delightful taste experience.','fabiola chocolate neuhaus','fabiola chocolate neuhaus','fabiola','2013-06-04 21:55:19','2013-07-24 12:59:46'),(42,22,'en','Desdémone','This praline is a combination of the smooth, light flavour of vanilla fresh cream with subtle notes of melt-in-the-mouth roasted hazelnut gianduja.','desdémone chocolate neuhaus','desdémone chocolate neuhaus','desdemone','2013-06-04 22:03:40','2013-06-04 22:06:55'),(43,22,'fi','Desdémone','Tämä konvehti on yhdistelmä pehmeää tuoretta vaniljakermaa ja suussa sulavaa paahdetuista hasselpähkinöistä valmistettua giandujaa.','desdémone suklaa neuhaus','desdémone suklaa neuhaus','desdemone','2013-06-04 22:06:55','2013-06-04 22:06:55'),(44,23,'en','Galerie','The Galerie chocolate is a caramel ganache with a touch of French sea salt from Guérande ganache. The filling is covered in dark chocolate and the praline is decorated with the signature Neuhaus \"N\".\r\nThe Galerie chocolate bears the name of the \"Galerie de la Reine\" or Queen\'s Gallery in Brussels, where Jean Neuhaus opened his first store in 1857 and where the first praline was created in 1912.','galerie chocolate neuhaus','galerie chocolate neuhaus','galerie','2013-06-04 22:07:40','2013-06-04 22:08:13'),(45,23,'fi','Galerie','Galerie konvehti on tehty karamelliganachesta ja ranskalaisella Guéranden merisuolalla maustetusta ganachesta. Täyte on kuorrutettu tummalla suklaalla ja konvehti on koristeltu Neuhausin etumerkinnällä, kirjaimella “N”.\r\nGalerie konvehdin nimi tulee Brysselissä sijaitsevasta Kuningattaren galleriasta, \"Galerie de la Reine\", jossa Jean Neuhaus avasi ensimmäisen myymälänsä vuonna 1857 ja missä ensimmäinen konvehti keksittiin vuonna 1912.','galerie suklaa neuhaus','galerie suklaa neuhaus','galerie','2013-06-04 22:08:38','2013-06-04 22:08:38'),(46,24,'en','Marzipan mini Bûche','Pure marzipan covered in dark chocolate. Neuhaus marzipan is made with almonds all the way from Faro, Portugal. All marzipan includes a minimum of 50% almonds for a pure marzipan flavour. The elegant coating of candied sugar lends a crunchy finish.','Marzipan mini Buche chocolate neuhaus','Marzipan mini Buche chocolate neuhaus','marzipan-mini-buche','2013-06-04 22:15:50','2013-06-04 22:20:57'),(47,24,'fi','Marzipan mini Bûche','Marsipaania, joka on kuorrutettu tummalla suklaalla. Neuhausin marsipaani on valmistettu portugalilaisista Faron manteleista. Kaikissa marsipaaneissa on vähintään 50% mantelia, jotta on saavutettu aito marsipaanin maku. Elegantti sokeripeite antaa konvehdille rapsakan loppusilauksen.','Marzipan mini Buche suklaa neuhaus','Marzipan mini Buche suklaa neuhaus','marzipan-mini-buche','2013-06-04 22:17:00','2013-06-04 22:20:47'),(48,25,'en','Canasta','Pure marzipan covered in dark chocolate. Neuhaus marzipan is made with almonds all the way from Faro in Portugal, and includes a minimum of 50% almonds for a pure marzipan flavour.','canasta chocolate neuhaus','canasta chocolate neuhaus','canasta','2013-06-04 22:23:04','2013-06-04 22:23:45'),(49,25,'fi','Canasta','Marsipaania, joka on kuorrutettu tummalla suklaalla. Neuhausin marsipaani on valmistettu portugalilaisista Faron manteleista. Kaikissa marsipaaneissa on vähintään 50% mantelia, jotta on saavutettu aito marsipaanin maku.','canasta chocolate neuhaus','canasta chocolate neuhaus','canasta','2013-06-04 22:24:01','2013-06-04 22:24:01'),(50,26,'en','Séduction','This star chocolate is made of a handmade nougatine biscuit, handfilled with a smooth butter cream enriched with a subtle note of refreshing raspberry, and covered in intense dark chocolate. Pairing raspberry and chocolate creates a classic combination flavours. The tangy freshness of raspberries float on an wave of intense dark chocolate.','séduction chocolate neuhaus','séduction chocolate neuhaus','seduction','2013-06-04 22:26:47','2013-06-04 22:27:33'),(51,26,'fi','Séduction','Tämä suosittu konvehti on valmistettu käsintehdystä krokantista ja täytetty pehmeällä kreemillä, jossa on hyppysellinen virkistävää vadelmaa ja lopuksi kuorrutettu tummalla suklaalla. Yhdistämällä vadelma ja tumma suklaa saadaan aikaan klassinen makujen yhdistelmä. Vadelmien kirpeä raikkaus kelluu intensiivisen tumman suklaan aallolla.','séduction suklaa neuhaus','séduction suklaa neuhaus','seduction','2013-06-04 22:27:59','2013-06-04 22:27:59'),(52,27,'en','Orangettes','The combination of orange and chocolate is a successful marriage that is liked by people from all over the world and appreciated by young and old.\r\nThe orange peels for these \"Orangettes\" are candied in the traditional way and then coated with a thin layer of dark chocolate. The tenderness of the orange peel and the crispy chocolate create a variety of textures in the mouth.','orangettes chocolate neuhaus','orangettes chocolate neuhaus','orangettes','2013-06-04 22:32:49','2013-06-04 22:33:26'),(53,27,'fi','Orangettes','Appelsiinin ja suklaan yhdistelmä muodostaa toimivan liiton, josta niin nuoret kuin vanhat pitävät ympäri maailmaa.\r\nOrangettes konvehteissa käytetyt appelsiininkuoret on sokeroitu perinteisellä tavalla ja sen jälkeen kuorrutettu tummalla suklaalla. Appelsiininkuoren pehmeys ja suklaan rapeus täyttävät suun erilaisilla koostumuksilla.','orangettes suklaa neuhaus','orangettes suklaa neuhaus','orangettes','2013-06-04 22:33:56','2013-06-04 22:33:56'),(54,28,'en','Suzanne','This praline is a tribute to Suzanne Neuhaus-De-Gavre, daughter of Jean Neuhaus and a famous opera singer.\r\nLayers of praliné and raspberry ganache give this dark chocolate \"Suzanne\" a subtle hint of freshness.','suzanne chocolate neuhaus','suzanne chocolate neuhaus','suzanne','2013-06-04 22:36:55','2013-06-04 22:37:28'),(55,28,'fi','Suzanne','Tämä konvehti on kunnianosoitus kuuluisalle oopperalaulajalle Suzanne Neuhaus-De-Gavrelle, Jean Neuhausin tyttärelle.\r\nKerros praliinia ja vadelmaganachea antavat tälle tummalle suklaakonvehdille raikkaan vivahteen.','suzanne suklaa neuhaus','suzanne suklaa neuhaus','suzanne','2013-06-04 22:38:01','2013-06-04 22:38:01'),(56,29,'en','Fraise des Bois','The colourful wrapping of the Fraise des Boispraline reveals a melt-in-the-mouth creamy filling flavoured with the pulp of wild woodland strawberries, covered in dark chocolate.','Fraise des Bois chocolate neuhaus','Fraise des Bois chocolate neuhaus','fraise-des-bois','2013-06-04 22:40:53','2013-06-04 22:41:22'),(57,29,'fi','Fraise des Bois','Fraise des Bois konvehdin värikkään kääreen alta paljastuu suussa sulava kermainen metsämansikkatäyte, joka on kuorrutettu tummalla suklaalla.','Fraise des Bois chocolate neuhaus','Fraise des Bois chocolate neuhaus','fraise-des-bois','2013-06-04 22:41:35','2013-06-04 22:41:35'),(58,30,'en','Pagode','The recipe of this praline dates back to 1958, the year when the World Exhibition took place in Brussels and Neuhaus created several recipes in honour of this important occasion. Out of the 43 countries that participated in the exhibition, the Thai pavilion was one of the most visited. In light of the strong interest that people showed for Asian culture, Neuhaus created \"Pagode\" chocolate. The unique shape of this praline is inspired by a pagoda, one of the most typical characteristics of Asian architecture and culture.\r\nThe \"Pagode\" chocolate consists of an intense dark chocolate shell holding a layered filling of smooth gianduja paste and intense coffee ganache.','pagode chocolate neuhaus','pagode chocolate neuhaus','pagode','2013-06-04 22:43:25','2013-06-04 22:43:57'),(59,30,'fi','Pagode','Tämän konvehdin resepti on vuodelta 1958, jolloin Maailmannäyttely pidettiin Brysselissä ja Neuhaus kehitti useita reseptejä tämän tärkeän tapahtuman kunniaksi. Näyttelyyn osallistuneiden 43 maan joukosta, Thaimaan näyttelyosasto oli kaikista suosituin. Aasialaisen kulttuurin saavuttaman suuren suosion takia, Neuhaus kehitti \"Pagode\" konvehdin. Tämän konvehdin erityislaatuisen muodon innoittajana on ollut pagodi, yksi tyypillisimmistä aasialaisen arkkitehtuurin ja kulttuurin tunnusmerkeistä.\r\n\"Pagode\" konvehdit koostuvat intensiivisestä tummasta suklaakuorrutuksesta, joka pitää sisällään pehmeää giandujatahnaa ja vahvaa kahviganachea.','pagode suklaa neuhaus','pagode suklaa neuhaus','pagode','2013-06-04 22:44:20','2013-06-04 22:44:20'),(60,31,'en','Chocolate Coffee Beans','Coffee flavoured dark and intense chocolate shaped as coffee beans.','Chocolate Coffee Beans chocolate neuhaus','Chocolate Coffee Beans chocolate neuhaus','chocolate-coffee-beans','2013-06-04 22:46:17','2013-06-04 22:46:43'),(61,31,'fi','Chocolate Coffee Beans','Kahvin makuista tummaa ja intensiivistä suklaata kahvipavuiksi muotoiltuna.','Chocolate Coffee Beans chocolate neuhaus','Chocolate Coffee Beans chocolate neuhaus','chocolate-coffee-beans','2013-06-04 22:46:59','2013-06-04 22:46:59'),(62,32,'en','Baudouin','This royal praline was created to commemorate the marriage of Prince Baudouin and Princess Fabiola, former King and Queen of Belgium, in 1960. Since last century Neuhaus is an official supplier to the Belgian Royal Court.\r\nThe Baudouin praline is composed of milk chocolate with a frothy fresh cream filling, lightly flavoured with vanilla.','baudouin chocolate neuhaus','baudouin chocolate neuhaus','baudouin','2013-06-05 09:41:16','2013-06-05 09:42:39'),(63,32,'fi','Baudouin','Tämä ruhtinaallinen konvehti luotiin prinssi Baudouinin ja prinsessa Fabiolan, edellisen Belgian kuninkaan ja kuningattaren, häiden kunniaksi vuonna 1960. Viime vuosisadalta lähtien Neuhaus on ollut Belgian kuninkaallisen hovin virallinen toimittaja.\r\nBaudouin konvehti koostuu maitosuklaasta ja kuohkeasta kevyesti vaniljalla maustetusta tuoreesta kermasta.','baudouin suklaa neuhaus','baudouin suklaa neuhaus','baudouin','2013-06-05 09:43:06','2013-06-05 09:43:06'),(64,33,'en','Bonbon 13','Neuhaus created the recipe for \"Bonbon 13\" already in 1937. The recipe has remained the same ever since.\r\nThe Bonbon 13 chocolate is the successful marriage between a dark ganache and a hint of rum. The intensity of the dark chocolate in the inner shell, combined with the smoothness of the milk chocolate of the outer shell, is magically complemented by the rich aromas of the rum.','bonbon 13 chocolate neuhaus','bonbon 13 chocolate neuhaus','bonbon-13','2013-06-05 09:47:16','2013-06-05 09:47:41'),(65,33,'fi','Bonbon 13','Neuhaus kehitti \"Bonbon 13\" konvehdin reseptin jo vuonna 1937 ja se on pysynyt samana tähän päivään asti.\r\nBonbon 13 konvehdissa tumma suklaaganache ja hitunen rommia yhdistyvät täydellisesti. Tumman suklaan intensiivisyys yhdistettynä maitosuklaan pehmeyteen on taianomaisesti täydennetty rommin ylellisillä aromeilla. ','bonbon 13 suklaa neuhaus','bonbon 13 suklaa neuhaus','bonbon-13','2013-06-05 09:48:04','2013-06-05 09:48:04'),(66,34,'en','Manon Milk','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nThis milk chocolate Manon is a perfect blend of light butter cream with praliné, enriched with caramelized hazelnut pieces and the sweetness of milk chocolate. The airy sensation of the cream and the original nutty note of the hazelnuts are a surprising combination.','manon milk chocolate neuhaus','manon milk chocolate neuhaus','manon-milk','2013-06-05 09:51:31','2013-06-05 09:52:12'),(67,34,'fi','Manon Milk','\"Manon\" konvehtien sarjan uskotaan saaneen nimensä Jean Neuhausin tyttären, Suzannen, mukaan. Suzanne Neuhaus oli tunnettu oopperalaulaja. Vuonna 1942, hän esiintyi \"Manon Lescautin\" roolissa Jules Massenetin kirjoittamassa kuuluisassa oopperassa nimeltä \"Manon\".\r\nTämä maitosuklaakonvehti on täydellinen yhdistelmä kevyttä kreemiä ja praliinia, jossa on karamellisoitua hasselpähkinärouhetta. Kreemin ilmavuus ja hasselpähkinöiden pähkinäinen maku sointuvat yllättävän hyvin yhteen.','manon milk suklaa neuhaus','manon milk suklaa neuhaus','manon-milk','2013-06-05 09:52:41','2013-06-05 09:52:41'),(68,35,'en','Louise','This smooth milk chocolate praline was named after Louise Agostini, wife of Jean Neuhaus.  Louise inspired her husband in creating the \"ballotin\", a special box designed as elegant wrapping for pralines and which at the same time protects the delicate chocolates during transport. Today, the \"ballotin\" box is adopted by the majority of Belgian chocolatiers as the standard for wrapping chocolates.\r\nThe ganache filling in the praline named Louise is made from smooth origin chocolate from Java and will please chocolate lovers with a sweet tooth.','louise chocolate neuhaus','louise chocolate neuhaus','louise','2013-06-05 09:55:44','2013-06-05 09:56:02'),(69,35,'fi','Louise','Tämä pehmeä maitosuklaakonvehti on nimetty Jean Neuhausin vaimon, Louise Agostinin, mukaan. Louise inspiroi miestään keksimällä \"ballotinin\", rasian, jossa elegantit konvehdin tarjoillaan ja se toimii myös konvehtien suojana kuljetuksissa. Nykyään suurin osa belgialaisista suklaanvalmistajista käyttää \"ballotinia\" konvehtien pakkaamisessa.\r\nLouise konvehdin ganachetäyte on valmistettu pehmeästä Javalta peräisin olevasta suklaasta, joka vetoaa makeaan mieltyneisiin suklaan ystäviin.','louise suklaa neuhaus','louise suklaa neuhaus','louise','2013-06-05 09:56:37','2013-06-05 09:56:37'),(70,36,'en','Frederic','The name of this elegantly decorated chocolate is a tribute to Frédéric Neuhaus, passionate confectioner and son of Jean Neuhaus, founder of Neuhaus Créateur chocolatier.','frederic chocolate neuhaus','frederic chocolate neuhaus','frederic','2013-06-05 10:45:39','2013-06-05 10:46:42'),(71,36,'fi','Frederic','Tämän kauniisti koristellun konvehdin nimi on kunnianosoitus Jean Neuhasin pojalle, Frédéric Neuhausille, intohimoiselle kondiittorille ja Neuhaus Créateur chocolatierin perustajalle.','frederic suklaa neuhaus','frederic suklaa neuhaus','frederic','2013-06-05 10:46:42','2013-06-05 10:59:54'),(72,37,'en','Plaisir','This exclusive chocolate with unique shape is part of the family of \"Irrésistibles\", the star pralines within the Neuhaus range.\r\nThis star chocolate is made of a handmade nougatine biscuit, handfilled with a rich and creamy ganache made from gently roasted hazelnuts all the way from the Black Sea coast region. The nougatine biscuit and filling are covered in creamy milk chocolate.','plaisir chocolate neuhaus','plaisir chocolate neuhaus','plaisir','2013-06-05 11:01:41','2013-06-05 11:02:17'),(73,37,'fi','Plaisir','Tämä ainutlaatuisen muodon omaava eksklusiivinen suklaa on yksi \"Irrésistibles\"-sarjaan kuuluvista konvehdeista, jotka ovat Neuhausin valikoiman suosikkeja.\r\nTämä konvehti on valmistettu käsin tehdystä krokantista ja täytetty täyteläisellä ja kermaisella ganachella, jonka valmistuksessa käytetyt kevyesti paahdetut hasselpähkinät on tuotu Mustanmeren rannikkoalueelta saakka. Krokantti ja täyte ovat kuorrutettu kermaisella maitosuklaalla.','plaisir suklaa neuhaus','plaisir suklaa neuhaus','plaisir','2013-06-05 11:02:43','2013-06-05 11:02:43'),(74,38,'en','Prestige','The Prestige chocolate offers the simplicity of a traditional beige caramel combined with the sweetness of milk chocolate.\r\nCaramel is a mixture produced when granulated sugar is cooked until it melts and becomes a thick, clear liquid that can range in colour from golden to deep brown.','prestige chocolate neuhaus','prestige chocolate neuhaus','prestige','2013-06-05 11:07:00','2013-06-05 11:07:52'),(75,38,'fi','Prestige','Prestige konvehdissa perinteinen beige karamelli on yhdistetty makeaan maitosuklaaseen.\r\nKaramelli on sekoitus, joka syntyy kun kidesokeria keitetään, kunnes se sulaa ja muuttuu paksuksi kirkkaaksi nesteeksi, joka voi väriltään olla kultaisesta syvään ruskeaan.','prestige suklaa neuhaus','prestige suklaa neuhaus','prestige','2013-06-05 11:08:19','2013-06-05 11:08:19'),(76,39,'en','Napoleonette','The Napoleonette praline is a smooth milk chocolate with a praliné filling. To achieve a rich and tasteful praliné, all nuts are roasted in our chocolate atelier. The filling is finished with a hint of fresh coffee, which brings a delectable blend of delicacy and strength.','napoleonette chocolate neuhaus','napoleonette chocolate neuhaus','napoleonette','2013-06-05 11:32:07','2013-06-05 11:32:48'),(77,39,'fi','Napoleonette','Napoleonette konvehti on suussa sulava maitosuklaa praliinitäytteellä. Täyteläinen ja maukas praliini saadaan aikaan paahtamalla kaikki pähkinät suklaapuodissamme. Täyte viimeistellään häiväyksellä tuoretta kahvia, joka tuo konvehtiin viehättävän vahvan säväyksen.','napoleonette suklaa neuhaus','napoleonette suklaa neuhaus','napoleonette','2013-06-05 11:33:18','2013-06-05 11:33:18'),(78,40,'en','Tentation','Tentation, along with Caprice, is the icon praline that was created for the occasion of the World Exhibition held in Brussels in 1958. Today, Tentation is still a star praline within the Neuhaus range. The names Tentation and Caprice refer to a quote by the French star actress Brigitte Bardot.\r\nThis legendary chocolate consists of a traditional nougatine biscuit and is handfilled with a coffee ganache. The filled nougatine biscuit is covered in a creamy milk chocolate.','tentation chocolate neuhaus','tentation chocolate neuhaus','tentation','2013-06-05 11:38:21','2013-06-05 11:38:52'),(79,40,'fi','Tentation','Tentation, kuin myös Caprice, ovat ikonin aseman saavuttaneet konvehdit, jotka luotiin Brysselin maailmannäyttelyä varten vuonna 1958. Edelleenkin tänä päivänä, Tentation on suosittu konvehti Neuhausin valikoimassa. Nimet Caprice ja Tentation viittaavat tunnetun ranskalaisen näyttelijän, Brigitte Bardotin, sitaattiin.\r\nTämä legendaarinen konvehti koostuu perinteisestä krokantista, joka on käsin täytetty kahviganachella ja lopuksi kuorrutettu kermaisella maitosuklaalla.','tentation suklaa neuhaus','tentation suklaa neuhaus','tentation','2013-06-05 11:39:21','2013-06-05 11:39:21'),(80,41,'en','Othello','This praline is combines frothy coffee fresh cream with subtle notes of melt-in-the-mouth roasted hazelnut gianduja.','othello chocolate neuhaus','othello chocolate neuhaus','othello','2013-06-05 13:40:40','2013-06-05 13:41:31'),(81,41,'fi','Othello','Tämä konvehti yhdistää kuohkean kahvikerman ja suussa sulavan paahdetuista hasselpähkinöistä valmistetun giandujan.','othello chocolate neuhaus','othello chocolate neuhaus','othello','2013-06-05 13:41:53','2013-06-05 13:41:53'),(82,42,'en','Millénaire','The Millénaire chocolate is covered in smooth milk chocolate and holds a filling of gianduja enriched with crisped rice, which lends a surprising crispy note to the otherwise perfectly smooth texture of the gianduja. For its gianduja, Neuhaus uses hazelnuts from the Black Sea coast region.','millenaire chocolate neuhaus','millenaire chocolate neuhaus','millenaire','2013-06-05 13:50:16','2013-06-05 13:56:40'),(83,42,'fi','Millénaire','Millénaire konvehti on kuorrutettu pehmeällä maitosuklaalla ja pitää sisällään gianduja-täytteen. Täytteessä on rapeita riisimuroja, joka tuo yleensä hyvin pehmeään giandujaan yllättävän rapean piirteen. Neuhaus käyttää giandujaansa Mustanmeren rannikkoalueelta tuotuja hasselpähkinöitä.','Millénaire suklaa neuhaus','Millénaire suklaa neuhaus','millenaire','2013-06-05 13:51:52','2013-06-05 13:57:04'),(84,43,'en','mill',NULL,NULL,NULL,'mill-1','2013-06-05 13:55:28','2013-06-05 13:55:28'),(85,44,'en','Méphisto','The Méphisto praline has a sweet milk chocolate shell and is filled with a praliné made from hazelnuts all the way from the Black Sea coast region. The flavour of freshly roasted and caramelised hazelnuts is enhanced by crunchy little hazelnut pieces.','Méphisto chocolate neuhaus','Méphisto chocolate neuhaus','mephisto','2013-06-05 13:58:47','2013-06-05 14:01:08'),(86,44,'fi','Méphisto','Méphisto konvehdissa on makea maitosuklaakuorrute, jonka täyttää Mustanmeren rannikkoalueelta saakka tuoduista hasselpähkinöistä valmistettu praliini. Tuoreeltaan paahdettujen ja karamellisoitujen hasselpähkinöiden makua on tehostettu hasselpähkinärouheella.','Méphisto suklaa neuhaus','Méphisto suklaa neuhaus','mephisto','2013-06-05 14:01:26','2013-06-05 14:04:19'),(87,45,'en','Sapho','The praline Sapho is a wonderful combination of delicate milk chocolate and a smooth praliné made from Californian almonds that are roasted in our chocolate atelier. The roasted almonds give the praliné filling in this chocolate its exquisite and perfectly balanced flavour.','sapho chocolate neuhaus','sapho chocolate neuhaus','sapho','2013-06-05 14:05:41','2013-06-05 14:06:10'),(88,45,'fi','Sapho','Sapho konvehti on ihana yhdistelmä herkullista maitosuklaata ja pehmeää kalifornialaisista paahdetuista manteleista valmistettua praliinia. Paahdetut mantelit antavat praliinille erityislaatuisen ja täydellisessä tasapainossa olevan maun.','sapho suklaa neuhaus','sapho suklaa neuhaus','sapho','2013-06-05 14:06:27','2013-06-05 14:06:27'),(89,46,'en','Astrid','The recipe for this chocolate is one of the oldest within the Neuhaus range and dates back to 1937. This praline is a tribute to princess Astrid of Sweden, who was Queen of the Belgians as wife of King Leopold III. She tragically lost life during a holiday in the Swiss mountains, but will always remain in the heart of the Belgian people as a loving and caring Queen.\r\nThis royal praline is composed of a traditional gianduja made with hazelnuts all the way from the Black Sea coast region. The gianduja paste is blended with a knob of fresh butter to achieve an even smoother, melt-in-the-mouth texture. As a finishing touch, the praline is coated in a thin sugar glazing.','astrid chocolate neuhaus','astrid chocolate neuhaus','astrid','2013-06-05 14:28:04','2013-06-05 14:28:29'),(90,46,'fi','Astrid','Tämän konvehdin resepti on yksi Neuhausin valikoiman vanhimmista, vuodelta 1937. Tämä konvehti on kehitetty muistoksi Ruotsin prinsessa Astridille, josta tuli Belgian kuningatar naituaan kuningas Leopold III:nnen. Hän menehtyi traagisesti lomaillessaan Sveitsin vuoristossa. Belgialaiset tulevat aina muistamaan hänet rakastavana ja huolehtivana kuningattarena.\r\nTämä ruhtinaallisen konvehdin sisällä on perinteisestä giandujaa, johon käytetyt hasselpähkinät ovat tuotu Mustanmeren rannikkoalueelta saakka. Giandujatahna on sekoitettu nokareeseen tuoretta voita, jotta siihen on saatu vielä pehmeämpi ja suussa sulavampi rakenne. Lopuksi Astrid pyöritellään kevyesti sokerissa, joka antaa konvehdille sen loppusilauksen.','astrid suklaa neuhaus','astrid suklaa neuhaus','astrid','2013-06-05 14:29:16','2013-06-05 14:29:36'),(91,47,'en','Bloc Gianduja','Enjoy this Bloc of pure gianduja paste.  You will appreciate the pure flavour of this carefully balanced and perfectly smooth blend of hazelnuts, almonds and Neuhaus chocolate.','Bloc Gianduja chocolate neuhaus','Bloc Gianduja chocolate neuhaus','bloc-gianduja','2013-06-05 14:33:34','2013-06-05 14:34:19'),(92,47,'fi','Bloc Gianduja','Nauti aidosta giandujan mausta. Tulet arvostamaan tarkoin valikoitujen hasselpähkinöiden, manteleiden ja Neuhausin suklaan pehmeää yhdistelmää ja täydellistä makua.','Bloc Gianduja suklaa neuhaus','Bloc Gianduja suklaa neuhaus','bloc-gianduja','2013-06-05 14:34:35','2013-06-05 14:34:35'),(93,48,'en','Cornet Doré','The delicious flavour and melt-in-the-mouth texture of the gianduja in this Cornet Dore is accomplished through a secret recipe that makes this golden chocolate a true delight.\r\nThe praline Cornet Doré consists purely of melt-in-the-mouth gianduja paste, elegantly swirled into a golden cornet. The gianduja is made with hazelnuts from the Black Sea coast region and almonds all the way from California.','Cornet Doré chocolate neuhaus','Cornet Doré chocolate neuhaus','cornet-dore','2013-06-05 14:37:32','2013-06-05 14:39:23'),(94,48,'fi','Cornet Doré','Giandujan herkullinen maku ja suussa sulava rakenne on saavutettu Cornet Doressa salaisen reseptin avulla, jonka ansiosta tämä kultainen konvehti on todellinen nautinto.\r\nCornet Doré konvehti koostuu täysin suussa sulavasta giandujatahnasta, joka on elegantisti kääritty kultaiseen kornettiin. Gianduja on valmistettu Mustanmeren rannikkoalueelta tuoduista hasselpähkinöistä ja kalifornialaisista manteleista.','Cornet Doré suklaa neuhaus','Cornet Doré suklaa neuhaus','cornet-dore','2013-06-05 14:41:06','2013-06-05 14:41:06'),(95,49,'en','Mendiant Milk','This simple yet delicious classic in the family of confectionery consists of smooth milk chocolate and inclusions of dried fruits and roasted nuts.','Mendiant Milk chocolate neuhaus','Mendiant Milk chocolate neuhaus','mendiant-milk','2013-06-05 14:41:58','2013-06-05 14:42:27'),(96,49,'fi','Mendiant Milk','Tämä yksinkertainen, mutta herkullinen konditoriatuotteiden klassikko koostuu pehmeästä maitosuklaasta, johon on lisätty kuivatettuja hedelmiä ja paahdettuja pähkinöitä.','Mendiant Milk suklaa neuhaus','Mendiant Milk suklaa neuhaus','mendiant-milk','2013-06-05 14:45:24','2013-06-05 14:45:24'),(97,50,'en','1857','The name of this praline with playful shape and colourful orange tip refers to the year when Jean Neuhaus opened his first store in the fabulous glass covered Queen\'s Gallery in Brussels.\r\n1857 is a milk chocolate filled with speculoos praliné. Speculoos is a traditional Belgian biscuit that brings back nostalgic childhood memories for many people.','1857 chocolate neuhaus','1857 chocolate neuhaus','1857','2013-06-05 14:45:58','2013-06-05 14:46:32'),(98,50,'fi','1857','Tämän leikkisän muodon ja värikkään oranssin kärjen omaavan konvehdin nimi viittaa vuoteen, jolloin Jean Neuhaus avasi ensimmäisen putiikkinsa upealla lasitetulla Queen\'s Galleryllä Brysselissä.\r\n1857 on maitosuklaa täytettynä Speculoos-keksipraliinilla. Speculoos on perinteinen belgialainen murokeksi, joka palauttaa nostalgisia muistoja mieleen monille.','1857 suklaa neuhaus','1857 suklaa neuhaus','1857','2013-06-05 14:46:59','2013-06-05 14:46:59'),(99,51,'en','Zenith','Behind the sturdy looks of the Zenith chocolate, hides a melt-in-the-mouth gianduja filling enhanced with lightly grilled hazelnut pieces. The filling is covered with a thin layer of smooth milk chocolate.','zenith chocolate neuhaus','zenith chocolate neuhaus','zenith','2013-06-05 14:49:59','2013-06-05 14:50:19'),(100,51,'fi','Zenith','Jykevän näköisen Zenith konvehdin sisällä piilee suussa sulava gianduja-täyte, jonka seassa on kevyesti paahdettua hasselpähkinärouhetta. Täyte on kuorrutettu ohuella kerroksella pehmeää maitosuklaata.','zenith suklaa neuhaus','zenith suklaa neuhaus','zenith','2013-06-05 14:50:41','2013-06-05 14:50:41'),(101,52,'en','Horta','The milk chocolate Horta, with its original and elegant shape, is filled with a surprising praliné enriched with nougat pieces that give a luxury touch to the texture of the praliné and lend it a subtle flavour.','Horta chocolate neuhaus','Horta chocolate neuhaus','horta','2013-06-05 14:58:15','2013-06-05 14:58:38'),(102,52,'fi','Horta','Ainutlaatuisesti ja elegantisti muotoiltu Horta on maitosuklaakonvehti, joka on täytetty yllättävällä nougatrouhetta sisältävällä praliinilla.','Horta suklaa neuhaus','Horta suklaa neuhaus','horta','2013-06-05 14:58:58','2013-06-05 14:58:58'),(103,53,'en','Coeur Praline Milk','The smooth texture of this praliné made from California almonds and hazelnuts from the Black Sea region enhances the soft and sweet character of this smooth milk chocolate.\r\nThis romantic heart-shaped chocolate wrapped in a tempting red paper is a pleasure to give and receive.','Coeur Praline Milk chocolate neuhaus','Coeur Praline Milk chocolate neuhaus','coeur-praline-milk','2013-06-05 15:01:35','2013-06-05 15:02:47'),(104,53,'fi','Coeur Praline Milk','Kalifornialaisista manteleista ja Mustanmeren rannikkoalueelta tuoduista hasselpähkinöistä valmistetun praliinin pehmeä rakenne korostaa tämän maitosuklaakonvehdin makeaa ja lempeää luonnetta.\r\nTämä sydämenmuotoinen, houkuttelevalla punaisella käärepaperilla päällystetty konvehti, on ilo antaa  saada lahjaksi.','Coeur Praline Milk suklaa neuhaus','Coeur Praline Milk suklaa neuhaus','coeur-praline-milk','2013-06-05 15:03:48','2013-06-05 15:03:48'),(105,54,'en','Manon Choco Vanille','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nThis elegant white chocolate Manon is filled with a butter cream enriched with vanilla and crowned with a whole pecan nut. With its signature \"N\", this praline is one of the classics among Neuhaus pralines.','Manon Choco Vanille chocolate neuhaus','Manon Choco Vanille chocolate neuhaus','manon-choco-vanille','2013-06-05 19:50:44','2013-06-05 20:21:14'),(106,54,'fi','Manon Choco Vanille','\"Manon\" konvehtien sarjan uskotaan saaneen nimensä Jean Neuhausin tyttären, Suzannen, mukaan. Suzanne Neuhaus oli tunnettu oopperalaulaja. Vuonna 1942, hän esiintyi \"Manon Lescautin\" roolissa Jules Massenetin kirjoittamassa kuuluisassa oopperassa nimeltä \"Manon\". \r\nTämä elegantti valkoinen suklaakonvehti on täytetty vaniljakreemillä ja kokonaisella pekaanipähkinällä. Tämä konvehti on yksi Neuhausin klassikoista ja on koristeltu Neuhausin etumerkinnällä, kirjaimella “N”.','Manon Choco Vanille suklaa neuhaus','Manon Choco Vanille suklaa neuhaus','manon-choco-vanille','2013-06-05 20:21:42','2013-06-05 20:21:42'),(107,55,'en','Aphrodite','This chocolate with divine name reveals all the lightness of perfectly whipped fresh cream with vanilla, on a layer of melt-in-the-mouth gianduja.  The white chocolate emphasises the lightness and sweetness of this praline.','Aphrodite chocolate neuhaus','Aphrodite chocolate neuhaus','aphrodite','2013-06-05 20:24:03','2013-06-05 20:24:30'),(108,55,'fi','Aphrodite','Tämä jumalaisen nimen omaava konvehti pitää sisällään keveää vaniljakermaa suussa sulavan giandujakerroksen päällä. Valkoinen suklaakuorrutus korostaa praliinin makeutta ja keveyttä. ','Aphrodite suklaa neuhaus','Aphrodite suklaa neuhaus','aphrodite','2013-06-05 20:24:52','2013-06-05 20:24:52'),(109,56,'en','Diane','This white chocolate reveils an airy dark chocolate mousse, on a thin layer of melt-in-the-mouth gianduja paste made from hazelnuts all the way from the Black Sea coast region.','diane chocolate neuhaus','diane chocolate neuhaus','diane','2013-06-05 20:27:05','2013-06-05 20:27:27'),(110,56,'fi','Diane','Tämä valkoinen suklaa pitää sisällään ilmavaa tummaa suklaamoussea ja ohuen kerroksen suussa sulavaa Mustanmeren rannikkoalueelta tuoduista hasselpähkinöistä tehtyä giandujaa.','diane suklaa neuhaus','diane suklaa neuhaus','diane','2013-06-05 20:27:46','2013-06-05 20:27:46'),(111,57,'en','Millionaire','The Millionaire chocolate is covered in white chocolate and holds a filling of gianduja enriched with crisped rice, which lends a surprising crunchy note to the otherwise perfectly smooth texture of the gianduja.','Millionaire chocolate neuhaus','Millionaire chocolate neuhaus','millionaire','2013-06-05 20:30:01','2013-06-05 20:30:29'),(112,57,'fi','Millionaire','Millionaire konvehti on kuorrutettu valkoisella suklaalla, joka pitää sisällään riisimuroja sisältävää giandujaa. Riisimurot tuovat yllättävän rapean säväyksen muuten niin pehmeään giandujan rakenteeseen.','Millionaire suklaa neuhaus','Millionaire suklaa neuhaus','millionaire','2013-06-05 20:30:53','2013-06-05 20:30:53'),(113,58,'en','mill',NULL,NULL,NULL,'mill-2','2013-06-05 20:32:55','2013-06-05 20:32:55'),(114,59,'en','Passion Amande','The Passion Amande chocolate reveals a variation on the traditional gianduja by using grilled, caramelised and lightly salted almonds. Combined with white chocolate, this sweet and salty blend conveys a wonderfully full and rounded flavour.','passion amande chocolate neuhaus','passion amande chocolate neuhaus','passion-amande','2013-06-05 20:34:18','2013-06-05 20:34:57'),(115,59,'fi','Passion Amande','Passion Amande konvehdissa on käytetty muunnelmaa perinteisestä giandujasta. Siihen on käytetty paahdettuja, karamellisoituja ja kevyesti suolattuja manteleita. Yhdistettynä valkoiseen suklaakuorrutukseen, tämä makean ja suolaisen yhdistelmä muodostaa upean täyteläisen makuelämyksen.','passion amande suklaa neuhaus','passion amande suklaa neuhaus','passion-amande','2013-06-05 20:35:22','2013-06-05 20:35:22'),(116,60,'en','Manon Choco Café','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nWith all the richness of fresh coffee butter cream and a whole pecan nut decoration, this creamy white chocolate Manon, decorated with a coffee flavoured chocolate in the shape of a coffee bean, is one of the classics among the assortment of Neuhaus pralines.','Manon Choco Café chocolate neuhaus','Manon Choco Café chocolate neuhaus','manon-choco-cafe','2013-06-05 20:56:31','2013-06-05 20:57:09'),(117,60,'fi','Manon Choco Café','\"Manon\" konvehtien sarjan uskotaan saaneen nimensä Jean Neuhausin tyttären, Suzannen, mukaan. Suzanne Neuhaus oli tunnettu oopperalaulaja. Vuonna 1942, hän esiintyi \"Manon Lescautin\" roolissa Jules Massenetin kirjoittamassa kuuluisassa oopperassa nimeltä \"Manon\". \r\nTämä valkoinen suklaakonvehti, täyteläisellä pekaanipähkinä-kahvikreemillä ja kahvipavun muotoisella kahvinmakuisella suklaakoristeella, on yksi Neuhausin valikoiman klassikkokonvehdeista.','Manon Choco Café suklaa neuhaus','Manon Choco Café suklaa neuhaus','manon-choco-cafe','2013-06-05 20:58:42','2013-06-05 20:58:42'),(118,61,'en','Troika','This unique creation is a surprising and delicious combination of smooth marzipan and gianduja. Neuhaus marzipan is made with almonds all the way from Faro, Portugal. All marzipan includes a minimum of 50% almonds for a pure marzipan flavour. The elegant coating of candied sugar lends a crunchy finish.','troika chocolate neuhaus','troika chocolate neuhaus','troika','2013-06-05 21:00:38','2013-06-05 21:01:04'),(119,61,'fi','Troika','Tämä ainutlaatuinen luomus on yllättävä ja herkullinen yhdistelmä pehmeää marsipaania ja giandujaa. Neuhausin marsipaani valmistetaan portugalilaisista Faron manteleista. Kaikissa marsipaaneissa on vähintään 50% mantelia, jotta on saavutettu aito marsipaanin maku. Elegantti sokeripeite antaa konvehdille rapsakan loppusilauksen.','troika suklaa neuhaus','troika suklaa neuhaus','troika','2013-06-05 21:01:26','2013-06-05 21:01:26'),(120,62,'en','Truffle Marc de Champagne','Marc de Champagne is a colorless brandy that is produced by distilling the grape skins, seeds and stems that are left from the pressing process in the first stages of Champagne production.\r\nThis truffle with light butter cream is flavoured with authentic Marc de Champagne, and offers a surprising contrast between the intense flavour of dark chocolate and the sweetness of the sugar with which it is dusted. A festive truffle, full of contrasts.','Truffle Marc de Champagne chocolate neuhaus','Truffle Marc de Champagne chocolate neuhaus','truffle-marc-de-champagne','2013-06-05 21:32:27','2013-06-05 21:33:39'),(121,62,'fi','Truffle Marc de Champagne','Marc de Champagne on väritöntä brandya, jota valmistetaan tislaamalla rypäleiden kuoret, siemenet ja varret, jotka jäävät jäljelle shampanjan valmistuksen ensivaiheiden jälkeen. \r\nTämä keveällä kreemillä täytetty tryffeli on maustettu aidolla  Marc de Champagnella. Tryffeli asettaa vastakkain yllättävällä tavalla intensiivisen tumman suklaan ja sen kuorruttamiseen käytetyn makean sokerin. Juhlallinen tryffeli, joka on täynnä kontrasteja.','Truffle Marc de Champagne suklaa neuhaus','Truffle Marc de Champagne suklaa neuhaus','truffle-marc-de-champagne','2013-06-05 21:33:54','2013-07-03 15:15:31'),(122,63,'en','Truffle Cognac','This truffle contains a butter cream that is sublty flavored with Cognac. The typical flavor of the liquor combines perfectly with the dark chocolate coating and the delicate almond chips with which this truffle is coated.\r\nCognac is a brandy that originates from the Cognac region in France and must be made from a mixture of 3 different type of grapes: ugni blanc, folle blanche, and colombard grapes. The wine produced from these grapes is high in acid and low in alcohol and gives Cognac its attractive flavor.','Truffle Cognac chocolate neuhaus','Truffle Cognac chocolate neuhaus','truffle-cognac','2013-06-05 21:37:30','2013-06-05 21:38:14'),(123,63,'fi','Truffle Cognac','Tämä tryffeli sisältää kreemiä, joka on hienovaraisesti maustettu konjakilla. Tyypillinen alkoholin maku yhdistyy täydellisesti kuorrutukseen, jossa on tummaa suklaata ja herkullisia mantelilastuja. \r\nKonjakki on brandy, joka on peräisin Cognac kunnasta Ranskasta. Se valmistetaan kolmesta eri rypälelajikkeesta; ugni blanc, folle blanche ja colombard rypäleistä. Näistä rypäleistä valmistettu viini on erittäin hapokasta ja siinä on matala alkoholipitoisuus ja nämä ominaisuudet antavat konjakille sen houkuttelevan maun. ','Truffle Cognac suklaa neuhaus','Truffle Cognac suklaa neuhaus','truffle-cognac','2013-06-05 21:39:43','2013-07-03 15:15:52'),(124,64,'en','Truffle Coffee','This truffle is a melt-in-the-mouth butter cream, delicately flavored with fresh coffee. The dark chocolate coating is sprinkled with chocolate flakes, which are in perfect harmony with the coffee aroma.\r\nChocolate and coffee are a well-known and successful marriage of intense flavors.','Truffle Coffee chocolate neuhaus','Truffle Coffee chocolate neuhaus','truffle-coffee','2013-06-05 21:41:07','2013-06-05 21:44:36'),(125,64,'fi','Truffle Coffee','Tämä tryffeli on valmistettu suussasulavasta kreemistä, joka on maustettu tuoreella kahvilla. Tumman suklaakuorrutteen päälle on ripoteltu suklaalastuja, jotka ovat täydellisessä harmoniassa kahvin aromin kanssa. \r\nSuklaa ja kahvi ovat tunnetusti intensiivisten makujen loistava yhdistelmä. ','Truffle Coffee suklaa neuhaus','Truffle Coffee suklaa neuhaus','truffle-coffee','2013-06-05 21:44:55','2013-07-03 15:16:17'),(126,65,'en','Truffle Tiramisu','This truffle is a delicious combination of smooth butter cream and Amaretto. As a finishing touch, this dark chocolate-coated truffle is rolled in crunchy Amaretti cookie crumbs.\r\nTiramisu is an Italian dessert famous for its light yet rich texture. The recipe originates from the Siena area in the Northwest of Tuscany, where it was discovered by the famous Medici family and then introduced in Florence and later on the rest of Italy.','tiramisu chocolate neuhaus','tiramisu chocolate neuhaus','truffle-tiramisu','2013-06-05 21:48:36','2013-06-05 21:49:19'),(127,65,'fi','Truffle Tiramisu','Tämä tryffeli on herkullinen yhdistelmä pehmeää kreemiä ja Amarettoa. Se on kuorrutettu tummalla suklaalla ja lopuksi pyöritelty rapeissa Amaretti-keksimuruissa. \r\nTiramisu on italialainen jälkiruoka, joka on tunnettu sen keveästä, mutta samalla täyteläisestä rakenteesta. Alkuperäinen resepti on Sienan alueelta, luoteis-Toscanasta, jossa sen keksi kuuluisa Medici perhe, josta se levisi ensin Florenceen ja sitten koko Italiaan. ','tiramisu suklaa neuhaus','tiramisu suklaa neuhaus','truffle-tiramisu','2013-06-05 21:49:30','2013-07-03 15:16:36'),(128,66,'en','Truffle Butter','This classic Belgian truffle is a melt-in-the-mouth chocolate butter cream coated with dark chocolate, which creates an intense chocolate flavor enhanced by the dusting of cocoa powder.\r\nThe butter truffle is an absolute Belgian classic. The freshness of butter-based fillings creates a taste experience that lingers. Butter fillings tend to be velvety and have a superb melt-in-the-mouth quality.','Truffle Butter chocolate neuhaus','Truffle Butter chocolate neuhaus','truffle-butter','2013-06-05 21:53:07','2013-06-05 21:53:54'),(129,66,'fi','Truffle Butter','Tämä klassinen belgialainen tryffeli on valmistettu suussasulavasta suklaakreemistä ja kuorrutettu tummalla suklaalla ja kaakaojauheella, luoden intensiivisen suklaaelämyksen.\r\nTruffle Butter on todellinen belgialainen klassikko. Voipohjaisen täytteen tuoreus luo makuelämyksen, joka kestää suussa pitkään. Voitäytteillä on tapana olla samettisia ja ihanan suussasulavia.','Truffle Butter suklaa neuhaus','Truffle Butter suklaa neuhaus','truffle-butter','2013-06-05 21:54:09','2013-07-03 15:18:34'),(130,67,'en','Truffle Dark','This dark chocolate truffle is composed of a butter cream enriched with intense pure chocolate. Dark chocolate flakes add an intense flavor sensation that enhances the richness of the filling.\r\nLovers of dark chocolate who are looking for a more bitter than sweet taste experience will be delighted with the simple yet powerful taste of the dark chocolate truffle.','Truffle Dark chocolate neuhaus','Truffle Dark chocolate neuhaus','truffle-dark','2013-06-05 21:56:52','2013-06-05 21:57:58'),(131,67,'fi','Truffle Dark','Tämä tumma suklaatryffeli on valmistettu intensiivisestä suklaakreemistä, joka on kuorrutettu tummasta suklaasta raastetuilla lastuilla. Kuorrutus vahvistaa makuelämyksen syvyyttä ja suklaakreemin täyteläisyyttä. \r\nTumman suklaan ystävät, jotka etsivät enemmänkin kitkerää kuin makeaa makuelämystä, tulevat ilahtumaan tämän suklaatryffelin yksinkertaisesta mutta voimakkaasta mausta. ','Truffle Dark suklaa neuhaus','Truffle Dark suklaa neuhaus','truffle-dark','2013-06-05 21:58:09','2013-07-03 15:20:29'),(132,68,'en','Tablet Dark','An intense dark chocolate with 56% cocoa.','tablet dark chocolate neuhaus','tablet dark chocolate neuhaus','dark','2013-06-05 22:25:58','2013-06-05 22:32:04'),(133,68,'fi','Tumma Suklaalevyt','Intensiivistä 56% tummaa suklaata.','T