:20:05','2013-07-03 15:20:05'),(178,87,'fi','Classic -suklaalajitelma','Jean Neuhaus ja hänen vaimonsa Louise Agostini kehittivät “ballotin” eli suklaarasian vuonna 1915. Rasiassa konvehdit ovat entistä houkuttelevampia ja se suojaa niitä niiden matkalla suklaapuodista onnekkaalle vastaanottajalleen. \r\n\r\nClassic –suklaalajitelma tarjoaa maittavan valikoiman praliini-, ganache- ja gianduja -täytteisiä konvehteja, jotka vetoavat varmasti jokaiseen suklaan ystävään. Konvehtirasia on saatavilla monessa eri koossa.','Classic -suklaalajitelma neuhaus','Classic -suklaalajitelma neuhaus','classic-assortment','2013-07-03 15:21:43','2013-11-27 13:50:05'),(179,88,'fi','Truffle -suklaalajitelma','Jean Neuhaus ja hänen vaimonsa Louise Agostini kehittivät “ballotin” eli suklaarasian vuonna 1915. Rasiassa konvehdit ovat entistä houkuttelevampia ja se suojaa niitä niiden matkalla suklaapuodista onnekkaalle vastaanottajalleen. \r\n\r\nTruffle –suklaalajitelma sisältää valikoiman erilaisia suklaatryffeleitä, joiden täytteenä on suklaakreemiä. Täytteen makuina on mm. classic, extra tumma, kahvi, tiramisu, konjakki ja Marc de Champagne.','Truffle -suklaalajitelma neuhaus ballotin','Truffle -suklaalajitelma neuhaus ballotin','truffle-assortment','2013-07-03 15:23:37','2013-07-03 15:31:04'),(180,89,'fi','All White -suklaalajitelma','Jean Neuhaus ja hänen vaimonsa Louise Agostini kehittivät “ballotin” eli suklaarasian vuonna 1915. Rasiassa konvehdit ovat entistä houkuttelevampia ja se suojaa niitä niiden matkalla suklaapuodista onnekkaalle vastaanottajalleen. \r\n\r\nAll White –suklaalajitelma sisältää valikoiman kermaisella valkosuklaalla kuorrutettuja konvehteja. Tämä eksklusiivinen suklaalajitelma on täydellinen lahja intohimoisille valkosuklaan ystäville.','All White -suklaalajitelma chocolate neuhaus','All White -suklaalajitelma chocolate neuhaus','all-white-assortment','2013-07-03 15:32:26','2013-07-03 15:33:59'),(181,90,'fi','All Milk -suklaalajitelma','Jean Neuhaus ja hänen vaimonsa Louise Agostini kehittivät “ballotin” eli suklaarasian vuonna 1915. Rasiassa konvehdit ovat entistä houkuttelevampia ja se suojaa niitä niiden matkalla suklaapuodista onnekkaalle vastaanottajalleen. \r\n\r\nAll Milk –suklaalajitelma sisältää valikoiman pehmeällä maitosuklaalla kuorrutettuja konvehteja. Tämä eksklusiivinen suklaalajitelma on täydellinen lahja intohimoisille maitosuklaan ystäville. ','All Milk -suklaalajitelma neuhaus','All Milk -suklaalajitelma neuhaus','all-milk-assortment','2013-07-03 15:34:57','2013-07-03 15:34:57'),(182,92,'fi','Truffle Glamour','Tämä trendikkään oranssi konvehtirasia sisältää herkullisia tryffeleitä kuudessa eri maussa: classic, extra tumma, kahvi, tiramisu, konjakki, Marc de Champagne. Rasiassa on 12 konvehtia.','Truffle Glamour neuhaus chocolate','Truffle Glamour neuhaus chocolate','truffle-glamour','2013-07-03 15:35:21','2013-07-03 15:35:21'),(183,93,'fi','Irrésistibles','Neuhausin valikoiman suurimmat suosikit, konvehtien ikonit, ovat 100% käsintehtyjä. Suklaalajitelma koostuu perinteisistä käsin valmistetuista nougatine-konvehdeista, jotka on täytetty pehmeällä tuoreella kermalla tai ganachella ja kuorrutettu tummalla suklaalla tai maitosuklaalla. Tämä suklaarasia sisältää 12 konvehtia.  ','Irrésistibles neuhaus suklaa','Irrésistibles neuhaus suklaa','irresistibles','2013-07-03 15:36:00','2013-07-03 15:36:14'),(184,94,'fi','Red Heart','Tämä kaunis, kirkkaanpunainen ja sydämenmuotoinen suklaarasia sisältää valikoiman konvehtisuosikkejamme. Yllätä rakkaimpasi valikoimalla tummia, maito- ja valkosuklaakonvehteja, jotka on täytetty praliinilla, ganachella ja giandujalla. Suklaarasia sisältää 10 konvehtia.','Red Heart neuhaus chocolate','Red Heart neuhaus chocolate','red-heart','2013-07-03 15:36:38','2013-07-03 15:36:38'),(185,95,'fi','Square Tin Box','Tämä elegantti tinarasia sisältää valikoiman ajattomia suklaakonvehteja, joiden täytteenä on käytetty täyteläistä praliinia, intensiivistä ganachea ja suussa sulavaa giandu