nt. This mini version of the original ballotin is the perfect favour for your guests.\r\n\r\nThe mini ballotin box includes two exquisite Neuhaus chocolates. It is the perfect gift to surprise your guests. They will be delighted with this small attention, to take home or to enjoy immediately.','Mini Ballotin Neuhaus','Mini Ballotin Neuhaus','mini-ballotin','2013-07-19 13:32:16','2013-07-19 13:32:55'),(190,100,'en','All Dark Assortment','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient.\r\n\r\nThe All Dark assortment ballotin box includes a selection of chocolates coated in an intense dark chocolate. This exclusive assortment box is the perfect gift for those passionate about pure dark chocolates.','All Dark Assortment neuhaus','All Dark Assortment neuhaus','all-dark-assortment','2013-07-19 13:40:18','2013-07-24 13:09:10'),(191,101,'en','Carré Assortment','Discover the skill and finesse of exclusive Neuhaus chocolate recipes through these individually wrapped squares of chocolate, traditionally served with coffee. This compact box includes an assortment of 18 individually wrapped square chocolates and is the perfect small gift. This assortment contains 18 individually wrapped chocolates.','Carré Assortment neuhaus','Carré Assortment neuhaus','carre-assortment','2013-07-20 13:10:43','2013-07-20 13:11:37'),(192,102,'en','Multipack Bars','Discover the authentic recipes from Neuhaus in our classic chocolate bars, the perfect snack for an intense tasting moment. This assortment contains 8 bars.','Multipack Bars neuhaus','Multipack Bars neuhaus','multipack-bars','2013-07-20 13:12:46','2013-07-20 13:13:28'),(193,103,'en','Earl Grey','A symphony of robust Assam leaves with a light liquoring of cold-pressed, Italian Bergamot citrus. Our blend of this classic tea has been carefully crafted to define how an Earl Grey should taste. Deeply aromatic with a bold flavor.','Tea Forte Earl Gray','Tea Forte Earl Gray','earl-grey-teabag','2013-07-23 12:43:40','2013-07-23 13:08:00'),(194,104,'en','Earl grey',NULL,NULL,NULL,'earl-grey-1','2013-07-23 13:05:29','2013-07-23 13:05:29'),(195,105,'en','English Breakfast','A robust full-bodied cup with a concentrated character of malt and deep undertones that welcome a bit of milk and sugar. Satisfying and delicious, this tea is a great breakfast cup that can be enjoyed throughout the day.','English Breakfast Tea Forte','English Breakfast Tea Forte','english-breakfast-teabag','2013-07-23 13:08:58','2013-07-23 13:10:09'),(196,106,'en','White Ginger Pear','Rarest Pai Mu Tan white tea is plucked in early spring from a special varietal tea bush called “chaicha”. Blended with the sweet taste of juicy orchard fresh pear and the tingle of spicy ginger for a delicate and delighting infusion.','White Ginger Pear Tea Forte','White Ginger Pear Tea Forte','white-ginger-pear-teabag','2013-07-23 13:19:36','2013-07-24 12:24:32'),(197,107,'en','African Solstice','From the soul of South Africa, naturally caffeine-free, antioxidant-rich rooibos herb blended with the taste of berries, blossoms, and a wisp of sweet vanilla. A smooth and delicious cup.','African Soltice Tea Forte','African Soltice Tea Forte','african-soltice-teabag','2013-07-23 15:00:25','2013-07-30 13:12:22'),(198,108,'en','Jasmine Green','Rare and exceptional Yin Hao green tea is married with intoxicatingly fragrant jasmine blossoms. The scenting of the tea is a meticulous process taking several days, resulting in an exquisite cup of sublime, sweet flavor.','Jasmine Green Tea Bag','Jasmine Green Tea Bag','jasmine-green-teabag','2013-07-23 15:04:15','2013-07-23 15:04:53'),(199,109,'en','Ginger Lemongrass','A soothing, multi-layered blend radiating with sunny citrus notes enlivened with the tingle of ginger. A fruity, bright cup with a sweet lingering aftertaste.','Ginger Lemongrass Tea Forte','Ginger Lemongrass Tea Forte','ginger-lemongrass','2013-07-23 15:08:13','2013-07-23 15:08:57'),(200,21,'fi','Fabiola','Tämä ruhtinaallinen konvehti luotiin prinssi Baudoinin ja prinsessa Fabiolan, edellisen Belgian kuninkaan ja kuningattaren, häiden kunniaksi vuonna 1960. Belgian kuninkaallisen hovin virallisena toimittajana, Neuhaus on vielä tänäkin päivänä tiiviissä yhteistyössä Belgian kuninkaallisen perheen kanssa.\r\nFabiola konvehti koostuu tummasta suklaakuoresta ja täytteenä on kerros tuoretta vaniljakermaa ja tummaa suklaaganachea. Suklaan täyteläisyyden ja täytteen kuohkeuden kontrasti luovat ilahduttavan makuelämyksen.','fabiola suklaa neuhaus','fabiola suklaa neuhaus','fabiola','2013-07-24 12:58:52','2013-07-24 12:58:52'),(201,107,'fi','African Solstice','Etelä-Afrikan sydämestä, luonnollisesti kofeiiniton ja täynnä antioksidantteja. Rooibos-yrttiä sekoitettuna marjoihin, kukkiin ja häivähdykseen makeaa vaniljaa synnyttää pehmeän ja herkullisen kupillisen.','African Soltice Tea Forte','African Soltice Tea Forte','african-soltice-teabag','2013-07-24 13:01:10','2013-07-30 13:13:08'),(202,103,'fi','Earl Grey','Täyteläisten Assam-lehtien ja kylmäpuristetun italialaisen Bergamot-sitruksen mahtava yhdistelmä. Sekoituksemme tästä klassisesta teestä on huolella valmistettu luonnehtimaan sitä miltä Earl Greyn tulisi maistua. Aromaattinen ja vahva maku.','Tea Forte Earl Gray','Tea Forte Earl Gray','earl-grey-teabag','2013-07-24 13:01:21','2013-07-30 13:12:50'),(203,105,'fi','English Breakfast','Täyteläinen kupillinen, jossa laadukkaan maltaan syvän häivähdyksen mieluusti pehmentää maidolla ja sokerilla. Tyydyttävä ja herkullinen tee, joka on täydellinen aamupalalla, mutta sitä voi hyvin nauttia pitkin päivää. ','English Breakfast Tea Forte','English Breakfast Tea Forte','english-breakfast-teabag','2013-07-24 13:01:30','2013-07-30 13:13:35'),(204,109,'fi','Inkivääri-sitruunaruoho','Rauhoittava sekoitus aurinkoisia sitrushedelmiä ja kihelmöivää inkivääriä. 