laalajitelma neuhaus','assortment-milk','2013-07-24 13:05:36','2013-07-30 12:57:16'),(209,96,'fi','Dark, Milk, White -suklaalajitelma','Yllätä isä herkullisella valikoimalla konvehteja.\r\n\r\nTämä kaunis punainen rasia sisältää maukkaan valikoiman tumma-, maito- ja valkosuklaakonvehteja, jotka on täytetty praliinilla, ganachella ja giandujalla. Täydellinen lahja kaikenlaisen suklaan ystävälle.\r\n\r\nTämä lajitelma sisältää 20 konvehtia.','Dark, Milk, White -suklaalajitelma neuhaus','Dark, Milk, White -suklaalajitelma neuhaus','assortment-dark-milk-white','2013-07-24 13:05:47','2013-07-30 12:59:54'),(210,101,'fi','Carré -suklaalajitelma','Tutustu Neuhausin taidokkaisiin ja hienovaraisiin suklaaresepteihin näiden yksittäispakattujen suklaaneliöiden kautta, jotka tarjoillaan perinteisesti kahvin kera. Tämä rasia sisältää 18 yksittäispakattua suklaaneliötä ja se on loistava pieni lahja.','Carré -suklaalajitelma neuhaus','Carré -suklaalajitelma neuhaus','carre-assortment','2013-07-24 13:06:15','2013-07-30 13:05:59'),(211,99,'fi','Mini Ballotin','Jean Neuhaus ja hänen vaimonsa Louise Agostini kehittivät “ballotin” eli suklaarasian vuonna 1915. Rasiassa konvehdit ovat entistä houkuttelevampia ja se suojaa niitä niiden matkalla suklaapuodista onnekkaalle vastaanottajalleen.\r\n\r\nMini-konvehtirasia sisältää kahdenlaisia erinomaisia Neuhaus-suklaita. Se on täydellinen lahja vieraille, joko syötäväksi saman tien tai vietäväksi kotiin lähtiessä. Saatavana yksinomaan Neuhausin myymälöistä.','Mini Ballotin Neuhaus','Mini Ballotin Neuhaus','mini-ballotin','2013-07-24 13:06:40','2013-08-30 10:24:27'),(212,102,'fi','Patukkapaketit','Neuhausin aidoilla resepteillä valmistetut suklaat löytyvät myös patukkoina. Täydellisiä pikkupurtavia makeannälkään. Tämä lajitelma sisältää 8 patukkaa. ','Patukkapaketit neuhaus','Patukkapaketit neuhaus','multipack-bars','2013-07-24 13:07:03','2013-07-30 13:08:43'),(213,110,'en','111',NULL,NULL,NULL,'111','2013-07-25 09:11:25','2013-07-25 09:11:25'