INSERT INTO `spree_products` VALUES (2,'Adelson','This praline is named after Adelson de Gavre, husband of Suzanne Neuhaus and son in law to Jean Neuhaus. It was Adelson de Gavre who created the star pralines \"Caprice\" and \"Tentation\" for the occasion of the World Exhibition held in Brussels in 1958.\r\nThe recipe of the Adelson is unique because the praliné filling is made according to the tradition of old style praliné, which means that it is made solely out of roasted hazelnuts and sugar, without any chocolate. The chocolate is used only in the coating and as such, superbly enhances the exquisite flavour of the Turkish hazelnuts.','2013-06-04 00:00:00',NULL,'adelson','adelson chocolate','adelson chocolate',NULL,727197546,'2013-06-04 11:52:55','2013-09-11 20:23:25'),(3,'Albert','This royal praline was created to commemorate the marriage of Prince Albert and Princess Paola, the present sovereigns of Belgium, in 1959. Since last century, Neuhaus is an official supplier to the Belgian Royal Court.\r\nThe Albert chocolate is filled with a praliné made of hazelnuts all the way from the Black Sea coast region. This chocolate also hides a whole caramelized hazelnut in the centre, an exquisite and delicious surprise.','2013-06-04 00:00:00',NULL,'albert','albert chocolate neuhaus','albert chocolate neuhaus',NULL,727197546,'2013-06-04 13:00:57','2013-12-14 19:22:57'),(4,'Art Deco','The strong, 72% cocoa mass dark chocolate in Art Déco is beautifully balanced with praliné from Californian almonds and nougat pieces.','2013-06-04 00:00:00',NULL,'art-deco','art deco chocolate neuhaus','art deco chocolate neuhaus',NULL,727197546,'2013-06-04 13:07:21','2013-12-14 19:22:57'),(5,'Figaro','The strong, 72% cocoa mass dark chocolate in Art Déco is beautifully balanced with praliné from Californian almonds and nougat pieces.','2013-06-04 00:00:00',NULL,'figaro','figaro chocolate neuhaus','figaro chocolate neuhaus',NULL,727197546,'2013-06-04 14:53:12','2013-11-05 15:04:41'),(6,'Florentins','Sometimes just a few well chosen ingredients can be enough to create a widely loved product. The recipe for these Florentins is genial in its simplicity. Neuhaus Florentins carry slightly caramelized flaked almonds on a layer of dark chocolate.','2013-06-04 00:00:00',NULL,'florentins','florentins chocolate neuhaus','florentins chocolate neuhaus',NULL,727197546,'2013-06-04 14:58:29','2013-12-14 19:22:55'),(7,'Madison','The Madison chocolate is enriched with \"feuilletine\", crispy French wafers, made according to the traditional recipe from Brittany.\r\nMadison is the perfect combination of strong, dark chocolate with an elegant praliné filling. The \"feuilletine\" inside the filling makes this chocolate a delicate and crunchy chocolate treat.','2013-06-04 00:00:00',NULL,'madison','madison chocolate neuhaus','madison chocolate neuhaus',NULL,727197546,'2013-06-04 15:09:59','2013-12-14 19:22:55'),(8,'Mendiant Dark','A mendiant is a traditional French delicacy, composed of a chocolate base with inclusions of nuts and dried fruits. Originally, the inclusions represented the four mendicant or monastic orders of the Dominicans, Augustinians, Franciscans and Carmelites.\r\nThis simple yet delicious chocolate consists of plain dark Neuhaus chocolate with dried nuts.','2013-06-04 00:00:00',NULL,'mendiant-dark','mendiant dark chocolate neuhaus','mendiant dark chocolate neuhaus',NULL,727197546,'2013-06-04 20:32:09','2013-06-09 10:43:56'),(9,'Noix','The Noix praline has a filling of hazelnut praliné with hints of gently roasted hazelnuts from the Black Sea coast region and almonds from California. The addition of caramelised hazelnut pieces bring a touch of real \"brésilienne\" and results in a wonderful mixture of flavours and textures.','2013-06-04 00:00:00',NULL,'noix','noix chocolate neuhaus','noix chocolate neuhaus',NULL,727197546,'2013-06-04 20:42:09','2013-06-09 10:53:07'),(10,'Satan','Satan has an intense dark chocolate shell. The praliné filling made of freshly roasted and caramelised hazelnuts is enhanced by crunchy little pieces of hazelnut all the way from the Black Sea coast region.','2013-06-04 00:00:00',NULL,'satan','satan chocolate neuhaus','satan chocolate neuhaus',NULL,727197546,'2013-06-04 20:47:15','2014-02-19 19:47:43'),(11,'Summum','Behind the sturdy looks of the Summum praline, hides a filling of smooth gianduja and crunchy \"feuilletine\" or crispy French wafers. The filling is covered with a thin layer of intense dark chocolate.','2013-06-04 00:00:00',NULL,'summum','summum chocolate neuhaus','summum chocolate neuhaus',NULL,727197546,'2013-06-04 20:52:02','2013-11-05 15:04:42'),(12,'Passion','This intense and slightly bitter chocolate ganache is an ode to the flavour and simplicity of dark chocolate.','2013-06-04 00:00:00',NULL,'passion','passion chocolate neuhaus','passion chocolate neuhaus',NULL,727197546,'2013-06-04 20:57:57','2013-10-23 12:50:20'),(13,'Art Nouveau','The filling in Art Nouveau holds a dark and intense chocolate ganache, enriched with a hint of hazelnuts all the way from the Black Sea coast region.','2013-06-05 00:00:00',NULL,'art-nouveau','art nouveau chocolate neuhaus','art nouveau chocolate neuhaus',NULL,727197546,'2013-06-04 21:01:55','2013-06-07 14:03:56'),(14,'Criollo','This chocolate is named after the Criollo cocoa bean. Out of the three main varieties in cocoa beans - Criollo, Forastero and Trinitario, Criollo is the most delicate one. It yields a particularly fine and sophisticated cocoa.\r\nThe Criollo chocolate is composed of an intense dark chocolate outer shell and a center of bitter chocolate and fresh butter. This unique recipe will appeal to any connoisseur of dark chocolates and gourmets looking for a distinctive taste experience.','2013-06-05 00:00:00',NULL,'criollo','criollo chocolate neuhaus','criollo chocolate neuhaus',NULL,727197546,'2013-06-04 21:05:42','2013-12-14 19:22:56'),(15,'Désir','This exclusive chocolate with unique shape is part of the family of \"Irrésistibles\", the star pralines within the Neuhaus range.\r\nThis star chocolate is made of a handmade nougatine biscuit, handfilled with an intense chocolate ganache from Peru (64% cocoa) and covered in dark chocolate.','2013-06-05 00:00:00',NULL,'desir','desir chocolate neuhaus','desir chocolate neuhaus',NULL,727197546,'2013-06-04 21:22:23','2013-12-12 21:27:21'),(16,'Grand Place','This praline is named after the Grand Place in Brussels, a square that lies just a few steps away from the Queen\'s Gallery, where the first praline was created in 1912 by Jean Neuhaus.\r\nThe Grand Place praline is a rich, dark chocolate ganache subtly spiced with nigella, a mild Indian spice also known as black cumin, covered a dark chocolate shell sparkled with sugar crystals.','2013-06-05 00:00:00',NULL,'grand-place','grand place chocolate neuhaus','grand place chocolate neuhaus',NULL,727197546,'2013-06-04 21:29:28','2013-12-14 19:22:56'),(17,'Jean','This intense dark praline is named after Jean Neuhaus, grand son of the founder Neuhaus and inventor of the praline. Exactly 100 years ago, in 1912, Jean Neuhaus created the first filled chocolate bonbon and named it \"praline\".\r\nThe ganache filling in Jean is made from intense dark origin chocolate from Peru. The combination with a dark chocolate shell gives this praline a perfect balance of intense flavours.','2013-06-05 00:00:00',NULL,'jean','jean chocolate neuhaus','jean chocolate neuhaus',NULL,727197546,'2013-06-04 21:32:45','2013-12-14 19:22:57'),(18,'Manon Noir','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nThis Manon with its frothy, dark chocolate mousse filling and crispy intense chocolate coating is a delight for lovers of dark chocolate. The airy sensation of the light chocolate mousse and the intensity of the dark chocolate cover are keep each other in perfect balance.','2013-06-05 00:00:00',NULL,'manon-noir','manon noir chocolate neuhaus','manon noir chocolate neuhaus',NULL,727197546,'2013-06-04 21:37:04','2013-11-05 15:04:42'),(19,'Violetta','This elegant dark chocolate praline is a fruitful combination of chocolate and flowers. The mysterious appearance of Violetta covers a creamy ganache flavoured with violet and is covered in dark chocolate with a decoration of delectable crystallised violets from Toulouse.','2013-06-05 00:00:00',NULL,'violetta','violetta chocolate neuhaus','violetta chocolate neuhaus',NULL,727197546,'2013-06-04 21:39:41','2013-12-14 19:22:55'),(20,'Caprice','Caprice, along with Tentation, are the iconic pralines created for the occasion of the World Exhibition held in Brussels in 1958. Today, Caprice is still a star praline within the Neuhaus range. The names Caprice and Tentation refer to a quote by the French star actress Brigitte Bardot.\r\nThis legendary chocolate consists of a shell. The biscuit is hand filled with vanilla fresh cream and covered in an intense dark chocolate.','2013-06-05 00:00:00',NULL,'caprice','caprice chocolate neuhaus','caprice chocolate neuhaus',NULL,727197546,'2013-06-04 21:49:03','2013-12-14 19:22:55'),(21,'Fabiola','This royal praline was created to commemorate the marriage of Prince Baudoin and Princess Fabiola, former King and Queen of Belgium, in 1960. As an official supplier to the Belgian Royal Court, Neuhaus maintains also today a close tie with the Belgian Royal Family.\r\nThe Fabiola chocolate is composed of a dark chocolate shell with a layered filling of vanilla fresh cream and a dark chocolate ganache. The contrast between the richness of the chocolate and the frothiness of the filling brings a delightful taste experience.','2013-06-05 00:00:00',NULL,'fabiola','fabiola chocolate neuhaus','fabiola chocolate neuhaus',NULL,727197546,'2013-06-04 21:55:19','2014-02-19 19:47:42'),(22,'Desdémone','This praline is a combination of the smooth, light flavour of vanilla fresh cream with subtle notes of melt-in-the-mouth roasted hazelnut gianduja.',NULL,NULL,'desdemone','desdémone chocolate neuhaus','desdémone chocolate neuhaus',NULL,727197546,'2013-06-04 22:03:40','2013-06-07 14:09:48'),(23,'Galerie','The Galerie chocolate is a caramel ganache with a touch of French sea salt from Guérande ganache. The filling is covered in dark chocolate and the praline is decorated with the signature Neuhaus \"N\".\r\nThe Galerie chocolate bears the name of the \"Galerie de la Reine\" or Queen\'s Gallery in Brussels, where Jean Neuhaus opened his first store in 1857 and where the first praline was created in 1912.','2013-06-05 00:00:00',NULL,'galerie','galerie chocolate neuhaus','galerie chocolate neuhaus',NULL,727197546,'2013-06-04 22:07:40','2013-12-14 19:22:56'),(24,'Marzipan mini Bûche','Pure marzipan covered in dark chocolate. Neuhaus marzipan is made with almonds all the way from Faro, Portugal. All marzipan includes a minimum of 50% almonds for a pure marzipan flavour. The elegant coating of candied sugar lends a crunchy finish.','2013-06-05 00:00:00',NULL,'marzipan-mini-buche','Marzipan mini Buche chocolate neuhaus','Marzipan mini Buche chocolate neuhaus',NULL,727197546,'2013-06-04 22:15:50','2013-06-09 10:43:16'),(25,'Canasta','Pure marzipan covered in dark chocolate. Neuhaus marzipan is made with almonds all the way from Faro in Portugal, and includes a minimum of 50% almonds for a pure marzipan flavour.','2013-06-05 00:00:00',NULL,'canasta','canasta chocolate neuhaus','canasta chocolate neuhaus',NULL,727197546,'2013-06-04 22:23:04','2013-06-07 14:08:20'),(26,'Séduction','This star chocolate is made of a handmade nougatine biscuit, handfilled with a smooth butter cream enriched with a subtle note of refreshing raspberry, and covered in intense dark chocolate. Pairing raspberry and chocolate creates a classic combination flavours. The tangy freshness of raspberries float on an wave of intense dark chocolate.','2013-06-05 00:00:00',NULL,'seduction','séduction chocolate neuhaus','séduction chocolate neuhaus',NULL,727197546,'2013-06-04 22:26:47','2013-12-14 19:22:56'),(27,'Orangettes','The combination of orange and chocolate is a successful marriage that is liked by people from all over the world and appreciated by young and old.\r\nThe orange peels for these \"Orangettes\" are candied in the traditional way and then coated with a thin layer of dark chocolate. The tenderness of the orange peel and the crispy chocolate create a variety of textures in the mouth.','2013-06-05 00:00:00',NULL,'orangettes','orangettes chocolate neuhaus','orangettes chocolate neuhaus',NULL,727197546,'2013-06-04 22:32:49','2013-12-16 22:59:41'),(28,'Suzanne','This praline is a tribute to Suzanne Neuhaus-De-Gavre, daughter of Jean Neuhaus and a famous opera singer.\r\nLayers of praliné and raspberry ganache give this dark chocolate \"Suzanne\" a subtle hint of freshness.','2013-06-05 00:00:00',NULL,'suzanne','suzanne chocolate neuhaus','suzanne chocolate neuhaus',NULL,727197546,'2013-06-04 22:36:55','2014-02-19 19:47:43'),(29,'Fraise des Bois','The colourful wrapping of the Fraise des Boispraline reveals a melt-in-the-mouth creamy filling flavoured with the pulp of wild woodland strawberries, covered in dark chocolate.',NULL,NULL,'fraise-des-bois','Fraise des Bois chocolate neuhaus','Fraise des Bois chocolate neuhaus',NULL,727197546,'2013-06-04 22:40:53','2013-10-23 13:07:24'),(30,'Pagode','The recipe of this praline dates back to 1958, the year when the World Exhibition took place in Brussels and Neuhaus created several recipes in honour of this important occasion. Out of the 43 countries that participated in the exhibition, the Thai pavilion was one of the most visited. In light of the strong interest that people showed for Asian culture, Neuhaus created \"Pagode\" chocolate. The unique shape of this praline is inspired by a pagoda, one of the most typical characteristics of Asian architecture and culture.\r\nThe \"Pagode\" chocolate consists of an intense dark chocolate shell holding a layered filling of smooth gianduja paste and intense coffee ganache.','2013-06-05 00:00:00',NULL,'pagode','pagode chocolate neuhaus','pagode chocolate neuhaus',NULL,727197546,'2013-06-04 22:43:24','2014-02-19 19:47:43'),(31,'Chocolate Coffee Beans','Coffee flavoured dark and intense chocolate shaped as coffee beans.','2013-06-05 00:00:00',NULL,'chocolate-coffee-beans','Chocolate Coffee Beans chocolate neuhaus','Chocolate Coffee Beans chocolate neuhaus',NULL,727197546,'2013-06-04 22:46:17','2013-12-16 22:59:42'),(32,'Baudouin','This royal praline was created to commemorate the marriage of Prince Baudouin and Princess Fabiola, former King and Queen of Belgium, in 1960. Since last century Neuhaus is an official supplier to the Belgian Royal Court.\r\nThe Baudouin praline is composed of milk chocolate with a frothy fresh cream filling, lightly flavoured with vanilla.','2013-06-05 00:00:00',NULL,'baudouin','baudouin chocolate neuhaus','baudouin chocolate neuhaus',NULL,727197546,'2013-06-05 09:41:16','2014-02-19 19:47:43'),(33,'Bonbon 13','Neuhaus created the recipe for \"Bonbon 13\" already in 1937. The recipe has remained the same ever since.\r\nThe Bonbon 13 chocolate is the successful marriage between a dark ganache and a hint of rum. The intensity of the dark chocolate in the inner shell, combined with the smoothness of the milk chocolate of the outer shell, is magically complemented by the rich aromas of the rum.','2013-06-05 00:00:00',NULL,'bonbon-13','bonbon 13 chocolate neuhaus','bonbon 13 chocolate neuhaus',NULL,727197546,'2013-06-05 09:47:16','2013-12-14 19:22:55'),(34,'Manon Milk','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nThis milk chocolate Manon is a perfect blend of light butter cream with praliné, enriched with caramelized hazelnut pieces and the sweetness of milk chocolate. The airy sensation of the cream and the original nutty note of the hazelnuts are a surprising combination.','2013-06-05 00:00:00',NULL,'manon-milk','manon milk chocolate neuhaus','manon milk chocolate neuhaus',NULL,727197546,'2013-06-05 09:51:31','2013-12-14 19:22:56'),(35,'Louise','This smooth milk chocolate praline was named after Louise Agostini, wife of Jean Neuhaus.  Louise inspired her husband in creating the \"ballotin\", a special box designed as elegant wrapping for pralines and which at the same time protects the delicate chocolates during transport. Today, the \"ballotin\" box is adopted by the majority of Belgian chocolatiers as the standard for wrapping chocolates.\r\nThe ganache filling in the praline named Louise is made from smooth origin chocolate from Java and will please chocolate lovers with a sweet tooth.','2013-06-05 00:00:00',NULL,'louise','louise chocolate neuhaus','louise chocolate neuhaus',NULL,727197546,'2013-06-05 09:55:44','2013-12-14 19:22:57'),(36,'Frederic','The name of this elegantly decorated chocolate is a tribute to Frédéric Neuhaus, passionate confectioner and son of Jean Neuhaus, founder of Neuhaus Créateur chocolatier.','2013-06-05 00:00:00',NULL,'frederic','frederic chocolate neuhaus','frederic chocolate neuhaus',NULL,727197546,'2013-06-05 10:45:39','2013-12-14 19:22:56'),(37,'Plaisir','This exclusive chocolate with unique shape is part of the family of \"Irrésistibles\", the star pralines within the Neuhaus range.\r\nThis star chocolate is made of a handmade nougatine biscuit, handfilled with a rich and creamy ganache made from gently roasted hazelnuts all the way from the Black Sea coast region. The nougatine biscuit and filling are covered in creamy milk chocolate.','2013-06-05 00:00:00',NULL,'plaisir','plaisir chocolate neuhaus','plaisir chocolate neuhaus',NULL,727197546,'2013-06-05 11:01:41','2013-12-12 21:27:22'),(38,'Prestige','The Prestige chocolate offers the simplicity of a traditional beige caramel combined with the sweetness of milk chocolate.\r\nCaramel is a mixture produced when granulated sugar is cooked until it melts and becomes a thick, clear liquid that can range in colour from golden to deep brown.','2013-06-05 00:00:00',NULL,'prestige','prestige chocolate neuhaus','prestige chocolate neuhaus',NULL,727197546,'2013-06-05 11:07:00','2014-02-19 19:47:43'),(39,'Napoleonette','The Napoleonette praline is a smooth milk chocolate with a praliné filling. To achieve a rich and tasteful praliné, all nuts are roasted in our chocolate atelier. The filling is finished with a hint of fresh coffee, which brings a delectable blend of delicacy and strength.','2013-06-05 00:00:00',NULL,'napoleonette','napoleonette chocolate neuhaus','napoleonette chocolate neuhaus',NULL,727197546,'2013-06-05 11:32:07','2013-10-11 18:58:39'),(40,'Tentation','Tentation, along with Caprice, is the icon praline that was created for the occasion of the World Exhibition held in Brussels in 1958. Today, Tentation is still a star praline within the Neuhaus range. The names Tentation and Caprice refer to a quote by the French star actress Brigitte Bardot.\r\nThis legendary chocolate consists of a traditional nougatine biscuit and is handfilled with a coffee ganache. The filled nougatine biscuit is covered in a creamy milk chocolate.','2013-06-05 00:00:00',NULL,'tentation','tentation chocolate neuhaus','tentation chocolate neuhaus',NULL,727197546,'2013-06-05 11:38:21','2013-06-09 11:06:23'),(41,'Othello','This praline is combines frothy coffee fresh cream with subtle notes of melt-in-the-mouth roasted hazelnut gianduja.','2013-06-05 00:00:00',NULL,'othello','othello chocolate neuhaus','othello chocolate neuhaus',NULL,727197546,'2013-06-05 13:40:40','2013-11-19 07:13:10'),(42,'Millénaire','The Millénaire chocolate is covered in smooth milk chocolate and holds a filling of gianduja enriched with crisped rice, which lends a surprising crispy note to the otherwise perfectly smooth texture of the gianduja. For its gianduja, Neuhaus uses hazelnuts from the Black Sea coast region.','2013-06-05 00:00:00',NULL,'millenaire','millenaire chocolate neuhaus','millenaire chocolate neuhaus',NULL,727197546,'2013-06-05 13:50:16','2013-06-09 10:49:29'),(44,'Méphisto','The Méphisto praline has a sweet milk chocolate shell and is filled with a praliné made from hazelnuts all the way from the Black Sea coast region. The flavour of freshly roasted and caramelised hazelnuts is enhanced by crunchy little hazelnut pieces.','2013-06-05 00:00:00',NULL,'mephisto','Méphisto chocolate neuhaus','Méphisto chocolate neuhaus',NULL,727197546,'2013-06-05 13:58:47','2014-02-19 19:47:43'),(45,'Sapho','The praline Sapho is a wonderful combination of delicate milk chocolate and a smooth praliné made from Californian almonds that are roasted in our chocolate atelier. The roasted almonds give the praliné filling in this chocolate its exquisite and perfectly balanced flavour.','2013-06-05 00:00:00',NULL,'sapho','sapho chocolate neuhaus','sapho chocolate neuhaus',NULL,727197546,'2013-06-05 14:05:40','2014-02-19 19:47:43'),(46,'Astrid','The recipe for this chocolate is one of the oldest within the Neuhaus range and dates back to 1937. This praline is a tribute to princess Astrid of Sweden, who was Queen of the Belgians as wife of King Leopold III. She tragically lost life during a holiday in the Swiss mountains, but will always remain in the heart of the Belgian people as a loving and caring Queen.\r\nThis royal praline is composed of a traditional gianduja made with hazelnuts all the way from the Black Sea coast region. The gianduja paste is blended with a knob of fresh butter to achieve an even smoother, melt-in-the-mouth texture. As a finishing touch, the praline is coated in a thin sugar glazing.','2013-06-05 00:00:00',NULL,'astrid','astrid chocolate neuhaus','astrid chocolate neuhaus',NULL,727197546,'2013-06-05 14:28:04','2013-12-14 19:22:55'),(47,'Bloc Gianduja','Enjoy this Bloc of pure gianduja paste.  You will appreciate the pure flavour of this carefully balanced and perfectly smooth blend of hazelnuts, almonds and Neuhaus chocolate.','2013-06-05 00:00:00',NULL,'bloc-gianduja','Bloc Gianduja chocolate neuhaus','Bloc Gianduja chocolate neuhaus',NULL,727197546,'2013-06-05 14:33:34','2013-12-14 19:22:56'),(48,'Cornet Doré','The delicious flavour and melt-in-the-mouth texture of the gianduja in this Cornet Dore is accomplished through a secret recipe that makes this golden chocolate a true delight.\r\nThe praline Cornet Doré consists purely of melt-in-the-mouth gianduja paste, elegantly swirled into a golden cornet. The gianduja is made with hazelnuts from the Black Sea coast region and almonds all the way from California.','2013-06-05 00:00:00',NULL,'cornet-dore','Cornet Doré chocolate neuhaus','Cornet Doré chocolate neuhaus',NULL,727197546,'2013-06-05 14:37:32','2013-12-14 19:22:56'),(49,'Mendiant Milk','This simple yet delicious classic in the family of confectionery consists of smooth milk chocolate and inclusions of dried fruits and roasted nuts.','2013-06-05 00:00:00',NULL,'mendiant-milk','Mendiant Milk chocolate neuhaus','Mendiant Milk chocolate neuhaus',NULL,727197546,'2013-06-05 14:41:58','2013-06-09 10:44:14'),(50,'1857','The name of this praline with playful shape and colourful orange tip refers to the year when Jean Neuhaus opened his first store in the fabulous glass covered Queen\'s Gallery in Brussels.\r\n1857 is a milk chocolate filled with speculoos praliné. Speculoos is a traditional Belgian biscuit that brings back nostalgic childhood memories for many people.','2013-06-05 00:00:00',NULL,'1857','1857 chocolate neuhaus','1857 chocolate neuhaus',NULL,727197546,'2013-06-05 14:45:58','2013-12-14 19:22:56'),(51,'Zenith','Behind the sturdy looks of the Zenith chocolate, hides a melt-in-the-mouth gianduja filling enhanced with lightly grilled hazelnut pieces. The filling is covered with a thin layer of smooth milk chocolate.','2013-06-05 00:00:00',NULL,'zenith','zenith chocolate neuhaus','zenith chocolate neuhaus',NULL,727197546,'2013-06-05 14:49:59','2013-06-09 11:20:16'),(52,'Horta','The milk chocolate Horta, with its original and elegant shape, is filled with a surprising praliné enriched with nougat pieces that give a luxury touch to the texture of the praliné and lend it a subtle flavour.','2013-06-05 00:00:00',NULL,'horta','Horta chocolate neuhaus','Horta chocolate neuhaus',NULL,727197546,'2013-06-05 14:58:15','2013-12-14 19:22:57'),(53,'Coeur Praline Milk','The smooth texture of this praliné made from California almonds and hazelnuts from the Black Sea region enhances the soft and sweet character of this smooth milk chocolate.\r\nThis romantic heart-shaped chocolate wrapped in a tempting red paper is a pleasure to give and receive.','2013-06-05 00:00:00',NULL,'coeur-praline-milk','Coeur Praline Milk chocolate neuhaus','Coeur Praline Milk chocolate neuhaus',NULL,727197546,'2013-06-05 15:01:35','2013-06-07 14:09:05'),(54,'Manon Choco Vanille','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nThis elegant white chocolate Manon is filled with a butter cream enriched with vanilla and crowned with a whole pecan nut. With its signature \"N\", this praline is one of the classics among Neuhaus pralines.','2013-06-05 00:00:00',NULL,'manon-choco-vanille','Manon Choco Vanille chocolate neuhaus','Manon Choco Vanille chocolate neuhaus',NULL,727197546,'2013-06-05 19:50:44','2013-12-23 20:02:58'),(55,'Aphrodite','This chocolate with divine name reveals all the lightness of perfectly whipped fresh cream with vanilla, on a layer of melt-in-the-mouth gianduja.  The white chocolate emphasises the lightness and sweetness of this praline.','2013-06-05 00:00:00',NULL,'aphrodite','Aphrodite chocolate neuhaus','Aphrodite chocolate neuhaus',NULL,727197546,'2013-06-05 20:24:03','2013-12-14 19:22:56'),(56,'Diane','This white chocolate reveils an airy dark chocolate mousse, on a thin layer of melt-in-the-mouth gianduja paste made from hazelnuts all the way from the Black Sea coast region.','2013-06-05 00:00:00',NULL,'diane','diane chocolate neuhaus','diane chocolate neuhaus',NULL,727197546,'2013-06-05 20:27:05','2013-06-07 14:11:17'),(57,'Millionaire','The Millionaire chocolate is covered in white chocolate and holds a filling of gianduja enriched with crisped rice, which lends a surprising crunchy note to the otherwise perfectly smooth texture of the gianduja.','2013-06-05 00:00:00',NULL,'millionaire','Millionaire chocolate neuhaus','Millionaire chocolate neuhaus',NULL,727197546,'2013-06-05 20:30:01','2013-11-05 15:04:42'),(59,'Passion Amande','The Passion Amande chocolate reveals a variation on the traditional gianduja by using grilled, caramelised and lightly salted almonds. Combined with white chocolate, this sweet and salty blend conveys a wonderfully full and rounded flavour.','2013-06-05 00:00:00',NULL,'passion-amande','passion amande chocolate neuhaus','passion amande chocolate neuhaus',NULL,727197546,'2013-06-05 20:34:18','2013-12-14 19:22:56'),(60,'Manon Choco Café','The family of \"Manon\" pralines is believed to be named after Suzanne, daughter of Jean Neuhaus. Suzanne Neuhaus was a well known opera singer. In 1942, she achieved fame in the role of \"Manon Lescaut\" in the famous opera \"Manon\" written by Jules Massenet.\r\nWith all the richness of fresh coffee butter cream and a whole pecan nut decoration, this creamy white chocolate Manon, decorated with a coffee flavoured chocolate in the shape of a coffee bean, is one of the classics among the assortment of Neuhaus pralines.','2013-06-05 00:00:00',NULL,'manon-choco-cafe','Manon Choco Café chocolate neuhaus','Manon Choco Café chocolate neuhaus',NULL,727197546,'2013-06-05 20:56:31','2013-10-23 12:43:55'),(61,'Troika','This unique creation is a surprising and delicious combination of smooth marzipan and gianduja. Neuhaus marzipan is made with almonds all the way from Faro, Portugal. All marzipan includes a minimum of 50% almonds for a pure marzipan flavour. The elegant coating of candied sugar lends a crunchy finish.','2013-06-05 00:00:00',NULL,'troika','troika chocolate neuhaus','troika chocolate neuhaus',NULL,727197546,'2013-06-05 21:00:38','2013-12-14 19:22:55'),(62,'Truffle Marc de Champagne','Marc de Champagne is a colorless brandy that is produced by distilling the grape skins, seeds and stems that are left from the pressing process in the first stages of Champagne production.\r\nThis truffle with light butter cream is flavoured with authentic Marc de Champagne, and offers a surprising contrast between the intense flavour of dark chocolate and the sweetness of the sugar with which it is dusted. A festive truffle, full of contrasts.','2013-06-06 00:00:00',NULL,'truffle-marc-de-champagne','Truffle Marc de Champagne chocolate neuhaus','Truffle Marc de Champagne chocolate neuhaus',NULL,727197546,'2013-06-05 21:32:27','2013-10-23 13:00:58'),(63,'Truffle Cognac','This truffle contains a butter cream that is sublty flavored with Cognac. The typical flavor of the liquor combines perfectly with the dark chocolate coating and the delicate almond chips with which this truffle is coated.\r\nCognac is a brandy that originates from the Cognac region in France and must be made from a mixture of 3 different type of grapes: ugni blanc, folle blanche, and colombard grapes. The wine produced from these grapes is high in acid and low in alcohol and gives Cognac its attractive flavor.','2013-06-06 00:00:00',NULL,'truffle-cognac','Truffle Cognac chocolate neuhaus','Truffle Cognac chocolate neuhaus',NULL,727197546,'2013-06-05 21:37:30','2013-12-14 19:22:57'),(64,'Truffle Coffee','This truffle is a melt-in-the-mouth butter cream, delicately flavored with fresh coffee. The dark chocolate coating is sprinkled with chocolate flakes, which are in perfect harmony with the coffee aroma.\r\nChocolate and coffee are a well-known and successful marriage of intense flavors.','2013-06-06 00:00:00',NULL,'truffle-coffee','Truffle Coffee chocolate neuhaus','Truffle Coffee chocolate neuhaus',NULL,727197546,'2013-06-05 21:41:07','2013-07-03 15:16:17'),(65,'Truffle Tiramisu','This truffle is a delicious combination of smooth butter cream and Amaretto. As a finishing touch, this dark chocolate-coated truffle is rolled in crunchy Amaretti cookie crumbs.\r\nTiramisu is an Italian dessert famous for its light yet rich texture. The recipe originates from the Siena area in the Northwest of Tuscany, where it was discovered by the famous Medici family and then introduced in Florence and later on the rest of Italy.','2013-06-06 00:00:00',NULL,'truffle-tiramisu','tiramisu chocolate neuhaus','tiramisu chocolate neuhaus',NULL,727197546,'2013-06-05 21:48:36','2013-10-23 13:01:58'),(66,'Truffle Butter','This classic Belgian truffle is a melt-in-the-mouth chocolate butter cream coated with dark chocolate, which creates an intense chocolate flavor enhanced by the dusting of cocoa powder.\r\nThe butter truffle is an absolute Belgian classic. The freshness of butter-based fillings creates a taste experience that lingers. Butter fillings tend to be velvety and have a superb melt-in-the-mouth quality.','2013-06-06 00:00:00',NULL,'truffle-butter','Truffle Butter chocolate neuhaus','Truffle Butter chocolate neuhaus',NULL,727197546,'2013-06-05 21:53:07','2013-11-05 15:04:41'),(67,'Truffle Dark','This dark chocolate truffle is composed of a butter cream enriched with intense pure chocolate. Dark chocolate flakes add an intense flavor sensation that enhances the richness of the filling.\r\nLovers of dark chocolate who are looking for a more bitter than sweet taste experience will be delighted with the simple yet powerful taste of the dark chocolate truffle.','2013-06-06 00:00:00',NULL,'truffle-dark','Truffle Dark chocolate neuhaus','Truffle Dark chocolate neuhaus',NULL,727197546,'2013-06-05 21:56:52','2013-11-19 07:13:09'),(68,'Tablet Dark','An intense dark chocolate with 56% cocoa.','2013-06-06 00:00:00',NULL,'dark','tablet dark chocolate neuhaus','tablet dark chocolate neuhaus',NULL,727197546,'2013-06-05 22:25:58','2013-06-07 13:58:39'),(69,'Tablet Dark Orange','A rich dark chocolate with candied orange peel shreds.','2013-06-06 00:00:00',NULL,'tablet-dark-orange','tablet dark orange chocolate neuhaus','tablet dark orange chocolate neuhaus',NULL,727197546,'2013-06-05 22:33:03','2013-06-07 13:58:48'),(70,'Tablet Extra Dark','A powerfull extra dark chocolate with 74% cocoa.','2013-06-05 00:00:00',NULL,'tablet-extra-dark','Tablet Extra Dark chocolate neuhaus','Tablet Extra Dark chocolate neuhaus',NULL,727197546,'2013-06-05 22:35:40','2013-12-03 13:51:54'),(71,'Tablet Milk','A creamy milk chocolate with a delicate touch of vanilla.','2013-06-06 00:00:00',NULL,'tablet-milk','tablet milk chocolate neuhaus','tablet milk chocolate neuhaus',NULL,727197546,'2013-06-05 22:45:49','2013-06-07 13:59:37'),(72,'Tablet Milk Caramel','A creamy milk chocolate with crunchy caramel nibs.','2013-06-06 00:00:00',NULL,'tablet-milk-caramel','Tablet Milk Caramel chocolate neuhaus','Tablet Milk Caramel chocolate neuhaus',NULL,727197546,'2013-06-05 22:53:49','2013-12-16 23:03:45'),(73,'Wild Strawberries Dark Chocolate Bar','Dark chocolate bar filled with smooth cream enriched with wild strawberries.','2013-06-06 00:00:00',NULL,'wild-strawberries-dark-chocolate-bar','Wild Strawberries Dark Chocolate Bar neuhaus','Wild Strawberries Dark Chocolate Bar neuhaus',NULL,727197546,'2013-06-06 10:46:28','2014-01-04 11:56:02'),(74,'Raspberry Dark Chocolate Bar','Dark chocolate bar filled with intense ganache and raspberries.','2013-06-06 00:00:00',NULL