their way from the chocolate store to their lucky recipient.\r\n\r\nThe Classic assortment ballotin box offers a balanced choice of chocolates with praliné, ganache, and gianduja fillings that will appeal to any chocolate lover. The ballotin is available in various sizes.','2013-06-06 00:00:00',NULL,'classic-assortment','Classic -suklaalajitelma neuhaus','Classic -suklaalajitelma neuhaus',NULL,727197546,'2013-06-06 14:19:45','2013-11-27 13:50:05'),(88,'Truffle Assortment','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient.\r\n\r\nThis Truffle assortment ballotin box contains a variety of chocolate truffles with fillings of chocolate butter cream and flavors such as classic, extra dark, coffee, tiramisu, cognac, and Marc de Champagne. ','2013-06-06 00:00:00',NULL,'truffle-assortment','Truffle Assortment neuhaus ballotin','Truffle Assortment neuhaus ballotin',NULL,727197546,'2013-06-06 14:48:02','2013-07-03 15:31:04'),(89,'All White Assortment','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient.\r\n\r\nThe All White assortment ballotin box contains a selection of chocolates coated in a creamy white chocolate. This exclusive assortment box is the perfect gift for those with a passion for creamy white chocolates. ','2013-06-06 00:00:00',NULL,'all-white-assortment','All White Assortment chocolate neuhaus','All White Assortment chocolate neuhaus',NULL,727197546,'2013-06-06 15:00:14','2013-07-03 15:33:59'),(90,'All Milk Assortment','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient.\r\n\r\nThe All Milk assortment ballotin box contains a selection of chocolates coated in smooth milk chocolate. This exclusive assortment box is the perfect gift for those with a passion for rich milk chocolates.','2013-06-07 00:00:00',NULL,'all-milk-assortment','All Milk Assortment neuhaus','All Milk Assortment neuhaus',NULL,727197546,'2013-06-07 10:23:23','2013-07-24 13:09:29'),(92,'Truffle Glamour','This trendy orange box with a Truffle \"Glamour\" assortment contains delicious truffles with 6 different flavours: classic, extra dark, coffee, tiramisu, cognac, Marc de Champagne. This assortment contains 12 chocolates.','2013-06-07 00:00:00',NULL,'truffle-glamour','Truffle Glamour neuhaus chocolate','Truffle Glamour neuhaus chocolate',NULL,727197546,'2013-06-07 11:01:25','2013-07-03 15:35:21'),(93,'Irrésistibles','The Neuhaus Collection Stars is a selection of Neuhaus\' icon pralines, 100% hand-made. The stars selection is composed of a traditional artisan nougatine handfilled with smooth fresh cream or ganache and coated with dark or milk chocolate. This assortment contains 12 chocolates.','2013-06-07 00:00:00',NULL,'irresistibles','Irrésistibles neuhaus chocolate','Irrésistibles neuhaus chocolate',NULL,727197546,'2013-06-07 11:04:16','2013-11-26 15:05:03'),(94,'Red Heart','This pretty, bright red, heart-shaped box contains a selection of 10 of our timeless pralines in various shapes and flavours. Surprise your loved ones with a selection of dark, white and milk chocolates, filled with praliné, ganache and gianduja. A gift to offer with love. This assortment contains 10 chocolates.','2013-06-07 00:00:00',NULL,'red-heart','Red Heart neuhaus chocolate','Red Heart neuhaus chocolate',NULL,727197546,'2013-06-07 11:06:00','2013-07-03 15:36:38'),(95,'Square Tin Box','This elegant tin box includes a selection of our timeless dark, white and milk chocolates, filled with rich praliné, intense ganache and melt-in-the-mouth gianduja. This tin box offers a unique presentation of the chocolates and is ideal for gifting. This assortment contains 32 chocolates.','2013-06-07 00:00:00',NULL,'square-tin-box','Square Tin Box neuhaus chocolate','Square Tin Box neuhaus chocolate',NULL,727197546,'2013-06-07 11:07:30','2013-10-19 12:00:14'),(96,'Assortment Dark, Milk, White','Surprise Dad with an assortment of delicious chocolates in dark, milk and white chocolate.\r\n\r\nThis beautiful red box contains a mix of delicious chocolates in dark, milk and white chocolate filled with praliné, ganache and gianduja. The perfect gift for chocolate lovers with a wide taste. This assortment contains 20 chocolates.','2013-07-19 00:00:00',NULL,'assortment-dark-milk-white','Assortment Dark, Milk, White','Assortment Dark, Milk, White',NULL,727197546,'2013-07-19 12:39:20','2013-07-30 12:59:54'),(97,'Assortment \"Dark\"','Dad\'s who are into dark chocolate will love this gift box with intense dark chocolates.\r\n\r\nThis stylish brown box with a \"Dark\" assortment contains intense dark chocolates filled with praliné, giuanduja and ganache. This assortment contains 20 chocolates.','2013-07-19 00:00:00',NULL,'assortment-dark-1','Assortment Dark neuhaus','Assortment Dark neuhaus',NULL,727197546,'2013-07-19 13:05:45','2013-12-05 14:33:12'),(98,'Assortment \"Milk\"','Belgian chocolate lovers with a preference for milk chocolate will melt for this range of chocolates in creamy milk chocolate.\r\n\r\nThis warm light brown box with a \"Milk\" assortment contains milk chocolates with authentic pralinés and refined ganaches, and flavours ranging from caramel up to traditional Belgian speculoos biscuit. This assortment contains 20 chocolates.','2013-07-19 00:00:00',NULL,'assortment-milk','Assortment \"Milk\" neuhaus','Assortment \"Milk\" neuhaus',NULL,727197546,'2013-07-19 13:11:45','2013-07-30 12:57:16'),(99,'Mini Ballotin','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient. This mini version of the original ballotin is the perfect favour for your guests.\r\n\r\nThe mini ballotin box includes two exquisite Neuhaus chocolates. It is the perfect gift to surprise your guests. They will be delighted with this small attention, to take home or to enjoy immediately.','2013-07-19 00:00:00',NULL,'mini-ballotin','Mini Ballotin Neuhaus','Mini Ballotin Neuhaus',NULL,727197546,'2013-07-19 13:32:16','2013-12-08 11:24:55'),(100,'All Dark Assortment','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient.\r\n\r\nThe All Dark assortment ballotin box includes a selection of chocolates coated in an intense dark chocolate. This exclusive assortment box is the perfect gift for those passionate about pure dark chocolates.','2013-07-19 00:00:00',NULL,'all-dark-assortment','All Dark Assortment neuhaus','All Dark Assortment neuhaus',NULL,727197546,'2013-07-19 13:40:18','2013-12-16 06:35:31'),(101,'Carré Assortment','Discover the skill and finesse of exclusive Neuhaus chocolate recipes through these individually wrapped squares of chocolate, traditionally served with coffee. This compact box includes an assortment of 18 individually wrapped square chocolates and is the perfect small gift. This assortment contains 18 individually wrapped chocolates.','2014-01-09 00:00:00',NULL,'carre-assortment','Carré Assortment neuhaus','Carré Assortment neuhaus',NULL,727197546,'2013-07-20 13:10:43','2013-12-12 06:29:18'),(102,'Multipack Bars','Discover the authentic recipes from Neuhaus in our classic chocolate bars, the perfect snack for an intense tasting moment. This assortment contains 8 bars.','2013-07-20 00:00:00',NULL,'multipack-bars','Multipack Bars neuhaus','Multipack Bars neuhaus',NULL,727197546,'2013-07-20 13:12:46','2013-12-15 23:02:02'),(103,'Earl Grey','A symphony of robust Assam leaves with a light liquoring of cold-pressed, Italian Bergamot citrus. Our blend of this classic tea has been carefully crafted to define how an Earl Grey should taste. Deeply aromatic with a bold flavor.','2013-07-23 00:00:00',NULL,'earl-grey-teabag','Tea Forte Earl Gray','Tea Forte Earl Gray',NULL,727197546,'2013-07-23 12:43:40','2013-07-30 13:12:50'),(105,'English Breakfast','A robust full-bodied cup with a concentrated character of malt and deep undertones that welcome a bit of milk and sugar. Satisfying and delicious, this tea is a great breakfast cup that can be enjoyed throughout the day.','2013-07-23 00:00:00',NULL,'english-breakfast-teabag','English Breakfast Tea Forte','English Breakfast Tea Forte',NULL,727197546,'2013-07-23 13:08:58','2013-07-30 13:13:35'),(106,'White Ginger Pear','Rarest Pai Mu Tan white tea is plucked in early spring from a special varietal tea bush called “chaicha”. Blended with the sweet taste of juicy orchard fresh pear and the tingle of spicy ginger for a delicate and delighting infusion.','2013-07-23 00:00:00',NULL,'white-ginger-pear-teabag','White Ginger Pear Tea Forte','White Ginger Pear Tea Forte',NULL,727197546,'2013-07-23 13:19:36','2013-07-30 13:14:13'),(107,'African Solstice','From the soul of South Africa, naturally caffeine-free, antioxidant-rich rooibos herb blended with the taste of berries, blossoms, and a wisp of sweet vanilla. A smooth and delicious cup.','2013-07-23 00:00:00',NULL,'african-soltice-teabag','African Soltice Tea Forte','African Soltice Tea Forte',NULL,727197546,'2013-07-23 15:00:25','2013-09-11 20:23:01'),(108,'Jasmine Green','Rare and exceptional Yin Hao green tea is married with intoxicatingly fragrant jasmine blossoms. The scenting of the tea is a meticulous process taking several days, resulting in an exquisite cup of sublime, sweet flavor.','2013-07-23 00:00:00',NULL,'jasmine-green-teabag','Jasmine Green Tea Bag','Jasmine Green Tea Bag',NULL,727197546,'2013-07-23 15:04:15','2013-12-03 13:51:54'),(109,'Ginger Lemongrass','A soothing, multi-layered blend radiating with sunny citrus notes enlivened with the tingle of ginger. A fruity, bright cup with a sweet lingering aftertaste.','2013-07-23 00:00:00',NULL,'ginger-lemongrass','Ginger Lemongrass Tea Forte','Ginger Lemongrass Tea Forte',NULL,727197546,'2013-07-23 15:08:13','2013-07-30 13:16:58'),(111,'Cerisettes','To create the Neuhaus Cérisette, a whole cherry including stalk and stone, is slowly macerated in alcohol before being coated in authentic intense Neuhaus dark chocolate.','2013-10-23 00:00:00',NULL,'cerisettes','Cerisettes chocolate neuhaus','Cerisettes chocolate neuhaus',NULL,727197546,'2013-10-24 14:27:36','2013-12-16 22:59:42'),(114,'Christmas Tinbox','This elegant tin box includes a selection of our timeless dark, white and milk chocolates, filled with rich praliné, intense ganache and melt-in-the-mouth gianduja. This tin box offers a unique presentation of the chocolates and is ideal for gifting. This assortment contains 32 chocolates.','2013-11-27 00:00:00',NULL,'christmas-tinbox','Christmas Tinbox Neuhaus','Christmas Tinbox Neuhaus',NULL,727197546,'2013-11-27 12:08:56','2013-12-03 13:51:53'),(115,'Christmas Classic Assortment','The ballotin box was created by Jean Neuhaus and his wife Louise Agostini in 1915. It was designed as an attractive way to present the pralines and to protect them on their way from the chocolate store to their lucky recipient.\r\n\r\nThe Classic assortment ballotin box offers a balanced choice of chocolates with praliné, ganache, and gianduja fillings that will appeal to any chocolate lover. The ballotin is available in various sizes.','2013-11-27 00:00:00',NULL,'christmas-classic-assortment','Christmas Classic Assortment','Christmas Classic Assortment',NULL,727197546,'2013-11-27 12:25:44','2013-12-20 18:22:47'),(116,'Christmas baubles','This festive baubles in warm red and luxurious gold each contain six delectable chocolates filled with praline and gianduja. Set of two baubles (12 chocolates).','2013-11-27 00:00:00',NULL,'christmas-baubles','Christmas baubles neuhaus','Christmas baubles neuhaus',NULL,727197546,'2013-11-27 13:57:31','2013-12-10 20:53:14'),(117,'Luxury Christmas Gift','A beautiful luxury box.\r\nThis assortment contains +/- 40 pralines.\r\nThe weight is about 400g','2014-11-30 00:00:00',NULL,'luxury-christmas-gift','Luxury Christmas Gift','Luxury Christmas Gift',NULL,727197546,'2013-11-27 14:28:19','2013-12-16 23:34:01'),(118,'Large Christmass Ball','Decorate your tree with chocolate filled Christmas baubles.\r\nThis bauble in warm red contains about 15 delectable chocolates filled with praline, gianduja and fresh cream.\r\nThe weight is about 215 g.','2013-11-27 00:00:00',NULL,'large-christmas-bauble','Large Christmass Ball neuhaus','Large Christmass Ball neuhaus',NULL,727197546,'2013-11-27 15:04:16','2013-12-16 22:59:42'),(119,'Christmas Orangettes','The orange peels for these \"Orangettes\" are candied in the traditional way and then coated with a thin layer of dark chocolate. The tenderness of the orange peel and the crispy chocolate create a variety of textures in the mouth, making these Orangettes a success all over the world.\r\nThe tenderness of the orange peel and the crispy chocolate create a variety of textures in the mouth. This assortment contains +/- 21 orangettes.','2013-11-27 00:00:00',NULL,'christmas-orangettes','Christmas Orangettes Neuhaus','Christmas Orangettes Neuhaus',NULL,727197546,'2013-11-27 15:16:38','2013-12-10 23:56:37'),(120,'Christmas Belgian Truffles','The butter truffle is a true Belgian classic. The creamy filling based on butter is smooth and creates a long lasting taste experience.\r\n\r\nThis classic Belgian truffle is a melt-in-the-mouth chocolate butter cream coated with dark chocolate, which releases an intense chocolate flavour and is enhanced by the dusting of cocoa powder. Dressed in a festive Christmas jacket, this delicious assortment is a perfect Holiday gift. This package contains + / - 12 truffles.','2013-11-27 00:00:00',NULL,'christmas-belgian-truffles','Christmas Belgian Truffles','Christmas Belgian Truffles',NULL,727197546,'2013-11-27 15:23:06','2013-11-28 01:23:25'),(121,'Marc de Champagne Truffles','Marc de Champagne is a brandy that is produced by distilling the grape skins, seeds and stalks which are left from the pressing process in the first stages of Champagne production.\r\n\r\nThis truffle with light fresh cream is flavoured with Marc de Champagne and offers a surprising contrast between the intense taste of dark chocolate and the sweetness of the sugar-coated all around. A festive truffle, full of contrasts. Dressed in a festive Christmas jacket, this delicious assortment is a perfect Holiday gift. This assortment contains + / - 12 truffles.','2013-11-27 00:00:00',NULL,'marc-de-champagne-truffles','Marc de Champagne Truffles Neuhaus','Marc de Champagne Truffles Neuhaus',NULL,727197546,'2013-11-27 15:29:48','2013-11-28 01:22:58'),(122,'Christmas Big Leather Vip Box','Leather box with all types of Neuhaus chocolates.\r\nThis assortment contains about 100 chocolates.\r\nThe net weight is approximately 1300g','2013-11-28 00:00:00',NULL,'christmas-leather-big-vip-box','Christmas Leather Big Vip Box','Christmas Leather Big Vip Box',NULL,727197546,'2013-11-27 23:37:20','2013-11-28 01:23:44'),(123,'Christmas Medium Leather Vip Box','Leather box with all types of Neuhaus chocolates.\r\nThis assortment contains about 60 chocolates.\r\nThe net weight is approximately 825 g','2013-11-28 00:00:00',NULL,'christmas-medium-leather-vip-box','Christmas Medium Leather Vip Box','Christmas Medium Leather Vip Box',NULL,727197546,'2013-11-28 00:49:31','2013-12-10 20:43:25'),(124,'Christmas Cylinder','Beautiful 3-floor VIP-box\r\nThis assortment contains about 19 chocolates.','2013-11-28 00:00:00',NULL,'christmas-cylinder','Christmas Cylinder Neuhaus','Christmas Cylinder Neuhaus',NULL,727197546,'2013-11-28 00:58:37','2013-11-28 01:24:09'),(125,'Tiroir Ouverte Box','Beautiful 2-floor big box.\r\nThis assortment contains about 38 chocolates.','2014-02-27 00:00:00',NULL,'tiroir-ouverte-box','Neuhaus Drawer Box','Neuhaus Drawer Box',NULL,727197546,'2013-12-04 17:15:36','2014-02-07 15:54:21'),(126,'Small Leather Vip Box','Leather box with all types of Neuhaus chocolates.\r\nThis assortment contains about 20 chocolates.','2013-12-04 00:00:00',NULL,'small-leather-vip-box','Small Leather Vip Box Neuhaus','Small Leather Vip Box Neuhaus',NULL,727197546,'2013-12-04 23:01:19','2013-12-04 23:07:07'),(127,'Small Prestige Box','Prestige boxes: the haute couture packaging by Neuhaus!\r\nThis assortment contains about 8 chocolates.','2013-12-04 00:00:00',NULL,'small-prestige-box','Small Prestige Box Neuhaus','Small Prestige Box Neuhaus',NULL,727197546,'2013-12-04 23:25:45','2013-12-11 08:54:22'),(128,'Medium Prestige Box','Prestige boxes: the haute couture packaging by Neuhaus! This assortment contains about 16 chocolates.','2013-12-04 00:00:00',NULL,'medium-prestige-box','Medium Prestige Box Neuhaus','Medium Prestige Box Neuhaus',NULL,727197546,'2013-12-04 23:45:54','2013-12-12 18:03:52'),(129,'Large Prestige Box','Prestige boxes: the haute couture packaging by Neuhaus! This assortment contains about 38 chocolates.','2013-12-04 00:00:00',NULL,'large-prestige-box','Large Prestige Box Neuhaus','Large Prestige Box Neuhaus',NULL,727197546,'2013-12-04 23:49:08','2013-12-04 23:52:45'),(130,'Large Leather Heart','Enormous beatiful leather heart. \r\nThis assortment contains about 85 chocolates.','2013-12-06 00:00:00',NULL,'large-leather-heart','Large Leather Heart Neuhaus','Large Leather Heart Neuhaus',NULL,727197546,'2013-12-06 00:49:20','2014-01-29 13:51:19');
